(23, 'Friso', 'friso', 'uploads/files/Brands/friso.png', 'friso,sữa', 'Thương hiệu sữa hàng đầu thế giới.', 'Chất lượng sản phẩm luôn được đặt lên hàng đầu  cho suwrc khỏe của bạn.', NULL, NULL, NULL),
(24, 'Xiaomi', 'xiaomi', 'uploads/files/Brands/xiaomi.png', 'xiaomi, mi', 'Xiaomi Việt Nam - Xiaomi Official Store Global.', 'Xiaomi là thương hiệu nổi tiếng thế giới về sản xuất điện thoại, đồng hồ, đồ gia dụng và nhiều thiết bị công nghệ cao khác.', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(25, 'OPPO', 'oppo', 'uploads/files/Brands/oppo.png', 'oppo', 'OPPO hiện nằm trong top 5 hãng sản xuất điện thoại di động lớn nhất thế giới.', 'OPPO Electronics Corp (với tên thương hiệu là OPPO - Camera Phone, trước là: OPPO - Smartphone) là nhà sản xuất thiết bị điện tử, điện thoại di động Android Trung Quốc.', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(26, 'MSI', 'msi', 'uploads/files/Brands/msi.png', 'msi, gaming', 'Laptop MSI | Máy tính xách tay MSI', 'Thương hiệu MSI là cụm từ viết tắt của Micro Star International là một công ty công nghệ đa quốc gia có trụ sở chính đặt tại Đài Loan.', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(27, 'Logitech', 'logitech', 'uploads/files/Brands/logitech.png', 'logitech', 'Mice, Computer Mice, Mac & PC Wireless Mice | Logitech.', 'Logitech là công ty điện tử tiêu dùng đầu tiên dán nhãn lên sản phẩm với số lượng carbon làm ấm khí hậu được sử dụng để tạo ra chúng.', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(28, 'HP', 'hp', 'uploads/files/Brands/hp.png', 'hp', 'Laptop HP - Ưu Đãi Khủng duy nhất hôm nay.', 'HP là một thương hiệu laptop khá quen thuộc và đáng để bạn tham khảo khi cần mua một chiếc máy tính mới. Bài viết hôm nay sẽ đưa ra cho các ...', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(29, 'Adidas', 'adidas', 'uploads/files/Brands/adidas.png', 'adidas', 'Adidas thương hiệu thời trang quần áo, giày dép yêu thích ...', 'Công ty Adidas được đăng ký nhãn hiệu là Adidas AG vào ngày 18 tháng 8 1949. Những thiết kế quần áo và giày của công ty biểu tượng cho ba sọc kẻ chéo song ...', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(30, 'Vsmart', 'vsmart', 'uploads/files/Brands/vsmart.png', 'vsmart', 'Vsmart – Thương hiệu điện thoại Việt xuất sắc nhất Tech ...', 'Vsmart là thương hiệu điện thoại đến từ Công ty Cổ phần Nghiên cứu và Sản xuất VinSmart - một công ty tiên phong trong lĩnh vực công nghệ trực ...', '2021-11-05 07:32:08', '2021-11-05 07:32:08', NULL),
(31, 'Lenovo', 'lenovo', 'uploads/files/Brands/lenovo.png', 'lenovo', 'Hãng Lenovo Của Nước Nào Sản Xuất? Có Những ... - HTTL', 'Lenovo là một thương hiệu công nghệ đến từ đất nước tỷ dân - Trung Quốc. Những ngày đầu thành lập, Lenovo được biết đến với cái tên Legend, có trụ sở chính đặt ...', NULL, NULL, NULL);
