(30, 'Thực phẩm', 'thuc-pham', '<i class=\"fas fa-utensils\"></i>', NULL, 'bánh,kẹo,sữa,đồ uống,đồ hộp', 'Thực phẩm chất lượng cao, hương vị thơm ngon & bổ dưỡng.', '<p>Thực phẩm chất lượng cao, đảm bảo chất lượng cho sức khỏe của gia đình bạn.</p>', '2021-09-11 07:14:49', '2021-09-11 07:14:49'),
(31, 'Mẹ & bé', 'me-be', '<i class=\"fas fa-baby\"></i>', NULL, 'bỉm,đồ chơi,đồ em bé,bình sữa,tã', 'Sản phẩm dành cho mẹ bỉm sửa và các bé sơ sinh.', '<p>Sản phẩm mẹ &amp; bé chất lượng đạt chuẩn quốc tế, đảm bảo an toàn cho mẹ &amp; bé.</p>', '2021-09-11 07:19:05', '2021-09-11 07:19:05'),
(32, 'Làm đẹp - Sức khỏe', 'lam-dep-suc-khoe', '<i class=\"fas fa-air-freshener\"></i>', NULL, 'mỹ phẩm,nước hoa,dầu gội,kem dưỡng da,chống nắng', 'Sản phẩm làm đẹp & sức khỏe cho phái nữ.', '<p>Mỹ phẩm, nước hoa, sữa tắm, chống nắng,… chất lượng cao, xuất sứ từ USA.</p>', '2021-09-11 07:24:17', '2021-09-11 07:24:17'),
(33, 'Thời trang - Phụ kiện', 'thoi-trang-phu-kien', '<i class=\"fas fa-tshirt\"></i>', NULL, 'quần,áo,khuyên tai,vòng tay,khăn choàng,giày,dép,túi,balo', 'Thời trang & phụ kiện chất lượng cao, đẹp và hợp thời trang.', '<p>Thời trang và phụ khiện chất lượng cao, luôn cập nhập xu hương thời trang mới nhất 2021.</p>', '2021-09-11 07:29:23', '2021-09-11 07:29:23'),
(34, 'Thể thao', 'the-thao', '<i class=\"far fa-futbol\"></i>', NULL, 'giày thể thao,gym,quần áo thể thao', 'Đồ thể thao của các hãng lớn nhất thế giới.', '<p>Đồ tập thể thao &amp; gym cho cả nam và nữ chất lượng cao mới nhất 2021.</p>', '2021-09-11 07:34:36', '2021-09-11 07:34:36');
