(22, 'iPhone 13 Pro Max', 'iphone-13-pro-max', 'chiếc', 'uploads/files/Products/Electronics/iphone-13-02.jpg', 'uploads/files/Products/Electronics/iphone-13-04.jpg,uploads/files/Products/Electronics/iphone-13-03.jpg,uploads/files/Products/Electronics/ip13-pro_2.jpg', 23, 11, '[\"24\"]', 34990000, 'iPhone 13 Pro Max | Chính hãng VN/A', 'Điện thoại iPhone 13 phiên bản Pro Max chắc chắn sẽ là chiếc smartphone cao cấp được quan tâm nhiều nhất trong năm 2021.', 'iphone,13 pro max', '2021-12-10 18:57:25', '2021-12-28 19:23:28', 5, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/iphone-13-pro-max.html', 10, '%', '<ul>\r\n	<li>Hiệu năng vượt trội - Chip Apple A15 Bionic mạnh mẽ, hỗ trợ mạng 5G tốc độ cao</li>\r\n	<li>Kh&ocirc;ng gian hiển thị sống động - M&agrave;n h&igrave;nh 6.7&quot; Super Retina XDR độ s&aacute;ng cao, sắc n&eacute;t</li>\r\n	<li>Trải nghiệm điện ảnh đỉnh cao - Cụm 3 camera k&eacute;p 12MP, hỗ trợ ổn định h&igrave;nh ảnh quang học</li>\r\n	<li>Tối ưu điện năng - Sạc nhanh 20 W, đầy 50% pin trong khoảng 30 ph&uacute;t</li>\r\n</ul>', '<h2><strong>Đ&aacute;nh gi&aacute; iPhone 13 Pro Max &ndash; Hiệu năng v&ocirc; đối, camera cực đỉnh</strong></h2>\r\n\r\n<p>iPhone 12 ra mắt cách đ&acirc;y chưa l&acirc;u, thì những tin đ&ocirc;̀n mới nh&acirc;́t v&ecirc;̀&nbsp;<strong>iPhone 13 Pro Max</strong>&nbsp;đã khi&ecirc;́n bao tín đ&ocirc;̀ c&ocirc;ng ngh&ecirc;̣ ngóng chờ. Cụm camera được n&acirc;ng c&acirc;́p, m&agrave;u sắc mới, đặc biệt l&agrave; m&agrave;n h&igrave;nh 120Hz với phần notch được l&agrave;m nhỏ gọn hơn chính là những đi&ecirc;̉m làm cho&nbsp;thu hút mọi sự chú ý trong năm nay.</p>\r\n\r\n<h3><strong>Thi&ecirc;́t k&ecirc;́ cạnh phẳng sang trọng, nhiều màu sắc n&ocirc;̉i b&acirc;̣t</strong></h3>\r\n\r\n<p>Dòng iPhone 12 được Apple áp dụng ng&ocirc;n ngữ thi&ecirc;́t k&ecirc;́ tương tự iPhone 12 năm ngo&aacute;i với ph&acirc;̀n cạnh vi&ecirc;̀n máy được dát phẳng sang trọng c&ugrave;ng bốn g&oacute;c được l&agrave;m bo cong nhẹ, đ&acirc;y c&oacute; thể được xem l&agrave; một thiết kế ho&agrave;i cổ từ d&ograve;ng iPhone 5 trước đ&oacute;. Vì th&ecirc;́ mà iPhone 13 Pro Max nói ri&ecirc;ng, cũng như dòng&nbsp;<a href=\"https://cellphones.com.vn/iphone-13.html\">điện thoại iPhone 13</a>&nbsp;nói chung, cũng sẽ đi theo ng&ocirc;n ngữ thi&ecirc;́t k&ecirc;́ này.</p>\r\n\r\n<p>Đi&ecirc;̉m thay đ&ocirc;̉i lớn tr&ecirc;n 13 Pro Max có th&ecirc;̉ là ph&acirc;̀n nh&ocirc; của cụm camera. Trong khi đ&oacute; mặt trước của thiết bị được phủ một lớp Ceramic Shield, loại vật liệu cứng hơn bất kỳ loại k&iacute;nh điện thoại th&ocirc;ng minh n&agrave;o hiện c&oacute; tr&ecirc;n thị trường, gi&uacute;p bảo vệ m&agrave;n h&igrave;nh iPhone hiệu quả.</p>\r\n\r\n<p><img alt=\"Thiết kế cạnh phẳng sang trọng, nhiều màu sắc nổi bật\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/apple/IPHONE-13-PRO-MAX-1.jpg\" /></p>\r\n\r\n<p>Xét v&ecirc;̀ ch&acirc;́t li&ecirc;̣u, iPhone 13 Pro Max v&acirc;̃n áp dụng ch&acirc;́t li&ecirc;̣u thép kh&ocirc;ng gỉ như thế hệ trước đ&oacute;. Mặt n&agrave;y cũng được phủ một lớp k&iacute;nh mờ gi&uacute;p hạn chế b&aacute;m bụi bẩn v&agrave; v&acirc;n tay. Ngoài ra, điện thoại cũng sẽ đảm bảo được khả năng ch&ocirc;́ng bụi / nước chu&acirc;̉n IP68.</p>\r\n\r\n<p>Về m&agrave;u sắc, iPhone 13 phi&ecirc;n bản Pro Max sẽ được ra mắt với nhi&ecirc;̀u t&ugrave;y chọn màu sắc khác nhau. Trong đ&oacute; gồm một số m&agrave;u nổi bật như: v&agrave;ng, bạc, xanh, đen,...</p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh với tai nhỏ nhỏ hơn, t&ocirc;́c đ&ocirc;̣ làm tươi 120 Hz</strong></h3>\r\n\r\n<p>M&ocirc;̣t trong những y&ecirc;́u t&ocirc;́ khi&ecirc;́n iPhone 13 Pro Max đáng mong chờ đó là thi&ecirc;́t k&ecirc;́ notch &quot;tai thỏ&quot; được thu gọn lại. Ngoài kích cỡ màn hình 6.7 inch với t&acirc;́m n&ecirc;̀n Super Retina XDR OLED, m&aacute;y sẽ có thi&ecirc;́t k&ecirc;́ notch được thu hẹp lại, giúp tăng tỷ l&ecirc;̣ hi&ecirc;̉n thị tr&ecirc;n màn hình đi&ecirc;̣n thoại. T&acirc;́t nhi&ecirc;n, những cảm bi&ecirc;́n quan trọng như TrueDepth, Face ID hoặc camera selfie đ&ecirc;̀u sẽ giữ nguy&ecirc;n vị trí.</p>', 'qt_hidden', 1639731600, 1639803600, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"24\",\"values\":[\"128GB\",\"256GB\",\"512GB\",\"1TB\"]}]', '[\"#30336b\",\"#ff7979\",\"#ffffff\",\"#222f3e\"]', '0', 153, NULL),
(23, 'Samsung Galaxy A72', 'samsung-galaxy-a72', 'chiếc', 'uploads/files/Products/Electronics/A721.jpg', 'uploads/files/Products/Electronics/A724.jpg,uploads/files/Products/Electronics/A723.jpg,uploads/files/Products/Electronics/A722.jpg', 23, 7, '[\"15\"]', 11500000, 'Samsung Galaxy A72 - Chính hãng, giá tốt.', 'Điện thoại Samsung Galaxy A72 - Thiết kế ấn tượng, hiệu năng mạnh mẽ · Màn hình AMOLED 6.7 inch Full HD+ sắc nét · Cụm 4 camera, cảm biến chính 64 MP.', 'galaxy,a72', '2021-12-10 19:14:49', '2021-12-28 19:26:54', 10, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/samsung-galaxy-a72.html', 10, '%', '<ul>\r\n	<li>Giải tr&iacute; điện ảnh chất lượng - M&agrave;n h&igrave;nh Super AMOLED tần số qu&eacute;t 90Hz, độ s&aacute;ng cao 800 nit.</li>\r\n	<li>Bắt trọng khoảnh khắc sắc n&eacute;t - Bộ camera 64MP, hỗ trợ chống rung 2 camera, Zoom xa 30X</li>\r\n	<li>An to&agrave;n khi sử dụng - Kh&aacute;ng nước, kh&aacute;ng bụi IP67</li>\r\n	<li>Hiệu năng ưu việt, đa nhiệm dễ d&agrave;ng - Snapdragon 720G 8 nh&acirc;n, RAM 8GB.</li>\r\n</ul>', '<h2><strong>Điện thoại Samsung Galaxy A72 - Thiết kế ấn tượng, hiệu năng mạnh mẽ</strong></h2>\r\n\r\n<p>Vừa mới đ&acirc;y Samsung vừa cho ra mắt chiếc smartphone&nbsp;<strong>Samsung Galaxy A72</strong>&nbsp;thuộc d&ograve;ng A của h&atilde;ng. C&oacute; thể n&oacute;i đ&acirc;y l&agrave; con &aacute;t chủ b&agrave;i của thương hiệu n&agrave;y trong năm 2020 bởi những n&acirc;ng cấp vượt trội từ thiết kế cho đến camera lẫn hiệu năng. Nếu bạn đang t&igrave;m kiếm cho m&igrave;nh một chiếc điện thoại Samsung mới th&igrave; c&oacute; thể đ&acirc;y l&agrave; sự lựa chọn ph&ugrave; hợp d&agrave;nh cho bạn.</p>\r\n\r\n<p>Ngo&agrave;i ra, bạn c&oacute; thể tham khảo th&ecirc;m&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-z-fold-3.html\">điện thoại Samsung Galaxy Z Fold 3 5G</a>&nbsp;sở hữu những c&ocirc;ng nghệ hiện đại v&agrave; cấu h&igrave;nh mạnh mẽ nhất hiện nay.</p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh AMOLED 6.7 inch Full HD+ sắc n&eacute;t</strong></h3>\r\n\r\n<p>Samsung A72 sở hữu thiết kế c&oacute; nhiều n&eacute;t tương đồng với những người đ&agrave;n anh trước đ&oacute; của m&igrave;nh.&nbsp;A72 c&oacute; k&iacute;ch thước v&ocirc; c&ugrave;ng nhỏ gọn, c&aacute;c cạnh viền được thiết kế bo cong từ đ&oacute; gi&uacute;p cho m&aacute;y c&oacute; một diện mạo cực k&igrave; hiện đại, đẹp mắt v&agrave; thời thượng hơn rất nhiều. Cảm biến v&acirc;n tay được dời l&ecirc;n m&agrave;n h&igrave;nh từ đem đến một diện mạo ho&agrave;n hảo kh&ocirc;ng ch&ecirc; v&agrave;o đ&acirc;u được.</p>\r\n\r\n<p><img alt=\"Kích thước nhỏ gọn bóng bẩy, màn hình AMOLED 6.7 inch Full HD+ sắc nét\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/samsung/samsung-galaxy-a72-1.jpg\" /></p>\r\n\r\n<p>M&agrave;n h&igrave;nh của Galaxy A72 l&agrave; m&agrave;n h&igrave;nh Super AMOLED c&oacute; k&iacute;ch thước rộng đến 6.7 inch c&oacute; độ ph&acirc;n giải Full HD+ từ đ&oacute; cho h&igrave;nh ảnh hiển thị sắc n&eacute;t v&agrave; ch&acirc;n thực. Phần viền m&agrave;n h&igrave;nh được l&agrave;m cong từ đ&oacute; đem đến kh&ocirc;ng gian hiển thị lớn v&agrave; v&ocirc; c&ugrave;ng thoải m&aacute;i.</p>\r\n\r\n<p>Mặc d&ugrave; c&oacute; k&iacute;ch thước m&agrave;n h&igrave;nh kh&aacute; lớn nhưng vẫn cho người d&ugrave;ng cảm gi&aacute;c cầm nắm điện thoại thoải m&aacute;i, bạn ho&agrave;n to&agrave;n c&oacute; thể dễ d&agrave;ng thao t&aacute;c với thiết bị của m&igrave;nh bằng 1 tay. M&agrave;n h&igrave;nh c&ograve;n sở hữu c&aacute;c dải m&agrave;u ch&iacute;nh x&aacute;c v&agrave; độ ph&acirc;n giải kh&aacute; cao từ đ&oacute; cho người d&ugrave;ng những trải nghiệm ấn tượng.</p>\r\n\r\n<h3><strong>Cụm 4 camera, cảm biến ch&iacute;nh 64 MP, camera trước 32MP ấn tượng</strong></h3>\r\n\r\n<p>C&oacute; thể n&oacute;i camera của A72 l&agrave; phần đột ph&aacute; nhất của chiếc smartphone n&agrave;y. M&aacute;y được trang bị đến 4 camera ở ph&iacute;a mặt sau với c&aacute;c th&ocirc;ng số ấn tượng lần lượt l&agrave;: Ch&iacute;nh 64 MP hỗ trợ chống rung quang học OIS. Ba camera phụ l&agrave; camera tele 8MP hỗ trợ zoom quang học 3x, camera si&ecirc;u rộng 12MP v&agrave;&nbsp;camera macro 5MP.</p>\r\n\r\n<p>Đặc biệt đ&acirc;y l&agrave; lần đầu ti&ecirc;n c&ocirc;ng nghệ chống rung quang học OIS được trang bị tr&ecirc;n model tầm trung của h&atilde;ng n&agrave;y, trước đ&acirc;y c&ocirc;ng nghệ n&agrave;y chỉ c&oacute; mặt ở những chiếc smartphone cao cấp. C&ocirc;ng nghệ n&agrave;y cho ph&eacute;p h&igrave;nh ảnh video ổn định v&agrave; sắc n&eacute;t hơn khi chụp v&agrave; quay.</p>', 'qt_hidden', 1639648800, 1639720800, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR4\",\"8GB DDR2\"]}]', '[\"#ffffff\",\"#222f3e\"]', '1', 24, NULL),
(24, 'Macbook Pro M1 2020', 'macbook-pro-m1-2020', 'chiếc', 'uploads/files/Products/Electronics/mbp-silver-select-1.jpg', 'uploads/files/Products/Electronics/mbp-silver-select-4.jpg,uploads/files/Products/Electronics/mbp-silver-select-3.jpg,uploads/files/Products/Electronics/mbp-silver-select-2.jpg', 26, 11, '[\"15\",\"33\"]', 35990000, 'Apple MacBook Pro 13 Touch Bar M1 256GB 2020 I Chính hãng Apple Việt Nam.', 'Máy tính bảng Macbook Pro M1 thế hệ mới vừa ra mắt được trang bị vi xử lý M1 do chính Apple tự thiết kế. Hứa hẹn mang đến hiệu năng cực kì mạnh mẽ, thời gian sử dụng cực kì ấn tượng.', 'macbook,pro 13 touch,m1', '2021-12-10 20:25:19', '2021-12-28 19:23:47', 0, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/macbook-pro-2020-13-inch-touch-bar-m1.html', 10, '%', '<h3><strong>Macbook Pro M1 2020 &ndash; Hiệu năng vượt trội với chip M1 mạnh mẽ</strong></h3>\r\n\r\n<p>M&aacute;y t&iacute;nh bảng<strong>&nbsp;Macbook Pro M1</strong>&nbsp;thế hệ mới vừa ra mắt được trang bị vi xử l&yacute; M1 do ch&iacute;nh Apple tự thiết kế. Hứa hẹn mang đến hiệu năng cực k&igrave; mạnh mẽ, thời gian sử dụng cực k&igrave; ấn tượng.</p>\r\n\r\n<h3><strong>Thiết kế trau chuốt từng đường n&eacute;t, trải nghiệm h&igrave;nh ảnh sắc n&eacute;t với m&agrave;n h&igrave;nh Retina</strong></h3>\r\n\r\n<p>Vẫn kế thừa thiết kế từ người tiềm nhiệm trước đ&oacute; của m&igrave;nh,&nbsp;<strong><a href=\"https://cellphones.com.vn/laptop/mac/macbook-pro.html\" target=\"_blank\">Macbook Pro 2020</a>&nbsp;M1</strong>&nbsp;vẫn sở hữu thiết kế nh&ocirc;m nguy&ecirc;n khối, c&aacute;c đường viền tr&ecirc;n m&aacute;y được cắt CNC tỉ mỉ, sắc xảo.</p>', '<h3><strong>Phản hồi si&ecirc;u tốc với vi xử l&yacute; M1 mạnh mẽ, macOS Big Sur nhiều t&iacute;nh năng mạnh mẽ</strong></h3>\r\n\r\n<p><img alt=\"Phản hồi siêu tốc với vi xử lý M1 mạnh mẽ\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/macbook/macbook-pro-touch-bar-m1-2.jpg\" /></p>\r\n\r\n<p>Vi xử l&yacute; M1 đến từ Apple với 8 nh&acirc;n cho CPU v&agrave; GPU mang đến tốc độ nhanh đến 2,8 lần, xử l&yacute; đồ họa nhanh hơn 5 lần thế hệ trước. T&iacute;ch hợp 16 nh&acirc;n Neurral Engine n&acirc;ng cao khả năng xử l&yacute; cho c&aacute;c t&aacute;c vụ Machine Learning nhanh hơn 15 lần.</p>\r\n\r\n<p><img alt=\"macOS Big Sur nhiều tính năng mạnh mẽ\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/macbook/macbook-pro-touch-bar-m1-3.jpg\" /></p>\r\n\r\n<p>MacOS Big Sur mới nhất tr&ecirc;n&nbsp;<strong>Macbook Pro M1 2020</strong>&nbsp;gi&uacute;p tối ưu cho vi xử l&yacute; mới. Hệ điều h&agrave;nh mới n&acirc;ng cấp giao diện người d&ugrave;ng, thay đổi biểu tượng ứng dụng theo hướng tối giản, bổ sung Control Center, Notification Center để t&ugrave;y chỉnh nhanh một số thiết lập, quản l&yacute; th&ocirc;ng b&aacute;o đến.</p>\r\n\r\n<h3><strong>Thời lượng pin l&ecirc;n đến 20 giờ, quạt tản nhiệt thế hệ mới</strong></h3>\r\n\r\n<p><img alt=\"Thời lượng pin lên đến 20 giờ\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/macbook/macbook-pro-touch-bar-m1-4.jpg\" /></p>\r\n\r\n<p>Nhờ sử dụng vi xử l&yacute; thiết kế ri&ecirc;ng n&ecirc;n Apple Macbook Pro 13 Touch Bar M1 đem đến cải tiến lớn về thời gian hoạt động. Chiếc m&aacute;y mang đến thời gian lướt web l&ecirc;n đến 17 giờ v&agrave; xem video li&ecirc;n tục 20 giờ đồng hồ.</p>', 'qt_hidden', 1639652400, 1639724400, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"8GB DDR4\",\"16GB DDR4\"]},{\"attribute_id\":\"33\",\"values\":[\"SSD: 512GB\",\"SSD: 256GB\"]}]', '[\"#dcdde1\",\"#a4b0be\"]', '0', 36, NULL),
(25, 'Apple AirPods Max', 'apple-airpods-max', 'chiếc', 'uploads/files/Products/Electronics/airpods-max_4.jpg', 'uploads/files/Products/Electronics/airpods-max_3.jpg,uploads/files/Products/Electronics/airpods-max_2.jpg,uploads/files/Products/Electronics/airpods-max_1.jpg', 25, 11, '[\"15\"]', 13900000, 'Tai nghe chụp tai chống ồn Apple AirPods Max | Chính hãng Apple Việt Nam.', 'Nắm bắt được nhu cầu người dùng Apple đã cho ra mắt một sản phẩm mới đó là  Airpods Max với nhiều tính năng tiện lợi như chống ồn kèm theo đó là chất lượng âm thanh rất tuyệt vời.', 'airpods,max', '2021-12-10 20:48:30', '2021-12-29 04:05:16', 0, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/apple-airpods-max.html', 5, '%', '<ul>\r\n	<li>T&iacute;nh năng chống ồn chủ động t&aacute;ch biệt &acirc;m nhạc khỏi c&aacute;c &acirc;m thanh xung quanh</li>\r\n	<li>Chức năng xuy&ecirc;n &acirc;m gi&uacute;p người d&ugrave;ng đ&agrave;m thoại m&agrave; kh&ocirc;ng cần giảm &acirc;m lượng</li>\r\n	<li>N&uacute;t vặn nhanh ch&oacute;ng chuyển chế độ hay chuyển b&agrave;i h&aacute;t,k&iacute;ch hoạt trợ l&yacute; ảo Siri</li>\r\n	<li>Phần tai nghe được bọc vải Fabric mềm mại tạo cảm gi&aacute;c đeo thoải m&aacute;i</li>\r\n	<li>Chip Apple H1 c&ugrave;ng Bluetooth 5.0 cho kết nối ổn định,kh&ocirc;ng gi&aacute;n đoạn</li>\r\n</ul>', '<h3><strong>Thiết kế chụp tai sử dụng &ecirc;m &aacute;i, chất liệu cao cấp nổi bật</strong></h3>\r\n\r\n<p>Đội ngũ thiết kế của Apple lu&ocirc;n mang đến những thiết kế rất đẹp v&agrave; thường trở th&agrave;nh trend khi ra mắt.&nbsp;<a href=\"https://cellphones.com.vn/thiet-bi-am-thanh/tai-nghe/headphones.html\">Tai nghe chụp tai Apple</a>&nbsp;Airpods Max cũng vậy, với việc sử dụng thiết kế chụp tại Apple đ&atilde; rất tinh tế về vẻ ngo&agrave;i.</p>\r\n\r\n<p>Cụ thể phần tai nghe chụp tai được l&agrave;m ho&agrave;n chỉnh ch&iacute;nh x&aacute;c mang đến cảm gi&aacute;c thoải m&aacute;i v&agrave; &ecirc;m &aacute;i khi đeo. Ngo&agrave;i ra phần thanh &ocirc;m đầu cũng được l&agrave;m ph&ugrave; hợp với v&ograve;m đầu nhất kh&ocirc;ng bị cấn khi đeo sử dụng.</p>\r\n\r\n<p><img alt=\"Thiết kế chụp tai sử dụng êm ái, chất liệu cao cấp nổi bật\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/headphones/Apple-Airpods-Studio-1.jpg\" /></p>\r\n\r\n<p>Chất liệu được sử dụng tr&ecirc;n chiếc tai nghe Apple Airpods Max cũng l&agrave; loại rất cao cấp. Đặc biệt phần tai nghe được sử dụng lớp đệm rất &ecirc;m cho khả năng b&aacute;m rất tốt khi sử dụng v&agrave; rất nhẹ khi đeo trong thời gian l&acirc;u.</p>\r\n\r\n<p>Phần v&ograve;m tai nghe cũng được sử dụng chất liệu đệm silicon kết hợp với v&ograve;m bao da ở ngo&agrave;i rất chắc chắn gi&uacute;p tai nghe kh&ocirc;ng cấn đ&egrave; l&ecirc;n đầu của bạn v&agrave; tạo cảm gi&aacute;c thoải m&aacute;i nhất kh&ocirc;ng chỉ đ&ocirc;i tai m&agrave; c&ograve;n ở cả chất liệu.</p>\r\n\r\n<h3><strong>Chất lượng &acirc;m thanh cực kỳ cao cấp, chống ồn hiệu quả</strong></h3>\r\n\r\n<p>Apple đ&atilde; trang bị tr&ecirc;n chiếc Airpods Max một bộ loa rất chất lượng với m&agrave;n loa si&ecirc;u mỏng mang đến &acirc;m thanh chất lượng nhất. Mọi dải &acirc;m đều được t&aacute;i hiện đến tai người d&ugrave;ng chi tiết, ch&acirc;n thực nhất.</p>\r\n\r\n<p>&Acirc;m thanh rất chi tiết, &acirc;m bass cao dải tần số cũng nằm ở mức cao cho khả năng ph&aacute;t &acirc;m thanh v&ograve;m 4D 5D rất chất lượng mang đến &acirc;m thanh tuyệt.</p>', 'qt_hidden', 1639648800, 1639720800, 0, 0, 'isAttribute', 1, '[]', '[\"#30336b\",\"#dcdde1\",\"#222f3e\",\"#e74c3c\"]', '0', 25, NULL),
(26, 'Samsung Galaxy Watch 4', 'samsung-galaxy-watch-4', 'chiếc', 'uploads/files/Products/Electronics/sm-r870_003_1.jpg', 'uploads/files/Products/Electronics/sm-r870_003_4.jpg,uploads/files/Products/Electronics/sm-r870_003_3.jpg,uploads/files/Products/Electronics/sm-r870_003_2.jpg', 25, 7, '[\"15\"]', 6990000, 'Đồng hồ Samsung Galaxy Watch 4.', 'Samsung Galaxy Watch 4 giữ nguyên thiết kế cổ điển đầy tinh túy vốn đã làm nên thành công của thế hệ tiền nhiệm Galaxy Watch 3.', 'galaxy,watch 4', '2021-12-10 21:11:44', '2021-12-28 21:19:35', 10, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/samsung-galaxy-watch-4.html', 5, '%', '<ul>\r\n	<li>Thiết kế cổ điển,m&agrave;n h&igrave;nh Amoled 1.19 inch hiển thị sắc n&eacute;t</li>\r\n	<li>Theo d&otilde;i sức khoẻ với chức năng đo nhịp tim,oxy trong m&aacute;u.....</li>\r\n	<li>Pin d&ugrave;ng trong 1.5 ng&agrave;y,sạc đầy trong 2 giờ</li>\r\n	<li>Chứng nhận độ bền chuẩn qu&acirc;n đội MIL-STD-810G</li>\r\n</ul>', '<h3><strong>Thi&ecirc;́t k&ecirc;́ c&ocirc;̉ đi&ecirc;̉n thanh lịch nhưng kh&ocirc;ng kém ph&acirc;̀n b&ecirc;̀n bỉ</strong></h3>\r\n\r\n<p>Samsung Galaxy Watch 4 giữ nguy&ecirc;n thi&ecirc;́t k&ecirc;́ c&ocirc;̉ đi&ecirc;̉n đ&acirc;̀y tinh túy v&ocirc;́n đã làm n&ecirc;n thành c&ocirc;ng của th&ecirc;́ h&ecirc;̣ ti&ecirc;̀n nhi&ecirc;̣m Galaxy Watch 3. Được ch&ecirc;́ tác tinh xảo, với ph&acirc;̀n khung vi&ecirc;̀n xoay và màn hình lớn giúp người đeo lu&ocirc;n d&ecirc;̃ dàng theo dõi giờ gi&acirc;́c, cũng như các th&ocirc;ng s&ocirc;́ sức khỏe mà Galaxy Watch 4 mang lại. Trọng lượng t&ocirc;̉ng nhẹ nhàng của đồng hồ giúp cho người đeo lu&ocirc;n thoải mái khi di chuy&ecirc;̉n hay v&acirc;̣n đ&ocirc;̣ng.</p>\r\n\r\n<p><img alt=\"Thiết kế cổ điển thanh lịch nhưng không kém phần bền bỉ\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/watch_band/samsung-galaxy-watch-4-1.jpg\" /></p>\r\n\r\n<p>Ngoài ra,<strong>&nbsp;Galaxy Watch 4</strong>&nbsp;còn đạt chứng nh&acirc;̣n ch&ocirc;́ng bụi và ch&ocirc;́ng th&acirc;́m nước chu&acirc;̉n IP68. Th&acirc;̣m chí, đ&ocirc;̣ b&ecirc;̀n đạt chu&acirc;̉n qu&acirc;n đ&ocirc;̣i sẽ đảm bảo b&ecirc;̀n bỉ theo thời gian.</p>\r\n\r\n<h3><strong>H&ecirc;̣ đi&ecirc;̀u hành Wear OS c&ugrave;ng c&ocirc;ng nghệ theo d&otilde;i sức khỏe&nbsp;</strong></h3>\r\n\r\n<p>M&ocirc;̣t thay đ&ocirc;̉i đáng chú ý tr&ecirc;n Samsung Galaxy Watch 4 đó là h&ecirc;̣ đi&ecirc;̀u hành Wear OS. Cùng với đó, Watch 4 cũng sẽ được trang bị th&ecirc;m nhi&ecirc;̀u tính năng hữu ích khác, như Google Maps. Cùng với đó, các tính năng b&ocirc;̉ trợ như hi&ecirc;̣n lịch sử tin nhắn và BitMoji cũng sẽ hi&ecirc;̣n di&ecirc;̣n tr&ecirc;n đồng hồ.</p>\r\n\r\n<p><img alt=\"Hệ điều hành Wear OS với nhiều tính năng sức khỏe hữu ích\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/watch_band/samsung-galaxy-watch-4-3.jpg\" /></p>\r\n\r\n<p>Những tính năng đo lường sức khỏe như ECG ghi đi&ecirc;̣n tim, đo n&ocirc;̀ng đ&ocirc;̣ oxy trong máu, và cảm bi&ecirc;́n SpO2 cũng xu&acirc;́t hi&ecirc;̣n tr&ecirc;n Samsung Galaxy Watch 4.</p>\r\n\r\n<p>V&ecirc;̀ tính năng đo n&ocirc;̀ng đ&ocirc;̣ oxy trong máu, tương tự như model trước, Samsung Watch 4 t&acirc;̣n dụng h&ecirc;̣ th&ocirc;́ng tia h&ocirc;̀ng ngoại b&ecirc;n trong đ&ecirc;̉ ước lượng chỉ s&ocirc;́ SpO2 của người đeo. Bởi vì chỉ s&ocirc;́ n&ocirc;̀ng đ&ocirc;̣ oxy trong máu ảnh hưởng lớn đ&ecirc;́n sức khỏe trong lúc t&acirc;̣p th&ecirc;̉ thao, vi&ecirc;̣c đồng hồ th&ocirc;ng minh lần n&agrave;y được tích hợp tính năng này cho th&acirc;́y đ&acirc;y là chi&ecirc;́c đ&ocirc;̀ng h&ocirc;̀ hữu ích cho những v&acirc;̣n đ&ocirc;̣ng vi&ecirc;n hoặc người y&ecirc;u th&ecirc;̉ thao nói chung.</p>', 'qt_hidden', 1639648800, 1639720800, 0, 0, 'isAttribute', 1, '[]', '[\"#ffffff\",\"#222f3e\"]', '0', 19, NULL),
(27, 'Xiaomi Redmi 9T', 'xiaomi-redmi-9t', 'chiếc', 'uploads/files/Products/Electronics/xiaomi-redmi-3.jpg', 'uploads/files/Products/Electronics/xiaomi-redmi-4.jpg,uploads/files/Products/Electronics/xiaomi-redmi-2.jpg,uploads/files/Products/Electronics/xiaomi-redmi-1.jpg', 23, 24, '[\"15\"]', 4200000, 'Điện thoại Xiaomi Redmi 9T phiên bản 4GB/64GB', 'Điện thoại Xiaomi Redmi 9T phiên bản 4GB/64GB được trang bị Snapdragon 662, viên pin khủng lên đến 6000mAh mang đến cho người dùng những trải nghiệm tuyệt vời.', 'xiaomi,redmi 9t', '2021-12-10 21:44:58', '2021-12-28 22:45:55', 0, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/xiaomi-redmi-9t-4gb-64gb.html', 5, '%', '<ul>\r\n	<li>Thiết kế thu h&uacute;t, m&agrave;u sắc tuyệt đẹp - Mặt lưng với c&aacute;c phi&ecirc;n bản m&agrave;u sắc trẻ trung, bắt mắt, hoạt tiết chống b&aacute;m v&acirc;n tay</li>\r\n	<li>Chụp ảnh chuy&ecirc;n nghiệp - Bốn camera AI 48MP chụp ảnh sắc n&eacute;t</li>\r\n	<li>Kh&ocirc;ng c&ograve;n lo lắng hết pin - Dung lượng pin si&ecirc;u cao 6000mAh, chu kỳ sạc l&ecirc;n đến 1000 lần, tuổi thọ pin l&acirc;u hơn 25%</li>\r\n	<li>Nhanh ch&oacute;ng v&agrave; ổn định trước c&aacute;c t&aacute;c vụ hằng ng&agrave;y - Snapdragon 662 hiệu suất cao, bộ nhớ trong UFS 2.2</li>\r\n	<li>Chi tiết trong từng khung h&igrave;nh - M&agrave;n h&igrave;nh Dot Drop FullHD+ 6.53 inch, chứng nhận &aacute;nh xanh thấp bảo vệ mắt</li>\r\n</ul>', '<h2><strong>Điện thoại Xiaomi Redmi 9T &ndash; Smartphone gi&aacute; rẻ, pin dung lượng lớn</strong></h2>\r\n\r\n<p>Chiếc smartphone&nbsp;<strong>Xiaomi Redmi 9T</strong>&nbsp;c&oacute; thể n&oacute;i l&agrave; bản dupe của mẫu Redmi Note 9 khi sở hữu cấu h&igrave;nh kh&aacute; tương đồng chỉ thay đổi ở con chip.</p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh giọt nước 6.53 inch</strong></h3>\r\n\r\n<p><a href=\"https://cellphones.com.vn/mobile/hang-sap-ve/xiaomi.html\" target=\"_self\">Điện thoại Xiaomi</a>&nbsp;n&agrave;y vẫn sở hữu m&agrave;n h&igrave;nh giọt nước quen thuộc. M&aacute;y sở hữu k&iacute;ch thước 6.53 inch tr&ecirc;n tấm nền IPS LCD c&ugrave;ng độ ph&acirc;n giải Full HD+. Nhờ đ&oacute;, m&aacute;y cho khả năng hiển thị tốt, m&agrave;u sắc ch&acirc;n thực.</p>\r\n\r\n<p><img alt=\"Màn hình giọt nước 6.53 inch\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/xiaomi/xiaomi-redmi-9t-1.jpg\" /></p>\r\n\r\n<h3><strong>Chip xử l&yacute; Snapdragon 662, 4GB RAM, pin 6.000 mAh</strong></h3>\r\n\r\n<p>Về cấu h&igrave;nh, Xiaomi Redmi 9T được trang bị con chip Snapdragon 662 c&ugrave;ng 4GB RAM v&agrave; 64GB bộ nhớ trong. Nhờ đ&oacute; m&aacute;y cho khả năng xử l&yacute; tốt c&aacute;c t&aacute;c vụ th&ocirc;ng thường như lướt web, nhắn tin. Về khả năng chơi game, m&aacute;y vẫn c&oacute; thể chiến được c&aacute;c tự game nhẹ với độ họa cơ bản.</p>\r\n\r\n<p><img alt=\"Chip xử lý Snapdragon 662, 4GB RAM, pin 6.000 mAh\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/xiaomi/xiaomi-redmi-9t-2.jpg\" /></p>\r\n\r\n<p><strong>Redmi 9T</strong>&nbsp;sở hữu vi&ecirc;n pin dung lượng l&ecirc;n đến 6.000 mAh. Nhờ đ&oacute; người d&ugrave;ng c&oacute; thể tho&aacute;i m&aacute;i sử dụng cả ng&agrave;y d&agrave;i, thậm ch&iacute; hai ng&agrave;y với người &iacute;t cơ bản. Hơn thế nữa, m&aacute;y c&ograve;n hỗ trợ sạc nhanh l&ecirc;n đến 18W, gi&uacute;p r&uacute;t gọn đ&aacute;ng kể thời gian sạc pin.</p>', 'qt_hidden', 1639537200, 1639652400, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR4\",\"6GB DDR4\"]}]', '[\"#30336b\",\"#222f3e\",\"#f0932b\",\"#05c46b\"]', '0', 15, NULL),
(28, 'OPPO Reno6 5G', 'oppo-reno6-5g', 'chiếc', 'uploads/files/Products/Electronics/reno6-1_1.jpg', 'uploads/files/Products/Electronics/reno6_2.jpg,uploads/files/Products/Electronics/reno6-3.jpg,uploads/files/Products/Electronics/reno-6-4.jpg', 23, 25, '[\"15\"]', 12990000, 'OPPO Reno6 5G', 'Thiết kế sang trọng cấu hình mạnh mẽ với chipset Dimensity 900, OPPO Reno6 5G sẽ mang đến cho người dùng trải nghiệm mượt mà.', 'oppo,reno6 5g', '2021-12-10 21:54:10', '2021-12-28 19:25:49', 10, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/oppo-reno-6.html', 5, '%', '<ul>\r\n	<li>Thiết kế ấn tượng, m&agrave;u sắc c&aacute; t&iacute;nh - Thiết kế tr&agrave;n viền, mỏng nhẹ chỉ 182g</li>\r\n	<li>Tăng tốc kết nối, dẫn đầu xu hướng - Dimensity 900 5G (6 nm) mạnh mẽ, kết nối 5G si&ecirc;u nhanh</li>\r\n	<li>Chuy&ecirc;n gia nhiếp ảnh ch&acirc;n dung - Bộ 3 camera l&ecirc;n tới 64 MP, sắc n&eacute;t, ấn tượng</li>\r\n	<li>M&agrave;n h&igrave;nh lớn, sắc n&eacute;t với tốc độ l&agrave;m mới cao - M&agrave;n h&igrave;nh AMOLED 6.43 inch Full HD, 90Hz</li>\r\n	<li>Dung lượng pin lớn, c&ocirc;ng nghệ sạc nhanh hiện đại - Vi&ecirc;n pin 4300mAh, sạc nhanh 65W</li>\r\n</ul>', '<h2><strong>Đ&aacute;nh gi&aacute; OPPO Reno6 5G - Nhỏ gọn, mạnh mẽ với chipset&nbsp;MediaTek</strong></h2>\r\n\r\n<p>Tiếp theo phần ra mắt của series Reno 5 th&igrave; Oppo lại chuẩn bị tr&igrave;nh l&agrave;ng mẫu smartphone mới nhất mang t&ecirc;n Reno6. Thiết kế sang trọng cấu h&igrave;nh mạnh mẽ với chipset Dimensity 900,&nbsp;<strong>OPPO Reno6 5G</strong>&nbsp;sẽ mang đến cho người d&ugrave;ng trải nghiệm mượt m&agrave;.</p>\r\n\r\n<h3><strong>Thiết kế thời trang, sang trọng đầy ấn tượng</strong></h3>\r\n\r\n<p>Điện thoại&nbsp;OPPO Reno6 5G l&agrave; sản phẩm của c&ocirc;ng nghệ thiết kế v&ocirc; c&ugrave;ng ho&agrave;n hảo v&agrave; ấn tượng. C&aacute;c g&oacute;c cạnh của m&aacute;y được bo cong mềm mại, uyển chuyển mang đến sự mượt m&agrave; v&agrave; tinh tế. K&iacute;ch thước m&aacute;y nhỏ gọn dễ d&agrave;ng cầm nắm trong qu&aacute; tr&igrave;nh sử dụng.</p>\r\n\r\n<p><img alt=\"Thiết kế thời trang, sang trọng đầy ấn tượng\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/oppo/oppo-reno-6-1.jpg\" /></p>\r\n\r\n<p>Mặt trước của điện thoại cũng ấn tượng kh&ocirc;ng k&eacute;m với m&agrave;n h&igrave;nh thiết kế kiểu tr&agrave;n viền với độ cong nhẹ 2.5D. Hai cạnh viền si&ecirc;u mỏng, c&ugrave;ng với đ&oacute; l&agrave; camera đục lỗ gi&uacute;p mở rộng tối đa kh&ocirc;ng gian hiển thị.</p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh 6.43 inches với tốc độ l&agrave;m mới 90Hz</strong></h3>\r\n\r\n<p>Oppo Reno6 5G sở hữu m&agrave;n h&igrave;nh với k&iacute;ch thước 6.43 inches độ ph&acirc;n giải Full HD+. Từ đ&oacute; mang đến cho người d&ugrave;ng h&igrave;nh ảnh v&ocirc; c&ugrave;ng ch&acirc;n thật v&agrave; sắc n&eacute;t. Đặc biệt l&agrave; m&agrave;u đen s&acirc;u gi&uacute;p thu h&uacute;t sự tập trung của người nh&igrave;n v&agrave;o những video giải tr&iacute; hay những game đồ họa hấp dẫn.</p>\r\n\r\n<p><img alt=\"Màn hình OLED 6.43 inches với tốc độ làm mới 120Hz\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/oppo/oppo-reno-6-2.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, điện thoại c&ograve;n khẳng định được vị thế của m&igrave;nh so với c&aacute;c mẫu kh&aacute;c c&ugrave;ng ph&acirc;n kh&uacute;c khi được t&iacute;ch hợp tần số qu&eacute;t 90 Hz, mang đến độ mượt m&agrave; trong những trải nghiệm vuốt chạm h&agrave;ng ng&agrave;y. V&agrave; ch&uacute;ng thật ph&ugrave; hợp với những ai đam m&ecirc; chơi game khi ho&agrave;n to&agrave;n kh&ocirc;ng c&oacute; độ trễ.</p>\r\n\r\n<h3><strong>Chip MediaTek mạnh mẽ, dung lượng RAM lớn</strong></h3>\r\n\r\n<p>OPPO Reno6 5G&nbsp;lại lần nữa g&acirc;y ấn tượng với người d&ugrave;ng bởi cấu h&igrave;nh tương đối mạnh mẽ. M&aacute;y được trang bị chipset 6 nm v&agrave; l&agrave; nền tảng Mediatek, hay c&ograve;n được gọi với c&aacute;i t&ecirc;n quen thuộc hơn l&agrave; Dimensity 900. Với con chip n&agrave;y, người d&ugrave;ng thoải m&aacute;i trải nghiệm c&aacute;c game đồ họa hot nhất hiện nay m&agrave; kh&ocirc;ng cần lo giật lag.</p>', 'qt_hidden', 1639537200, 1639652400, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR4\",\"6GB DDR4\"]}]', '[\"#30336b\",\"#222f3e\"]', '0', 8, NULL),
(29, 'Laptop ASUS Zenbook UX425EA', 'laptop-asus-zenbook-ux425ea', 'chiếc', 'uploads/files/Products/Electronics/laptop-asus-1.jpg', 'uploads/files/Products/Electronics/laptop-asus-4.jpg,uploads/files/Products/Electronics/laptop-asus-3.jpg,uploads/files/Products/Electronics/laptop-asus-2.jpg', 26, 9, '[\"15\"]', 30690000, 'Laptop ASUS Zenbook UX425EA', 'Laptop 14\" mỏng nhất thế giới với hệ thống cổng kết nối đa dạng, nay laptop ASUS Zenbook UX425EA được cập nhật CPU Intel® Core™ 11th Gen, đồ họa đẳng cấp Intel Iris® Xe và thiết kế màn hình 4 viền mỏng NanoEdge.', 'asus,zenbook,ux425ea', '2021-12-10 22:05:52', '2021-12-28 19:21:33', 0, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/laptop-asus-zenbook-14-ux425ea-ki439t.html', 10, '%', '<p>-&nbsp; &nbsp;<strong>Thiết kế tinh giản, t&iacute;nh di động cao:&nbsp;</strong>Nhỏ gọn, tinh tế từ chất liệu hợp kim nh&ocirc;m, độ mỏng chỉ 13,9mm v&agrave; nhẹ từ 1,11 kg; thời lượng pin l&ecirc;n đến 21 tiếng; 2 t&ugrave;y chọn m&agrave;u sắc tinh tế.&nbsp;</p>\r\n\r\n<p><strong>-&nbsp; &nbsp;Đầy đủ cổng kết nối:</strong>&nbsp;laptop 14&quot; mỏng nhất thế giới với đầy đủ cổng kết nối bao gồm HDMI, USB Type-A v&agrave; Thunderbolt&trade;&nbsp;4 USB-C&reg;&nbsp;cho kết nối to&agrave;n diện.</p>\r\n\r\n<p>-&nbsp; &nbsp;<strong>Thiết kế c&ocirc;ng th&aacute;i học:</strong>&nbsp;M&agrave;n h&igrave;nh viền mỏng NanoEdge cho tỉ lệ hiển thị l&ecirc;n đến 90%, ASUS NumberPad, bản lề ErgoLift, camera IR, t&ugrave;y chỉnh tản nhiệt v&agrave; chế độ lọc tiếng ồn AI.</p>\r\n\r\n<p>-&nbsp; &nbsp;<strong>Hiệu năng ấn tượng:</strong>&nbsp;CPU Intel&reg;&nbsp;Core&trade;&nbsp;thế hệ 11 mới nhất, RAM l&ecirc;n đến 16GB, 512GB SSD PCIe&reg;&nbsp;3.0 v&agrave; WiFi 6 (802.11ax) mới nhất với WiFi Smart Connect.</p>', '<h2><strong>Đ&aacute;nh gi&aacute; chi tiết ASUS Zenbook UX425EA</strong></h2>\r\n\r\n<h3><strong>Thiết kế vượt thời gian, di động dễ d&agrave;ng&nbsp;</strong></h3>\r\n\r\n<p>Thiết kế m&agrave;n h&igrave;nh 4 viền mỏng NanoEdge mang đến tỉ lệ m&agrave;n h&igrave;nh tr&ecirc;n th&acirc;n m&aacute;y l&ecirc;n đến 90%, tăng đ&aacute;ng kể diện t&iacute;ch hiển thị. Trải nghiệm người d&ugrave;ng cũng được cải thiện nhờ những n&acirc;ng cấp đ&aacute;ng ch&uacute; &yacute; như b&agrave;n ph&iacute;m số ảo ASUS NumberPad 2.0, thời lượng pin l&ecirc;n đến 21 tiếng, thiết kế b&agrave;n ph&iacute;m edge-to-edge ho&agrave;n to&agrave;n mới, bản lề ErgoLift, v&agrave; camera IR nhận diện khu&ocirc;n mặt nhanh. ZenBook 14 c&oacute; 2 t&ugrave;y chọn m&agrave;u sắc tinh tế: X&aacute;m th&ocirc;ng v&agrave; Bạc &aacute;nh t&iacute;m.</p>\r\n\r\n<p><img alt=\"Thiết kế vượt thời gian, di động dễ dàng \" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/laptop-asus-zenbook-14-ux425ea-ki439t-1.jpg\" /></p>\r\n\r\n<p>ZenBook 14 d&agrave;nh cho những ai muốn một m&agrave;n h&igrave;nh lớn hơn trong th&acirc;n m&aacute;y gọn nhẹ với khung m&aacute;y kim loại chắc chắn nhưng mỏng chỉ 13,9mm. ZenBook 14 được trang bị vi&ecirc;n pin dung lượng lớn gi&uacute;p m&aacute;y c&oacute; thể hoạt động đến 21 giờ chỉ với 1 lần sạc. Nhờ đ&oacute; người d&ugrave;ng c&oacute; thể kh&ocirc;ng cần mang theo sạc tr&ecirc;n những chuyến đi của m&igrave;nh. Do đ&oacute;, ZenBook 14 sẽ l&agrave; sự lựa chọn ho&agrave;n hảo cho lối sống on-the-go hiện đại.</p>\r\n\r\n<p><img alt=\"Thiết kế vượt thời gian, di động dễ dàng \" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/laptop-asus-zenbook-14-ux425ea-ki439t-0.JPG\" /></p>\r\n\r\n<p>Thiết kế tối giản v&agrave; tinh tế của ZenBook 14 kết hợp c&ugrave;ng 2 m&agrave;u sắc t&ugrave;y chọn: X&aacute;m th&ocirc;ng với lớp phủ b&oacute;ng mang đến cảm gi&aacute;c điềm tĩnh m&agrave; mạnh mẽ; Bạc &aacute;nh t&iacute;m cho cảm gi&aacute;c sang trọng, đầy thu h&uacute;t v&agrave; hiện đại, lớp phủ nh&aacute;m kết hợp ho&agrave;n hảo c&ugrave;ng với nắp m&aacute;y kim loại của ZenBook.</p>\r\n\r\n<h3><strong>Đầy đủ cổng kết nối</strong></h3>\r\n\r\n<p>ZenBook 14 t&aacute;i định nghĩa về một chiếc laptop mỏng nhẹ: laptop mỏng nhất với đầy đủ cổng kết nối. Với độ mỏng chỉ 13,9mm nhưng vẫn sở hữu cổng HDMI v&agrave; USB TypeA, 2 cổng Thunderbolt 4 USB-C tốc độ cao v&agrave; khe đọc thẻ microSD gi&uacute;p cho việc sao ch&eacute;p dữ liệu dễ d&agrave;ng hơn. Kh&ocirc;ng c&oacute; 14&rdquo; n&agrave;o kh&aacute;c trong c&ugrave;ng ph&acirc;n kh&uacute;c được trang bị đầy đủ c&aacute;c cổng kết nối trong th&acirc;n m&aacute;y mỏng như ZenBook 14. Đặc biệt, m&aacute;y được trang bị hai cổng Thunderbolt 4 USB-C kết nối 2 chiều, hỗ trợ sạc nhanh, xuất đến 2 m&agrave;n h&igrave;nh 4K UHD, v&agrave; tốc độ chuyển dữ liệu l&ecirc;n đến 40 Gbps.</p>', 'qt_hidden', 1639544400, 1639702800, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"8GB DDR4\",\"16GB DDR4\"]}]', NULL, '0', 16, NULL),
(31, 'ASUS ROG Phone 5', 'asus-rog-phone-5', 'chiếc', 'uploads/files/Products/Electronics/asus-rog-1.jpg', 'uploads/files/Products/Electronics/asus-rog-4.jpg,uploads/files/Products/Electronics/asus-rog-3.jpg,uploads/files/Products/Electronics/asus-rog-2.jpg', 23, 9, NULL, 22990000, 'ASUS ROG Phone 5 chính hãng', 'Với những game thủ chuyên nghiệp mong muốn sở hữu một chiếc smartphone gaming có hiệu năng \"siêu cấp\" cho những tựa game MOBA hoặc sinh tồn đình đám hiện nay thì ROG Phone 5 sẽ là chiếc điện thoại có thể giúp bạn thoải mái chiến game mượt mà với cấu hình cực đại.', 'asus,rog phone 5', '2021-12-11 23:58:10', '2021-12-25 12:18:39', 17, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/asus-rog-phone-5.html', 5, '%', '<ul>\r\n	<li>Chinh phạt mọi giới hạn - Snapdragon 888 mạnh mẽ, RAM LPDDR5, bộ nhớ UFS 3.1</li>\r\n	<li>Hiển thị đẳng cấp - M&agrave;n h&igrave;nh AMOLED tần số qu&eacute;t 144Hz, phản hồi 1ms, k&iacute;nh Gorilla Victus</li>\r\n	<li>T&iacute;nh năng d&agrave;nh cho game thủ - Cảm ứng đa điểm AirTrigger 5, loa k&eacute;p chất lượng</li>\r\n	<li>Chiến game bất tận - Pin khủng 6000mAh, sạc si&ecirc;u tốc 65W</li>\r\n</ul>', '<h3><strong>Thi&ecirc;́t k&ecirc;́ h&acirc;̀m h&ocirc;́, màn hình 6.78 inch FHD+ sắc nét</strong></h3>\r\n\r\n<p>Điện thoại Asus ROG Phone 5 v&acirc;̃n giữ nguy&ecirc;n thi&ecirc;́t k&ecirc;́ h&acirc;̀m h&ocirc;́ nguy&ecirc;n bản của dòng ROG Phone trứ danh. Logo ROG cùng những đường nét được khắc họa tỉ mỉ tr&ecirc;n lớp vỏ nh&ocirc;m nguy&ecirc;n kh&ocirc;́i kính Gorilla Glass&nbsp;Victus&nbsp;cứng cáp, với t&ocirc;ng màu đỏ - đen chủ đạo đặc trưng làm n&ecirc;n m&ocirc;̣t chi&ecirc;́c smartphone gaming đ&acirc;̀y cá tính &amp; mạnh mẽ.</p>\r\n\r\n<p>ASUS cũng tinh t&ecirc;́ trong thi&ecirc;́t k&ecirc;́ phím cứng và c&ocirc;̉ng sạc b&ecirc;n ngoài nhằm tạo đi&ecirc;̀u ki&ecirc;̣n chơi game thu&acirc;̣n lợi nh&acirc;́t cho game thủ.&nbsp;Cách b&ocirc;́ trí c&ocirc;̉ng USB và jack tai nghe 3.5mm giúp game thủ thu&acirc;̣n tay hơn, kh&ocirc;ng bị vướng víu khi c&acirc;̀m máy xoay ngang.</p>\r\n\r\n<p><img alt=\"Thiết kế hầm hố đặc trưng từ dòng ROG Phone, màn hình 6.7 inch FHD+ hiển thị sắc nét\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/asus/asus-rog-phone-5-1.JPG\" /></p>\r\n\r\n<p>Asus ROG Phone 5 t&ocirc;́i ưu hóa trải nghi&ecirc;̣m quan sát trong từng trò chơi với màn hình 6.78 inch Full HD+ (2400 x 1080 pixels). Sử dụng n&ecirc;̀n màu AMOLED, với t&acirc;̀n s&ocirc;́ quét đ&ecirc;́n 144 Hz và ch&ecirc;́ đ&ocirc;̣ hình ảnh HDR10+ tương phản 100.000:1, b&acirc;́t kỳ tựa game nào, dù là sinh t&ocirc;̀n hay phi&ecirc;u lưu, cũng sẽ trở n&ecirc;n s&ocirc;́ng đ&ocirc;̣ng với cài đặt hình ảnh t&ocirc;́i đa tr&ecirc;n chiếc điện thoại n&agrave;y.</p>\r\n\r\n<p><img alt=\"màn hình 6.78 inch Full HD+\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/asus/asus-rog-phone-5-2.png\" /></p>\r\n\r\n<h3><strong>C&acirc;́u hình đỉnh cao với Snapdragon 888 (5nm)</strong></h3>\r\n\r\n<p>Với ROG Phone 5, kh&ocirc;ng tựa game nào là kh&ocirc;ng th&ecirc;̉ chinh phục được. ASUS đã trang bị cho m&acirc;̃u smartphone gaming này &quot;c&ocirc;̃ máy&quot; mang t&ecirc;n Qualcomm Snapdragon 888 5G ti&ecirc;́n trình 5nm.</p>\r\n\r\n<p>Snapdragon 888 t&ocirc;́i ưu hóa nhi&ecirc;̀u tính năng như camera, ch&acirc;́t lượng voice call, bảo m&acirc;̣t, chu&acirc;̉n WiFi 6E k&ecirc;́t n&ocirc;́i b&ecirc;̀n vững, ti&ecirc;u hao năng lượng ti&ecirc;́t ki&ecirc;̣m hơn, và tr&ecirc;n h&ecirc;́t là hi&ecirc;̣u năng gaming đỉnh cao.</p>\r\n\r\n<p>Đi kèm với Snapdragon 888 chính là chip c&acirc;́u hình GPU Qualcomm Adreno 660. Với b&ocirc;̣ đ&ocirc;i này bạn có th&ecirc;̉ y&ecirc;n t&acirc;m thi&ecirc;́t l&acirc;̣p đ&ocirc;̀ họa trò chơi l&ecirc;n mức cực đại (max setting) và t&acirc;̣n hưởng trải nghi&ecirc;̣m gaming đẳng c&acirc;́p tr&ecirc;n ROG Phone 5.</p>\r\n\r\n<p>Điện thoại ROG Phone 5 còn được trang bị dung lượng RAM 16 GB giúp h&ecirc;̣ th&ocirc;́ng xử lý dữ li&ecirc;̣u &ecirc;m mượt hơn với nhi&ecirc;̀u tác vụ. Ngoài ra chi&ecirc;́c máy còn có b&ocirc;̣ nhớ lưu trữ từ 256 GB cho phép game thủ thỏa sức tải v&ecirc;̀ b&acirc;́t kỳ tựa game nào đang &quot;hot&quot; hi&ecirc;̣n nay.</p>\r\n\r\n<p><img alt=\"Cấu hình đỉnh cao với Snapdragon 888 (5nm) và chip GPU Adreno 630\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/asus/asus-rog-phone-5-4.png\" /></p>\r\n\r\n<h3><strong>&Acirc;m thanh Hi-Res, h&ecirc;̣ th&ocirc;́ng làm mát chuy&ecirc;n bi&ecirc;̣t&nbsp;</strong></h3>\r\n\r\n<p>&Acirc;m thanh là m&ocirc;̣t trong những y&ecirc;́u t&ocirc;́ ảnh hưởng đ&ecirc;́n trải nghi&ecirc;̣m gaming của bạn. Với<strong>&nbsp;Asus</strong>&nbsp;<strong>ROG Phone 5</strong>, chi&ecirc;́c máy được tích hợp b&ocirc;̣ khu&ecirc;́ch đại &acirc;m thanh Cirrus Logic th&ocirc;ng minh giúp tạo &acirc;m thanh to &amp; rõ tr&ecirc;n mọi cử chỉ.</p>\r\n\r\n<p>Sử dụng h&ecirc;̣ th&ocirc;́ng &acirc;m&nbsp;Hi-Res l&ecirc;n đến 384 kHz / 32-bit&nbsp;với h&ecirc;̣ th&ocirc;́ng loa ngoài kép, bạn sẽ đắm chìm vào b&acirc;̀u kh&ocirc;ng khí căng thẳng của từng tr&acirc;̣n đ&acirc;́u, hoặc th&ecirc;́ giới mở đ&acirc;̀y s&ocirc;́ng đ&ocirc;̣ng của trò chơi RPG.</p>\r\n\r\n<p>Trang bị h&ecirc;̣ th&ocirc;́ng làm mát với quạt tản nhiệt quạt tản nhiệt gắn ngo&agrave;i AeroActive Cooler 5. Nhờ đ&oacute; đi&ecirc;̣n thoại ROG Phone 5 sẽ lu&ocirc;n mát mẻ trong khi v&acirc;̣n hành những tựa game &quot;nặng đ&ocirc;&quot;. Bổ sung c&aacute;c n&uacute;t tản nhiệt gi&uacute;p nhiệt độ bề mặt thấp hơn đến 15 độ, đảm bảo bạn lu&ocirc;n sử dụng chi&ecirc;́c smartphone của mình l&acirc;u dài &amp; &ocirc;̉n định.</p>', 'qt_hidden', 1639540800, 1639742400, 0, 0, 'isAttribute', 1, '[]', '[\"#ffffff\",\"#222f3e\"]', '0', 7, NULL),
(34, 'Laptop MSI Gaming Bravo 15', 'laptop-msi-gaming-bravo-15', 'chiếc', 'uploads/files/Products/Electronics/laptop-msi-1.jpg', 'uploads/files/Products/Electronics/laptop-msi-4.jpg,uploads/files/Products/Electronics/laptop-msi-3.jpg,uploads/files/Products/Electronics/laptop-msi-2.jpg', 26, 26, '[\"16\"]', 24990000, 'Laptop MSI Gaming Bravo 15 B5DD-028VN', 'Bạn đang cần một chiếc laptop sở hữu cấu hình vượt trội với sức mạnh bùng nổ sẵn sàng chinh chiến mọi mặt trận? Hãy đến với laptop MSI Bravo 15 B5DD-028VN chính hãng, nơi tích tụ mọi yếu tố hoàn hảo cho bạn!', 'msi,gaming,baravo 15', '2021-12-12 04:33:00', '2021-12-28 19:25:30', 15, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/laptop-msi-bravo-15-b5dd-028vn.html', 10, '%', '<ul>\r\n	<li>Về GPU, Bravo 15 sử dụng&nbsp;<a href=\"https://www.hanoicomputer.vn/vga-amd\" target=\"_blank\">card đồ họa AMD</a>&nbsp;Radeon RX5500M giống như người anh Alpha 15&nbsp;</li>\r\n	<li>Dung lượng 4GB DDR6. M&aacute;y cũng được trang bị 8Gb&nbsp;<a href=\"https://www.hanoicomputer.vn/ram-bo-nho-trong\" target=\"_blank\">RAM</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.hanoicomputer.vn/o-cung-ssd\" target=\"_blank\">SSD</a>&nbsp;NVMe 512Gb.</li>\r\n	<li>Quả l&agrave; một cấu h&igrave;nh qu&aacute; khủng, sẵn s&agrave;ng để cho anh em mua về l&agrave; chiến th&ocirc;i</li>\r\n</ul>', '<h3><strong>Tăng cường sức mạnh với AMD Ryzen &trade; c&ocirc;ng nghệ 7nm ti&ecirc;n tiến, đồ họa Radeon &trade; RX</strong></h3>\r\n\r\n<p><a href=\"https://cellphones.com.vn/laptop/msi/gaming.html\" target=\"_blank\"><strong>Laptop MSI Gaming</strong></a>&nbsp;n&agrave;y c&oacute; sức mạnh c&oacute; thể s&aacute;nh ngang với một chiếc PC để b&agrave;n nhờ bộ vi xử l&yacute; AMD Ryzen &trade; c&ocirc;ng nghệ 7nm ti&ecirc;n tiến. Nhờ c&ocirc;ng nghệ n&agrave;y, laptop MSI Gaming Bravo 15 B5DD-028VN c&oacute; thể sẵn s&agrave;ng đương đầu với mọi bộ game đồ họa nặng nhất.</p>\r\n\r\n<p><img alt=\"Laptop MSI Bravo 15 B5DD-028VN\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/Laptop-msi-bravo-15-b5dd-027vn-1.jpg\" /></p>\r\n\r\n<p>MSI Gaming Bravo 15 c&ograve;n được trang bị chip đồ họa Radeon &trade; RX gi&uacute;p mọi h&igrave;nh ảnh game v&ocirc; c&ugrave;ng sống động, sắc n&eacute;t.</p>\r\n\r\n<p><em>&gt;&gt;&gt;&nbsp;<strong>Xem th&ecirc;m</strong>:&nbsp;<a href=\"https://cellphones.com.vn/laptop-msi-gaming-gp76-leopard-11ug-280vn.html\" target=\"_blank\">Laptop MSI Gaming GP76 Leopard 11UG-280VN</a>&nbsp;mạnh mẽ c&acirc;n mọi tựa game</em></p>\r\n\r\n<h3><strong>&Acirc;m thanh si&ecirc;u đỉnh, hệ thống tản nhiệt chất lượng</strong></h3>\r\n\r\n<p>Laptop MSI Gaming Bravo 15 B5DD-028VN R7-5800H được trang bị &acirc;m thanh si&ecirc;u đỉnh với Hi-Resolution Audio. Bạn c&oacute; thể đắm ch&igrave;m s&acirc;u trong những bản nhạc du dương v&agrave; thả lỏng ho&agrave;n to&agrave;n để chill thư gi&atilde;n.</p>\r\n\r\n<p><img alt=\"Laptop MSI Bravo 15 B5DD-028VN\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/Laptop-msi-bravo-15-b5dd-027vn-2.jpg\" /></p>\r\n\r\n<p>Hệ thống tản nhiệt dẫn hơi n&oacute;ng từ trong laptop ra ngo&agrave;i, bạn c&oacute; thể sử dụng MSI Gaming Bravo 15 trong thời gian d&agrave;i kh&ocirc;ng lo n&oacute;ng m&aacute;y, gi&uacute;p tăng tuổi thọ cho thiết bị.</p>\r\n\r\n<h2><strong>Mua ngay Laptop MSI Gaming Bravo 15 B5DD-028VN ch&iacute;nh h&atilde;ng tại CellphoneS</strong></h2>\r\n\r\n<p>Laptop MSI Gaming đ&atilde; đem đến những trải nghiệm gaming vượt trội so với d&ograve;ng laptop th&ocirc;ng thường. Để sở hữu chiếc laptop cực chất n&agrave;y, h&atilde;y li&ecirc;n hệ ngay với cửa h&agrave;ng trực tuyến CellphoneS.&nbsp;Bạn sẽ được giải đ&aacute;p mọi thắc mắc, chi tiết sản phẩm qua tổng đ&agrave;i chăm s&oacute;c kh&aacute;ch h&agrave;ng: 1800.2097 hoặc gh&eacute; thăm website của ch&uacute;ng t&ocirc;i: www.cellphones.com.vn.</p>', 'qt_hidden', 1639544400, 1639702800, 0, 0, 'isAttribute', 2, '[{\"attribute_id\":\"16\",\"values\":[\"Ryzen 7 5800H\",\"Ryzen 5 5600H\",\"Ryzen 5 – 4600H\"]}]', NULL, '0', 7, NULL),
(35, 'Tất thể thao RS 500', 'tat-the-thao-rs-500', 'đôi', 'uploads/files/Products/Fashions/tatdennam_1.jpg', 'uploads/files/Products/Fashions/tatdennam_4.jpg,uploads/files/Products/Fashions/tatdennam_3.jpg,uploads/files/Products/Fashions/tatdennam_2.jpg', 34, 22, NULL, 145000, 'ất thể thao RS 500 cho người lớn - Gói 3 đôi- Đen', 'Loại tất thể thao này có vòng đệm nhung dưới bàn chân, thoải mái và thấm hút mồ hôi tốt hơn. Vùng thông hơi ở phần trên bàn chân. Mũi dệt dày giữa bàn chân giúp nâng đỡ tốt.', 'tat nam,rs 500', '2021-12-12 04:43:58', '2021-12-24 00:10:54', 5, 'flat_rate', 15000, '%', 'on', '50', NULL, '121212211121', 500, 'https://www.decathlon.vn/vi/p/8379841/tat/tat-the-thao-rs-500-cho-nguoi-lon-goi-3-doi-den', NULL, '%', NULL, NULL, 'qt_hidden', 1640152800, 1643594400, 1639288800, 1639447200, 'isNotAttribute', 1, '[]', NULL, '0', 1, NULL),
