(38, 'Bộ cài thẳng Nous dài', 'bo-cai-thang-nous-dai', 'bộ', 'uploads/files/Products/Kids/ao-1.jpg', 'uploads/files/Products/Kids/ao-4.jpg,uploads/files/Products/Kids/ao-3.jpg,uploads/files/Products/Kids/ao-2.jpg', 31, 22, NULL, 180000, 'Bộ cài thẳng Nous dài petit hồng đậm - xanh 6M', 'NOÛS là thương hiệu thời trang chất lượng cao dành cho sơ sinh và trẻ em được sản xuất và phân phối bởi Công Ty Cổ Phần Nu Việt Nam.', NULL, '2021-12-12 05:00:37', '2021-12-28 19:22:09', NULL, 'free_ship', 0, '%', 'on', '20', 'on', '', 200, 'https://www.tuticare.com/bo-cai-thang-nous-dai-petit-hong-dam-trang-6m-item26925.html', NULL, '%', '<ul>\r\n	<li>Vải si&ecirc;u mềm, tho&aacute;ng kh&iacute;, tho&aacute;t hơi tốt.</li>\r\n	<li>Sản phẩm chống tia cực t&iacute;m, kh&aacute;ng khuẩn, kiểm so&aacute;t nhiệt độ da b&eacute;.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Chất liệu kh&ocirc;ng g&acirc;y k&iacute;ch ứng da b&eacute;.</li>\r\n	<li>Sử dụng t&ocirc;ng m&agrave;u pastell nhẹ nh&agrave;ng, đ&aacute;ng y&ecirc;u.</li>\r\n	<li>Thiết kế đơn giản nhưng kh&ocirc;ng k&eacute;m phần tinh tế.</li>\r\n</ul>', '<p>Đ&oacute;n h&egrave; tươi m&aacute;t đậm hơi thở nhiệt đới với những thiết kế mới nhất của BST Nous Xu&acirc;n H&egrave; 2020</p>\r\n\r\n<h3>Đặc điểm sản phẩm:</h3>\r\n\r\n<p><br />\r\n<img alt=\"\" src=\"https://www.tuticare.com/media/lib/26923_84224522_2493934287378662_5247652679328464896_o.jpg\" style=\"width:450px\" /><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Vải si&ecirc;u mềm, tho&aacute;ng kh&iacute;, tho&aacute;t hơi tốt.</li>\r\n	<li>Sản phẩm chống tia cực t&iacute;m, kh&aacute;ng khuẩn, kiểm so&aacute;t nhiệt độ da b&eacute;.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Chất liệu kh&ocirc;ng g&acirc;y k&iacute;ch ứng da b&eacute;.</li>\r\n	<li>Sử dụng t&ocirc;ng m&agrave;u pastell nhẹ nh&agrave;ng, đ&aacute;ng y&ecirc;u.</li>\r\n	<li>Thiết kế đơn giản nhưng kh&ocirc;ng k&eacute;m phần tinh tế.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Xuất xứ: Việt Nam</p>\r\n\r\n<p>Thương hi