(40, 'Laptop ASUS TUF Gaming', 'laptop-asus-tuf-gaming', 'chiếc', 'uploads/files/Products/Electronics/tuf-dash-1.jpg', 'uploads/files/Products/Electronics/tuf-dash-4.jpg,uploads/files/Products/Electronics/tuf-dash-3.jpg,uploads/files/Products/Electronics/tuf-dash-2.jpg', 26, 9, NULL, 37490000, 'Laptop ASUS TUF Gaming FA506QR-AZ003T', 'Laptop Asus Gaming FA506QR-AZ003T là chiếc laptop gaming hạng nặng với bộ vi xử lý mới nhất của AMD kết hợp với GPU Nvidia mới nhất cùng thiết lập âm thanh tổng thể tuyệt vời.', 'asus,tuf,gaming', '2021-12-15 02:21:04', '2021-12-28 19:22:01', 10, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/laptop-asus-tuf-gaming-fa506qr-az003t.html', 10, '%', '<p>Laptop Asus TUF Gaming FA506QR-AZ003T đẳng cấp laptop gaming<br />\r\nLaptop Asus Gaming FA506QR-AZ003T l&agrave; chiếc laptop gaming hạng nặng với bộ vi xử l&yacute; mới nhất của AMD kết hợp với GPU Nvidia mới nhất c&ugrave;ng thiết lập &acirc;m thanh tổng thể tuyệt vời. Tất cả đ&atilde; tạo n&ecirc;n si&ecirc;u phẩm laptop đẳng cấp nh&agrave; gaming.</p>\r\n\r\n<p>Thiết kế đậm chất gaming<br />\r\nLaptop Asus TUF Gaming FA506QR-AZ003T được thiết kế v&ocirc; c&ugrave;ng mạnh mẽ v&agrave; chắc chắn mang đậm chất gaming. Lớp vỏ cứng c&aacute;p, g&oacute;c cạnh c&ugrave;ng m&agrave;u sắc bền bỉ gi&uacute;p bảo vệ linh kiện b&ecirc;n trong tốt hơn.</p>', '<h3><strong>Chip đời mới mạnh mẽ, tản nhiệt hiệu suất cao</strong></h3>\r\n\r\n<p>Cung cấp sức mạnh cho laptop Asus TUF Gaming FA506QR-AZ003T l&agrave; con chip AMD đời mới nhất kết hợp. B&ecirc;n cạnh đ&oacute; l&agrave; card đồ họa rời chất lượng cho hiệu năng mạnh mẽ. M&aacute;y c&oacute; thể c&acirc;n mượt mọi tựa game nặng cũng như l&agrave;m đồ họa 3D, render video v&ocirc; c&ugrave;ng mượt m&agrave; v&agrave; trơn chu.</p>\r\n\r\n<p><img alt=\"Chip đời mới mạnh mẽ, tản nhiệt hiệu suất cao\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/Laptop-Asus-TUF-Gaming-FA506QR-AZ003T-R7-5800H-2.jpg\" /></p>\r\n\r\n<p>Hệ thống tản nhiệt của m&aacute;y c&oacute; hiệu suất cao với nhiều khe tản nhiệt lớn được ph&acirc;n bố ở đ&aacute;y v&agrave; g&aacute;y của m&aacute;y. Từ đ&oacute; gi&uacute;p cho kh&ocirc;ng kh&iacute; được dễ d&agrave;ng lưu th&ocirc;ng v&agrave; lu&ocirc;n lu&ocirc;n m&aacute;t mẻ cho d&ugrave; sử dụng trong thời gian d&agrave;i.</p>\r\n\r\n<h2><strong>Mua laptop Asus TUF Gaming FA506QR-AZ003T cao cấp với gi&aacute; cực ưu đ&atilde;i chỉ c&oacute; tại CellphoneS</strong></h2>\r\n\r\n<p>L&agrave; chiếc laptop đẳng cấp Asus TUF Gaming FA506QR-AZ003T hứa hẹn mang đến cho người d&ugrave;ng những trải nghiệm kh&aacute;c biệt, mạnh mẽ. Để mua sản phẩm với gi&aacute; cực ưu đ&atilde;i c&ugrave;ng chế độ bảo h&agrave;nh ấn tượng bạn h&atilde;y đến với CellphoneS.</p>', 'qt_hidden', 1640059200, 1643630400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 7, NULL),
(44, 'Samsung Galaxy S20 Ultra', 'samsung-galaxy-s20-ultra', 'chiếc', 'uploads/files/Products/Electronics/ultra-den-1.jpg', 'uploads/files/Products/Electronics/ultra-den-4.jpg,uploads/files/Products/Electronics/ultra-den-3.jpg,uploads/files/Products/Electronics/ultra-den-2.jpg', 23, 7, NULL, 16990000, 'Điện thoại Samsung S20 Ultra – Flagship thiết kế độc đáo, cấu hình cao.', 'Samsung Galaxy S20 Ultra là flagship mới của dòng Galaxy S sẽ được Samsung giới thiệu vào đầu năm 2020. Đây là phiên bản cao cấp nhất bên cạnh phiên bản thường và bản Plus.', 'samsung,s20 ultra', '2021-12-15 03:07:51', '2021-12-28 22:21:54', 10, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/samsung-galaxy-s20-ultra.html', 5, '%', '<ul>\r\n	<li>Quay phim ấn tượng, chụp đ&ecirc;m si&ecirc;u n&eacute;t - Camera 108MP, Zoom xa 100x, quay phim 8K, chống rung.</li>\r\n	<li>Sẵn s&agrave;ng cả ng&agrave;y d&agrave;i - Pin 5000mAh, sạc nhanh si&ecirc;u tốc 45W</li>\r\n	<li>Hiệu năng mạnh mẽ, chơi game cực đ&atilde; - Exunos 990 8 nh&acirc;n, RAM 12GB</li>\r\n	<li>Trải nghiệm h&igrave;nh ảnh ấn tượng - M&agrave;n h&igrave;nh AMOLED 6.9 inch, độ ph&acirc;n giải 2K, tần số qu&eacute;t si&ecirc;u cao 120Hz.</li>\r\n</ul>', '<h3><strong>M&agrave;n h&igrave;nh k&iacute;ch thước 6.9 inch với tần số qu&eacute;t 120Hz</strong></h3>\r\n\r\n<p>Về thiết kế, Samsung S20 Ultra c&oacute; thiết kế tương tự&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-s20.html\" target=\"_blank\">Samsung S20</a>&nbsp;v&agrave; S20 Plus. Mặt trước m&aacute;y được trang bị m&agrave;n h&igrave;nh cong 6.9 inch với tấm nền&nbsp;AMOLED<a href=\"https://www.lifewire.com/super-amoled-4151073\" target=\"_blank\">&nbsp;</a>v&agrave; độ ph&acirc;n giải FullHD. C&aacute;c cạnh m&aacute;y được v&aacute;t nhẹ cho khả năng cầm nắm tốt. Phần camera trước của S20 Ultra sẽ được l&agrave;m theo dạng đục lỗ thường thấy tr&ecirc;n c&aacute;c mẫu smartphone Samsung gần đ&acirc;y. Ngo&agrave;i ra, m&agrave;n h&igrave;nh c&oacute; tần số qu&eacute;t l&ecirc;n đến 120Hz. Đ&acirc;y cũng l&agrave; mẫu smartphone đầu ti&ecirc;n được Samsung trang bị m&agrave;n h&igrave;nh c&oacute; tần số qu&eacute;t cao như vậy. Với mức tần số qu&eacute;t n&agrave;y, m&aacute;y sẽ cho độ nhạy cảm ứng cao hơn, c&aacute;c thao t&aacute;c vuốt chạm sẽ mượt m&agrave; v&agrave; ch&acirc;n thực hơn, độ trễ giữa c&aacute;c thao t&aacute;c l&agrave; rất &iacute;t. Ngo&agrave;i ra, bạn sẽ dễ d&agrave;ng cảm nhận sự thay đổi n&agrave;y khi chơi c&aacute;c game y&ecirc;u cầu đồ họa cao.</p>\r\n\r\n<p><img alt=\"Màn hình 6.9 inch với tần số quét 120Hz\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/samsung/samsung-galaxy-s20-ultra-1.JPG\" /></p>\r\n\r\n<p>Mặt sau của m&aacute;y được l&agrave;m bằng k&iacute;nh sang trọng. M&aacute;y cũng được trang bị c&ocirc;ng nghệ cảm biến v&acirc;n tay &acirc;m m&agrave;n h&igrave;nh.Cụm 4 camera v&agrave; đ&egrave;n led sẽ nằm b&ecirc;n ở g&oacute;c b&ecirc;n tr&aacute;i thay v&igrave; nằm ngang như tr&ecirc;n Samsung Galaxy S10 năm nay. Ngo&agrave;i ra, Galaxy S20 Ultra chỉ giữ lại cổng&nbsp;USB Type-C&nbsp;v&agrave; cụm loa ngo&agrave;i ở cạnh dưới của m&aacute;y. Cụm ph&iacute;m tăng giảm &acirc;m lượng v&agrave; ph&iacute;m trợ l&yacute; ảo Bixby được thiết kế b&ecirc;n tay phải thay v&igrave; b&ecirc;n tr&aacute;i như tr&ecirc;n Galaxy Note 10. M&aacute;y sẽ bị loại bỏ jack tai nghe 3.5mm.</p>\r\n\r\n<h3><strong>Camera ch&iacute;nh c&oacute; độ ph&acirc;n giải đến 108MP v&agrave; zoom quang 5X</strong></h3>\r\n\r\n<p><strong>Samsung S20 Ultra</strong>&nbsp;được trang bị cụm 4 camera sau lần lượt l&agrave; camera g&oacute;c rộng 108MP, camera g&oacute;c si&ecirc;u rộng 12MP, ống k&iacute;nh tele 48MP v&agrave; ToF 0.3MP. Điện thoại mang đến khả năng zoom quang học tới 10 lần. Nhờ đ&oacute; bạn c&oacute; thể ghi lại mọi khoảnh khắc. Trong điều kiện thiếu s&aacute;ng, m&aacute;y cũng cho ra chất lượng ảnh tốt. Với cơ chế chụp nhiều ảnh c&ugrave;ng l&uacute;c sau đ&oacute; hợp nhất, gi&uacute;p giảm độ mờ, nhiễu.</p>', 'qt_hidden', 1640149200, 1643590800, 0, 0, 'isAttribute', 1, '[]', '[\"#30336b\",\"#222f3e\"]', '0', 12, NULL),
(45, 'Chuột không dây MX Master 2S', 'chuot-khong-day-mx-master-2s', 'cái', 'uploads/files/Products/Electronics/mx-master-1.jpg', 'uploads/files/Products/Electronics/mx-master-4.jpg,uploads/files/Products/Electronics/mx-master-3.jpg,uploads/files/Products/Electronics/mx-master-2.jpg', 25, 27, NULL, 1590000, 'Chuột không dây Logitech MX Master 2S', 'MX Master 2S là một trong số những dòng chuột không dây Logitech sở hữu nút cuộn dọc được trang bị chế độ cuộn siêu nhanh, đây là tính năng góp phần tạo nên sự ...', 'logitech,mx,master 2s', '2021-12-15 20:57:48', '2021-12-28 18:36:59', NULL, 'free_ship', 0, '%', 'on', '20', NULL, '', NULL, 'https://cellphones.com.vn/chuot-khong-day-logitech-mx-master-2s.html', NULL, '%', NULL, NULL, 'qt_hidden', 1639648800, 1639720800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 5, NULL),
(46, 'Laptop Dell Inspiron 3501', 'laptop-dell-inspiron-3501', 'chiếc', 'uploads/files/Products/Electronics/laptop-dell-1.jpg', 'uploads/files/Products/Electronics/laptop-dell-4.jpg,uploads/files/Products/Electronics/laptop-dell-3.jpg,uploads/files/Products/Electronics/laptop-dell-2.jpg', 26, 10, NULL, 18990000, 'Laptop Dell Inspiron 3501 5580BLK - Nhập khẩu chính hãng', 'Laptop Dell Inspiron 3501 5580BLK tuy được trang bị một màn hình kích thước lớn nhưng vẫn đảm bảo được tiêu chí gọn nhẹ.', 'dell,inspiron,3501', '2021-12-15 21:11:06', '2021-12-24 21:37:03', 10, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/laptop-dell-inspiron-3501-5580blk.html', 10, '%', '<h3><strong>Laptop Dell Inspiron 3501 5580BLK &ndash; Laptop nhỏ gọn, sử dụng mượt m&agrave;</strong></h3>\r\n\r\n<h3>Ng&agrave;y nay laptop l&agrave; một c&ocirc;ng cụ kh&ocirc;ng thể thiết trong học tập v&agrave; l&agrave;m việc. Do đ&oacute; c&aacute;c nh&agrave; sản xuất ng&agrave;y c&agrave;ng cải tiến c&aacute;c sản phẩm của m&igrave;nh gọn nhẹ nhưng vẫn mang lại hiệu suất l&agrave;m việc cao. Với&nbsp;<strong><a href=\"https://cellphones.com.vn/laptop/dell/inspiron.html\">laptop Dell Inspiron</a>&nbsp;3501 5580BLK</strong>&nbsp;cũng kh&ocirc;ng ngoại lệ, thiết bị hứa hẹn đ&aacute;p ứng mọi kỳ vọng của người sử dụng.</h3>\r\n\r\n<h3><strong>Thiết kế gọn nhẹ, m&agrave;n h&igrave;nh k&iacute;ch thước lớn</strong></h3>\r\n\r\n<p>Laptop Dell Inspiron 3501 5580BLK tuy được trang bị một m&agrave;n h&igrave;nh k&iacute;ch thước lớn nhưng vẫn đảm bảo được ti&ecirc;u ch&iacute; gọn nhẹ. Đ&oacute; l&agrave; nhờ v&agrave;o thiết kế viền m&agrave;n h&igrave;nh mỏng c&ugrave;ng chất liệu cao cấp cấu th&agrave;nh.</p>', '<h3><strong>Hiệu năng mượt c&ugrave;ng vi&ecirc;n pin đủ d&ugrave;ng</strong></h3>\r\n\r\n<p>Dell Inspiron 3501 5580BLK được trang bị cấu h&igrave;nh mạnh với con chip thế hệ 10 c&ugrave;ng ổ cứng SSD, thanh RAM dung lượng lớn. Nhờ đ&oacute; m&aacute;y mang lại trỉa nghiệm mượt m&agrave;, đa điểm ổn định.</p>\r\n\r\n<p><img alt=\"Laptop Dell Inspiron 3501 5580BLK\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/Dell/dell-inspiron-3501-5580blk-2.jpg\" /></p>\r\n\r\n<p>Về thời gian sử dụng, laptop Dell n&agrave;y với vi&ecirc;n pin dung lượng lớn gi&uacute;p m&aacute;y c&oacute; thể hoạt động li&ecirc;n tục nhiều giờ m&agrave; kh&ocirc;ng cần sạc pin.</p>\r\n\r\n<h2><strong>Mua ngay laptop Dell Inspiron 3501 5580BLK ch&iacute;nh h&atilde;ng, gi&aacute; rẻ tại CellphoneS</strong></h2>\r\n\r\n<p>Bạn đang t&igrave;m kiếm mẫu laptop nhỏ gọn với hiệu năng cao cho học tập v&agrave; giải tr&iacute;. Vậy h&atilde;y đến với CellphoneS để trải nghiệm v&agrave; mua ngay sản phẩm laptop Dell Inspiron 3501 5580BLK ch&iacute;nh h&atilde;ng với gi&aacute; ưu đ&atilde;i c&ugrave;ng nhiều khuyến m&atilde;i hấp dẫn.</p>', 'qt_hidden', 1640084400, 1643612400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 3, NULL),
(47, 'Laptop HP 15S-FQ2602TU', 'laptop-hp-15s-fq2602tu', 'chiếc', 'uploads/files/Products/Electronics/laptop_hp_1.jpg', 'uploads/files/Products/Electronics/laptop_hp_4.jpg,uploads/files/Products/Electronics/laptop_hp_3.jpg,uploads/files/Products/Electronics/laptop_hp_2.jpg', 26, 28, NULL, 16390000, 'Laptop HP 15S-FQ2602TU 4B6D3PA', 'Laptop HP 15s-fq2602TU 4B6D3PA là một sản phẩm mới đến từ thương hiệu HP. Với cấu hình ổn định chiếc laptop này hoàn toàn có thể đáp ứng các nhu cầu về giải trí và các tác vụ của nhân viên văn phòng, sinh viên.', 'hp,15s', '2021-12-15 21:35:43', '2021-12-25 03:41:56', 15, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, NULL, 10, '%', '<h3><strong>Laptop HP 15s-fq2602TU 4B6D3PA &ndash; Laptop mỏng nhẹ cho d&acirc;n văn ph&ograve;ng</strong></h3>\r\n\r\n<p><strong><a href=\"https://cellphones.com.vn/laptop/hp.html\" target=\"_self\">Laptop HP</a>&nbsp;15s-fq2602TU 4B6D3PA</strong>&nbsp;l&agrave; một sản phẩm mới đến từ thương hiệu HP. Với cấu h&igrave;nh ổn định chiếc laptop n&agrave;y ho&agrave;n to&agrave;n c&oacute; thể đ&aacute;p ứng c&aacute;c nhu cầu về giải tr&iacute; v&agrave; c&aacute;c t&aacute;c vụ của nh&acirc;n vi&ecirc;n văn ph&ograve;ng, sinh vi&ecirc;n.</p>\r\n\r\n<h3><strong>Cấu h&igrave;nh ổn định với chip intel thế hệ 11</strong></h3>\r\n\r\n<p>Laptop HP 15s-fq2602TU 4B6D3PA sử dụng bộ xử l&yacute; Intel Core i5 thế hệ 11. Với bộ nhớ RAM 8GB v&agrave; tốc độ bộ nhớ l&agrave; 3200MHz gi&uacute;p đảm bảo xử l&yacute; c&aacute;c t&aacute;c vụ đa nhiệm một c&aacute;ch mượt m&agrave;. Ổ cứng SSD NVMe mang lại tốc độ xử l&yacute; &ndash; đọc ghi ổn định.</p>', '<p>Với việc tương đối nhẹ, chỉ nặng khoảng 1.7 kg th&igrave; việc mang theo cũng rất tiện lợi, đặc biệt l&agrave; học sinh sinh vi&ecirc;n hoặc nh&acirc;n vi&ecirc;n văn ph&ograve;ng.</p>\r\n\r\n<p><img alt=\"Cấu hình ổn định với chip intel thế hệ 11\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/HP/Laptop-HP-15s-fq2602TU-4B6D3PA-1.jpg\" /></p>\r\n\r\n<h3><strong>K&iacute;ch thước m&agrave;n h&igrave;nh 15,6 inches v&agrave; độ ph&acirc;n giải Full HD</strong></h3>\r\n\r\n<p>M&aacute;y c&oacute; m&agrave;u bạc, được thiết kế theo phong c&aacute;ch tối giản với k&iacute;ch thước m&agrave;n h&igrave;nh l&agrave; 15.6 inches, độ ph&acirc;n giải Full HD v&agrave; 2 loa n&ecirc;n bạn sẽ c&oacute; những trải nghiệm kh&aacute; tốt tr&ecirc;n laptop khi xem phim, chơi game, nghe nhạc,&hellip;&nbsp;Laptop HP 15s-fq2602TU 4B6D3PA c&oacute; độ s&aacute;ng m&agrave;n h&igrave;nh l&agrave; 250 nits, n&ecirc;n sẽ giảm bớt ch&oacute;i khi bạn phải l&agrave;m việc ngo&agrave;i trời hoặc nơi c&oacute; độ s&aacute;ng cao.</p>\r\n\r\n<p><img alt=\"Kích thước màn hình 15,6 inches và độ phân giải Full HD\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/HP/Laptop-HP-15s-fq2602TU-4B6D3PA-2.jpg\" /></p>\r\n\r\n<h2><strong>Mua ngay laptop HP 15s-fq2602TU 4B6D3PA ch&iacute;nh h&atilde;ng tại CellphoneS</strong></h2>\r\n\r\n<p>Với chất lượng kh&aacute; ổn so với tầm gi&aacute; th&igrave; đ&acirc;y ch&iacute;nh l&agrave; một trong những lựa chọn tốt cho c&aacute;c bạn sinh vi&ecirc;n v&agrave; nh&acirc;n vi&ecirc;n văn ph&ograve;ng, kh&ocirc;ng đ&ograve;i hỏi cấu h&igrave;nh m&aacute;y t&iacute;nh qu&aacute; cao. Bạn c&oacute; thể mua laptop HP 15s-fq2602TU 4B6D3PA ch&iacute;nh h&atilde;ng với mức gi&aacute; ưu đ&atilde;i tại CellphoneS.</p>', 'qt_hidden', 1640084400, 1643612400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 6, NULL),
(49, 'Robot hút bụi Xiaomi Vaccum Mop 2', 'robot-hut-bui-xiaomi-vaccum-mop-2', 'cái', 'uploads/files/Products/Electronics/robot-hut-bui-2.jpg', 'uploads/files/Products/Electronics/robot-hut-bui-4.jpg,uploads/files/Products/Electronics/robot-hut-bui-3.jpg,uploads/files/Products/Electronics/robot-hut-bui-1.jpg', 28, 24, NULL, 6490000, 'Robot hút bụi Xiaomi Vaccum Mop 2', 'Robot hút bụi Xiaomi Vacuum Mop 2 là sản phẩm robot thông minh mới đến từ thương hiệu Xiaomi – một thương hiệu công nghệ hàng đầu Trung Quốc.', 'hut bui,mop 2,xiaomi vaccum', '2021-12-15 22:00:54', '2021-12-28 19:24:39', 10, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/robot-hut-bui-xiaomi-vacuum-mop-2.html', NULL, '%', '<h3><strong>Robot h&uacute;t bụi Xiaomi Vacuum Mop 2 &ndash;&nbsp;</strong><strong>L&agrave;m sạnh hiệu quả kh&ocirc;ng gian nh&agrave;</strong></h3>\r\n\r\n<p><strong><a href=\"https://cellphones.com.vn/nha-thong-minh/may-hut-bui/robot-hut-bui.html\" target=\"_self\">Robot h&uacute;t bụi</a>&nbsp;Xiaomi Vacuum Mop 2</strong>&nbsp;l&agrave; sản phẩm robot th&ocirc;ng minh mới đến từ thương hiệu Xiaomi &ndash; một thương hiệu c&ocirc;ng nghệ h&agrave;ng đầu Trung Quốc. Robot sở hữu nhiều c&ocirc;ng nghệ hiện đại, ti&ecirc;n tiến nhất của h&atilde;ng v&agrave; l&agrave; thiết bị robot th&ocirc;ng minh c&oacute; thể điều khiển qua ứng dụng mang đến cho người d&ugrave;ng những trải nghiệm tuyệt vời nhất.</p>\r\n\r\n<h3><strong>Thiết kế nhỏ gọn, tiện lợi</strong></h3>\r\n\r\n<p>Xiaomi Vacuum Mop 2 được thiết kế nhỏ gọn nhất để c&oacute; thể len lỏi v&agrave; dọn dẹp mọi ng&oacute;c ng&aacute;ch trong căn nh&agrave;. Kể cả những nơi kh&oacute; nhằn như dưới gầm giường, tủ quần &aacute;o, kẹt b&agrave;n,&hellip; robot vẫn c&oacute; thể hoạt động dễ d&agrave;ng.</p>', '<h3><strong>Hai chức năng trong một, dọn dẹp hiệu quả</strong></h3>\r\n\r\n<p>Sản phẩm sở hữu c&ocirc;ng nghệ tự động dọn dẹp ti&ecirc;n tiến, c&oacute; thể l&agrave;m sạch với 2 chức năng lau dọn v&agrave; h&uacute;t bụi. Cạnh đ&oacute;, với ứng dụng MiHome, người d&ugrave;ng c&oacute; c&oacute; thể l&ecirc;n kế hoạch v&agrave; ph&acirc;n v&ugrave;ng dọn dẹp cho thiết bị. Điều khiển từ xa, robot vẫn c&oacute; thể tự động dọn dẹp sạch bụi b&aacute;m tr&ecirc;n thảm hay s&agrave;n nh&agrave;.</p>\r\n\r\n<p>Chổi qu&eacute;t của Robot h&uacute;t bụi Xiaomi Vacuum Mop 2 l&agrave; chổi qu&eacute;t thiết kế th&ocirc;ng minh, c&oacute; thể l&agrave;m sạch kể cả những r&atilde;nh thấp gi&uacute;p loại bỏ những bụi bẩn một c&aacute;ch hiệu quả. Ngo&agrave;i ra, hộp chứa bụi được t&iacute;ch hợp tr&ecirc;n m&aacute;y cũng được thiết kế với dung t&iacute;ch lớn, tiện lợi trong dọn dẹp.</p>\r\n\r\n<h3><strong>Sở hữu bộ xử l&yacute; th&ocirc;ng minh vượt trội</strong></h3>\r\n\r\n<p>Nhờ được trang bị chip lõi tứ mạnh mẽ c&ugrave;ng thuật to&aacute;n VSLAM gi&uacute;p định vị ch&iacute;nh x&aacute;c vị tr&iacute;, thuận tiện hơn trong việc thiết lập bản đồ v&agrave; lộ tr&igrave;nh l&agrave;m sạch. Hệ thống 3 bộ lọc của Xiaomi Vacuum Mop 2 đ&atilde; n&acirc;ng cao hiệu quả l&agrave;m sạch v&agrave; loại trừ được việc nhiễm bẩn ch&eacute;o.</p>\r\n\r\n<p><img alt=\"Sở hữu bộ xử lý thông minh vượt trội\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/Robot-hut-bui-Xiaomi-Vacuum-Mop-2-3.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, robot c&ograve;n được trang bị ống k&iacute;nh c&ugrave;ng cảm biến quanh th&acirc;n gi&uacute;p cho lộ tr&igrave;nh l&agrave;m sạch được nhanh ch&oacute;ng; hoạch định đường đi v&agrave; nhận diện bề mặt ch&iacute;nh x&aacute;c hơn. Nhờ vậy, gi&uacute;p n&acirc;ng cao hiệu quả l&agrave;m sạch.</p>\r\n\r\n<h3><strong>Thời gian sử dụng&nbsp;</strong><strong>l&acirc;u d&agrave;i, tự động sạc khi hết pin</strong></h3>\r\n\r\n<p>Vi&ecirc;n pin c&oacute; thời gian hoạt động l&ecirc;n đến nhiều giờ với dung lượng pin lớn gi&uacute;p cho robot c&oacute; thể hoạt động li&ecirc;n tục trong kh&ocirc;ng gian 120m2. M&aacute;y c&ograve;n được t&iacute;ch hợp chế độ tự động sạc khi chỉ c&ograve;n 15% v&agrave; quay trở lại c&ocirc;ng việc khi sạc đầy 80%.</p>', 'qt_hidden', 1640084400, 1643612400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 5, NULL),
(50, 'Bộ Tẩy Trang Bioderma', 'bo-tay-trang-bioderma', 'bộ', 'uploads/files/Products/Commestic/6e62a00f9a7528b5bea24150d1296a89.jpg.webp', 'uploads/files/Products/Commestic/8b6ff68d95c3332ca9df964b3e4adfbd.jpg.webp,uploads/files/Products/Commestic/272d48983bb745b3299bbc7cb29ac9fe.jpg.webp,uploads/files/Products/Commestic/1ab22ed5b178df7323fc860cff095632.jpg.webp', 32, 19, NULL, 345000, 'Bộ Tẩy Trang Bioderma Dành Cho Da Dầu & Hỗn Hợp 500ml Sébium H2O', 'ước Tẩy Trang Bioderma Sébium H2O là sản phẩm tẩy trang dành cho da dầu, da hỗn hợp đến từ thương hiệu dược mỹ phẩm Bioderma.', 'tay trang,bioderma', '2021-12-15 22:09:24', '2021-12-29 01:52:19', NULL, 'free_ship', 0, '%', 'on', '20', NULL, '', 30, 'https://hasaki.vn/san-pham/nuoc-tay-trang-bioderma-danh-cho-da-dau-hon-hop-500ml-11089.html', NULL, '%', '<p><strong>Th&agrave;nh phần ch&iacute;nh:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>C&ocirc;ng nghệ Micellar:&nbsp;</strong>C&aacute;c hạt micelle, c&oacute; th&agrave;nh phần được lấy cảm hứng từ lipid của da, l&agrave; những hạt l&agrave;m sạch v&ocirc; h&igrave;nh si&ecirc;u nhỏ. Ch&uacute;ng c&oacute; khả năng thu giữ c&aacute;c tạp chất trong khi vẫn duy tr&igrave; lớp m&agrave;ng bảo vệ tự nhi&ecirc;n của da.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>S&aacute;ng chế D.A.F.:</strong>&nbsp;C&aacute;c t&aacute;c động từ b&ecirc;n ngo&agrave;i c&oacute; thể l&agrave;m cho da trở n&ecirc;n k&iacute;ch ứng v&agrave; nhạy cảm. Hợp chất n&agrave;y gi&uacute;p l&agrave;m tăng khả năng dung nạp của l&agrave;n da - bất kể đối với loại da n&agrave;o - nhằm tăng cường sức đề kh&aacute;ng cho da.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Th&agrave;nh phần đầy đủ:</strong></p>\r\n\r\n<p>Water (Aqua), Peg-6 Caprylic/Capric Glycerides, Sodium Citrate , Zinc Gluconate, Copper Sulfate, Ginkgo Biloba Extract &ndash; Chiết Xuất L&aacute; Bạch Quả, Mannitol, Xylitol, Rhamnose, Fructooligosaccharides, Propylene Glycol, Citric Acid, Disodium Edta, Cetrimonium Bromide, Fragrance (Parfum).</p>', '<p><strong>Nước Tẩy Trang Bioderma S&eacute;bium H2O</strong>&nbsp;l&agrave; sản phẩm&nbsp;<a href=\"https://hasaki.vn/danh-muc/tay-trang-c37.html\" target=\"_blank\">tẩy trang</a>&nbsp;d&agrave;nh cho da dầu, da hỗn hợp đến từ&nbsp;<a href=\"https://hasaki.vn/thuong-hieu/bioderma.html\" target=\"_blank\">thương hiệu dược mỹ phẩm Bioderma</a>, được ứng dụng c&ocirc;ng nghệ Micellar đ&igrave;nh đ&aacute;m gi&uacute;p loại bỏ lớp trang điểm c&ugrave;ng bụi bẩn v&agrave; dầu thừa tr&ecirc;n da hiệu quả m&agrave; kh&ocirc;ng g&acirc;y kh&ocirc; căng hay nhờn r&iacute;t, tạo cảm gi&aacute;c th&ocirc;ng tho&aacute;ng cho da sau một ng&agrave;y d&agrave;i mệt mỏi.</p>\r\n\r\n<p>Hướng dẫn sử dụng</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>BƯỚC 1:&nbsp;</strong>Thấm&nbsp;<strong>S&eacute;bium H2O&nbsp;</strong>l&ecirc;n b&ocirc;ng tẩy trang.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>BƯỚC 2:&nbsp;</strong>Nhẹ nh&agrave;ng l&agrave;m sạch v&agrave; / hoặc tẩy trang v&ugrave;ng mặt.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>BƯỚC 3:&nbsp;</strong>Kh&ocirc;ng cần rửa lại với nước.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Sử dụng v&agrave;o buổi s&aacute;ng v&agrave; / hoặc buổi tối - 7 ng&agrave;y một tuần.</p>', 'qt_hidden', 1639656000, 1639728000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 6, NULL),
(51, 'Camera hành trình Gopro Hero 10', 'camera-hanh-trinh-gopro-hero-10', 'chiếc', 'uploads/files/Products/Electronics/gopro-hero-1.jpeg', 'uploads/files/Products/Electronics/gopro-hero-4.jpeg,uploads/files/Products/Electronics/gopro-hero-3.jpeg,uploads/files/Products/Electronics/gopro-hero-2.jpeg', 27, 7, NULL, 13990000, 'Camera hành trình GoPro Hero 10 - Camera hành trình cao cấp cho mọi chuyến đi.', 'Thương hiệu camera hành trình GoPro Hero Black luôn cho ra loạt sản phẩm máy quay chất lượng cao cho những nhiếp ảnh gia, nhà làm phim và các tín đồ du lịch.', 'camera,gopro ,hero 10', '2021-12-15 22:16:45', '2021-12-28 19:25:50', 5, 'free_ship', 0, '%', NULL, '10', 'on', '', 20, 'https://cellphones.com.vn/camera-hanh-trinh-gopro-hero-10.html', 5, '%', '<ul>\r\n	<li>Camera c&oacute; khả năng ghi h&igrave;nh l&ecirc;n tới độ ph&acirc;n giải&nbsp;5K@60fps&nbsp;sắc n&eacute;t</li>\r\n	<li>Hệ thống chống rung ổn định h&igrave;nh ảnh Hyper Smooth 4.0 cải tiến gi&uacute;p cho cảnh quay trở n&ecirc;n mượt m&agrave;, ổn định hơn</li>\r\n	<li>Hỗ trợ người d&ugrave;ng Live Stream trực tiếp ở độ ph&acirc;n giải h&igrave;nh ảnh 1080p v&ocirc; c&ugrave;ng tiện lợi</li>\r\n	<li>Khả năng chống nước ở độ s&acirc;u l&ecirc;n đến 10m, th&iacute;ch hợp để quay dưới nước hoặc trong điều kiện thời tiết xấu</li>\r\n	<li>T&iacute;ch hợp hai m&agrave;n h&igrave;nh cảm ứng trước v&agrave; sau, điều khiển bằng giọng n&oacute;i c&ugrave;ng c&aacute;c chức năng chỉnh sửa nhanh video hoặc h&igrave;nh ảnh ghi được</li>\r\n	<li>Sử dụng vi&ecirc;n pin lớn hơn c&oacute; dung lượng l&ecirc;n đến 1720 mAh gi&uacute;p thời lượng sử dụng tăng th&ecirc;m</li>\r\n	<li>C&oacute; thể lắp k&egrave;m phụ kiện như mic thu &acirc;m, đ&egrave;n LED chiếu s&aacute;ng hay m&agrave;n h&igrave;nh rời, cho ph&eacute;p quay h&igrave;nh chuy&ecirc;n nghiệp gọn nhẹ hơn</li>\r\n</ul>', '<h3><strong>Thi&ecirc;́t k&ecirc;́ đ&ocirc;̉i mới, &ocirc;́ng kính mới cùng cảm bi&ecirc;́n 1/4 inch</strong></h3>\r\n\r\n<p>Tín đ&ocirc;̀ camera hành trình GoPro đ&ecirc;̀u bi&ecirc;́t chỉ đ&ecirc;́n khi Hero 9 Black ra mắt, hãng mới bắt đ&acirc;̀u thay đ&ocirc;̉i ng&ocirc;n ngữ thi&ecirc;́t k&ecirc;́ cho model này. Và bởi vì thay đ&ocirc;̉i thi&ecirc;́t k&ecirc;́ tr&ecirc;n Hero 9 Black được đón nh&acirc;̣n m&ocirc;̣t cách tích cực, ta có th&ecirc;̉ kỳ vọng GoPro Hero 10 cũng được đ&ocirc;̉i mới v&ecirc;̀ thi&ecirc;́t k&ecirc;́. Khả năng cao Hero 10 Black sẽ được cải ti&ecirc;́n lớn v&ecirc;̀ ph&acirc;̀n màn hình cảm ứng, l&ocirc;̀ng và &ocirc;́ng kính.</p>\r\n\r\n<p><img alt=\"Camera hành trình GoPro Hero 10\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-hanh-trinh-gopro-hero-10-black-1.jpg\" /></p>\r\n\r\n<p>Đ&acirc;̀u ti&ecirc;n là v&ecirc;̀ màn hình. Dự ki&ecirc;́n&nbsp;<strong>GoPro Hero 10</strong>&nbsp;Black sẽ được trang bị màn hình có thi&ecirc;́t k&ecirc;́ tràn vi&ecirc;̀n - v&ocirc;́n đã kh&ocirc;ng còn xa lạ với các thi&ecirc;́t bị smartphone ngày nay. Trước đó màn hình Hero 9 Black tuy lớn nhưng di&ecirc;̣n tích tr&ocirc;́ng v&acirc;̃n khá nhi&ecirc;̀u. Và vi&ecirc;̣c t&acirc;̣n dụng thi&ecirc;́t k&ecirc;́ tràn vi&ecirc;̀n sẽ giúp Hero 10 Black có th&ecirc;m di&ecirc;̣n tích cho nhi&ecirc;̀u cử chỉ chạm.</p>\r\n\r\n<p>K&ecirc;́ đ&ecirc;́n là ph&acirc;̀n &ocirc;́ng kính. K&ecirc;́t c&acirc;́u &ocirc;́ng kính rời tr&ecirc;n Hero 9 Black đã được đón nh&acirc;̣n tích cực hơn r&acirc;́t nhi&ecirc;̀u so với Hero 8 Black, vì th&ecirc;́ kh&ocirc;ng lý do gì GoPro kh&ocirc;ng mang k&ecirc;́t c&acirc;́u &ocirc;́ng kính rời l&ecirc;n Hero 10 Black cả. Có khả năng &ocirc;́ng kính mới của Hero 10 Black sẽ h&ocirc;̃ trợ quay góc đ&ecirc;́n 155&deg;, cùng tính năng &ocirc;̉n định chuy&ecirc;̉n đ&ocirc;̣ng ảnh với đ&ocirc;̣ ph&acirc;n giải t&acirc;̣n 2.7K.</p>', 'qt_hidden', 1640088000, 1643616000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 8, NULL),
