(55, 'Đồ chơi chút chít Toyroyal', 'do-choi-chut-chit-toyroyal', 'bộ', 'uploads/files/Products/Kids/do-choi-11.jpg', 'uploads/files/Products/Kids/do-choi-14.jpg,uploads/files/Products/Kids/do-choi-13.jpg,uploads/files/Products/Kids/do-choi-12.jpg', 31, 22, NULL, 85000, 'Đồ chơi chút chít Toyroyal', 'Đồ chơi chút chít voi xanh được mô phỏng các nhân vật đáng yêu, ngộ nghĩnh.', 'do choi,toyroyal', '2021-12-15 22:35:42', '2021-12-23 02:38:16', NULL, 'free_ship', 0, '%', 'on', '20', NULL, '', NULL, 'https://www.tuticare.com/do-choi-chut-chit-toyroyal-1036-voi-xanh-item19410.html', NULL, '%', '<ul>\r\n	<li><a href=\"https://www.tuticare.com/do-choi-bop-chip-bop-chip-an-toan-213.html\"><em><strong>Đồ chơi ch&uacute;t ch&iacute;t voi xanh</strong></em></a>&nbsp;được m&ocirc; phỏng c&aacute;c nh&acirc;n vật đ&aacute;ng y&ecirc;u, ngộ nghĩnh.<br />\r\n	&nbsp;</li>\r\n	<li>Nh&acirc;n vật n&agrave;y sẽ gi&uacute;p b&eacute; học hỏi v&agrave; nhận biết tốt về h&igrave;nh dạng, chất liệu, m&agrave;u sắc, ph&aacute;t triển khả năng tư duy cho b&eacute;.<br />\r\n	&nbsp;</li>\r\n	<li>R&egrave;n luyện khả năng nghe, nh&igrave;n với &acirc;m thanh vui nhộn ch&uacute;t ch&iacute;t ph&aacute;t ra.<br />\r\n	&nbsp;</li>\r\n	<li>Chất liệu sản phẩm được l&agrave;m từ nhựa đạt chuẩn an to&agrave;n cho b&eacute;.<br />\r\n	&nbsp;</li>\r\n	<li>K&iacute;ch thước (D x R x C) : 5 x 2 x 7cm<br />\r\n	&nbsp;</li>\r\n	<li>NK từ Nhật d&agrave;nh cho b&eacute; từ 6 th&aacute;ng trở l&ecirc;n.</li>\r\n</ul>', '<h3><a href=\"https://www.tuticare.com/san-pham/thuong-hieu-toy-royal-japan-do-choi-toyroyal-do-choi-toyroyal-do-choi-noi-tro-toyroyal-do-choi-nha-bep-135.html\"><strong>Toyroyal</strong></a>&nbsp;l&agrave; tập đo&agrave;n sản xuất đồ chơi đầu ti&ecirc;n được c&ocirc;ng nhận chất lượng đạt chứng chỉ ti&ecirc;u chuẩn đồ chơi an to&agrave;n Nhật Bản.&nbsp;<strong>Toyroyal</strong>&nbsp;c&oacute; hơn bốn ng&agrave;n loại sản&nbsp;phẩm đồ chơi d&agrave;nh cho trẻ em dưới 6 tuổi được ph&acirc;n loại dựa theo c&aacute;c t&iacute;nh năng: Đồ chơi b&atilde;i biển, Đồ chơi nấu nướn. Đồ chơi ph&aacute;t triển tr&iacute; tuệ. Đồ chơi d&agrave;nh cho trẻ sơ sinh. Với ti&ecirc;u ch&iacute; đồ chơi kh&ocirc;ng chỉ nhằm giải tr&iacute; m&agrave; c&ograve;n l&agrave; dụng cụ gi&aacute;o dục, c&aacute;c sản phẩm của thương hiệu<strong>&nbsp;Toyroyal</strong>&nbsp;được thiết kế dựa tr&ecirc;n sự ph&aacute;t triển của n&atilde;o trẻ theo từng độ tuổi kh&aacute;c nhau. Trẻ c&oacute; thể nhận được những b&agrave;i học đầu ti&ecirc;n từ c&aacute;c tr&ograve; chơi đơn giản. Qua đ&oacute;, c&aacute;c bậc phụ huynh đồng thời c&oacute; thể x&acirc;y dựng sự giao tiếp tương t&aacute;c, li&ecirc;n kết với trẻ ngay từ giai đoạn đầu đời.</h3>\r\n\r\n<p><strong>Toy Royal (Japan)</strong></p>\r\n\r\n<p><strong>Toyroyal</strong>&nbsp;l&agrave; tập đo&agrave;n sản xuất đồ chơi đầu ti&ecirc;n được c&ocirc;ng nhận chất lượng đạt chứng chỉ ti&ecirc;u chuẩn đồ chơi an to&agrave;n Nhật Bản.&nbsp;<strong>Toyroyal</strong>&nbsp;c&oacute; hơn 4000&nbsp;loại sản&nbsp;phẩm đồ chơi d&agrave;nh cho trẻ em dưới 6 tuổi được ph&acirc;n loại dựa theo c&aacute;c t&iacute;nh năng: Đồ chơi b&atilde;i biển, Đồ chơi nấu nướn. Đồ chơi ph&aacute;t triển tr&iacute; tuệ. Đồ chơi d&agrave;nh cho trẻ sơ sinh. Với ti&ecirc;u ch&iacute; đồ chơi kh&ocirc;ng chỉ nhằm giải tr&iacute; m&agrave; c&ograve;n l&agrave; dụng cụ gi&aacute;o dục, c&aacute;c sản phẩm của thương hiệu<strong>&nbsp;Toyroyal</strong>&nbsp;được thiết kế dựa tr&ecirc;n sự ph&aacute;t triển của n&atilde;o trẻ theo từng độ tuổi kh&aacute;c nhau. Trẻ c&oacute; thể nhận được những b&agrave;i học đầu ti&ecirc;n từ c&aacute;c tr&ograve; chơi đơn giản. Qua đ&oacute;, c&aacute;c bậc phụ huynh đồng thời c&oacute; thể x&acirc;y dựng sự giao tiếp tương t&aacute;c, li&ecirc;n kết với trẻ ngay từ giai đoạn đầu đời.</p>\r\n\r\n<p>&nbsp;</p>', 'qt_hidden', 1639656000, 1639728000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 1, NULL),
(56, 'Giày Bóng Đá Nam Unisex', 'giay-bong-da-nam-unisex', 'đôi', 'uploads/files/Products/Fashions/giay-1.jpg', 'uploads/files/Products/Fashions/giay-4.jpg,uploads/files/Products/Fashions/giay-3.jpg,uploads/files/Products/Fashions/giay-2.jpg', 34, 29, NULL, 2400000, 'Giày Đá Banh Unisex Adidas X Speedflow.3 Laceless FIRM Ground', 'Khi sự nhạy bén của trí óc gặp sự nhanh nhạy của cơ thể, bạn sẽ trở thành phiên bản nhanh nhất của chính mình. Tìm dòng chảy của bạn và quên đi sự nghỉ ngơi lại phía sau. Phần upper bằng chất liệu Speedskin giúp bạn thoải mái khi hoạt động.', 'giay,da banh,adidas', '2021-12-15 22:41:51', '2021-12-25 03:54:19', 5, 'free_ship', 0, '%', NULL, '10', NULL, '', 40, 'https://supersports.com.vn/collections/giay-bong-da/products/giay-da-banh-unisex-adidas-x-speedflow-3-ll-fg-fy3271-red?variant=40126236721301', NULL, '%', '<ul>\r\n	<li>Cấu tạo kh&ocirc;ng c&oacute; viền</li>\r\n	<li>Upper bằng Speedskin</li>\r\n	<li>Chất liệu co gi&atilde;n bốn chiều</li>\r\n	<li>TPU đế ngo&agrave;i chắc chắn</li>\r\n	<li>M&agrave;u: Red / Core Black / Solar Red</li>\r\n	<li>M&atilde; sản phẩm: FY3271</li>\r\n</ul>', '<p><strong>GI&Agrave;Y Đ&Aacute; BANH X SPEEDFLOW.3 LACELESS FIRM GROUND</strong></p>\r\n\r\n<p><strong>Đ&Ocirc;I GI&Agrave;Y TỐC ĐỘ SI&Ecirc;U NHẸ D&Agrave;NH CHO BẠN.</strong></p>\r\n\r\n<p>Khi sự nhạy b&eacute;n của tr&iacute; &oacute;c gặp sự nhanh nhạy của cơ thể, bạn sẽ trở th&agrave;nh phi&ecirc;n bản nhanh nhất của ch&iacute;nh m&igrave;nh. T&igrave;m d&ograve;ng chảy của bạn v&agrave;&nbsp;qu&ecirc;n đi&nbsp;sự nghỉ ngơi lại ph&iacute;a sau. Phần upper bằng chất liệu Speedskin gi&uacute;p bạn thoải m&aacute;i khi hoạt động. Đế ngo&agrave;i TPU gi&uacute;p giảm gia tốc hiệu quả tr&ecirc;n nền đất. Thiết kế kh&ocirc;ng d&acirc;y thắt, &ocirc;m ch&acirc;n vừa vặn gi&uacute;p bạn xỏ v&agrave;o v&agrave; thoải m&aacute;i bước về ph&iacute;a trước.</p>', 'qt_hidden', 1640088000, 1643616000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 3, NULL),
(57, 'Giày Bóng Đá Nam Nike Phantom', 'giay-bong-da-nam-nike-phantom', 'đôi', 'uploads/files/Products/Fashions/giay-den-1.jpg', 'uploads/files/Products/Fashions/giay-den-4.jpg,uploads/files/Products/Fashions/giay-den-3.jpg,uploads/files/Products/Fashions/giay-den-2.jpg', 34, 21, NULL, 1600000, 'Giày Bóng Đá Nam Nike Phantom Gt Club TF', 'Nike Phantom GT Academy TF là một thiết kế dựa trên dữ liệu được tạo ra dành cho những cuộc tấn công chính xác. Thiết kế sáng tạo trên chất liệu da tổng hợp và lực kéo chuyên dụng ở phía dưới cho phép bạn hoàn toàn kiểm soát trận đấu.', 'giay,bong da,nike phantom', '2021-12-15 22:45:44', '2021-12-25 11:16:19', NULL, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://supersports.com.vn/collections/giay-bong-da/products/giay-bong-da-nam-nike-phantom-gt-club-tf-ck8469-090?variant=40636990947477', NULL, '%', '<ul>\r\n	<li>Ph&ugrave; hợp tr&ecirc;n c&aacute;c bề mặt tổng hợp</li>\r\n	<li>Đệm g&oacute;t ch&acirc;n</li>\r\n	<li>M&atilde; sản phẩm: CK8469-090</li>\r\n</ul>', '<p><strong>GI&Agrave;Y B&Oacute;NG Đ&Aacute; NAM NIKE PHANTOM GT CLUB TF</strong></p>\r\n\r\n<p>Nike Phantom GT Academy TF l&agrave; một thiết kế dựa tr&ecirc;n dữ liệu được tạo ra d&agrave;nh cho những cuộc tấn c&ocirc;ng ch&iacute;nh x&aacute;c. Thiết kế s&aacute;ng tạo tr&ecirc;n chất liệu da tổng hợp v&agrave; lực k&eacute;o chuy&ecirc;n dụng ở ph&iacute;a dưới cho ph&eacute;p bạn ho&agrave;n to&agrave;n kiểm so&aacute;t trận đấu.</p>\r\n\r\n<p><strong>Tập trung v&agrave;o ch&acirc;n</strong></p>\r\n\r\n<p>Kết cấu Grippy được đặt dựa tr&ecirc;n dữ liệu vận động vi&ecirc;n về c&aacute;c chuyển động của người chơi, thiết kế d&agrave;y hơn ở mu b&agrave;n ch&acirc;n v&agrave; ng&oacute;n ch&acirc;n mang lại cảm gi&aacute;c ch&iacute;nh x&aacute;c khi s&uacute;t, chuyền v&agrave; dẫn b&oacute;ng.</p>\r\n\r\n<p><strong>Bề mặt mịn</strong></p>\r\n\r\n<p>Da tổng hợp c&oacute; độ bền cao v&agrave; dễ lau ch&ugrave;i.</p>\r\n\r\n<p><strong>Lực k&eacute;o được điều chỉnh</strong></p>\r\n\r\n<p>Đế cao su được thiết kế để cung cấp cho bạn lực k&eacute;o đa hướng tr&ecirc;n bề mặt tổng hợp.</p>', 'qt_hidden', 1639656000, 1639728000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 2, NULL),
(58, 'Xiaomi Redmi Note 10 Pro', 'xiaomi-redmi-note-10-pro', 'chiếc', 'uploads/files/Products/Electronics/note101.jpg', 'uploads/files/Products/Electronics/note104.jpg,uploads/files/Products/Electronics/note103.jpg,uploads/files/Products/Electronics/note102.jpg', 23, 24, '[\"15\"]', 7490000, 'Xiaomi Redmi Note 10 Pro ( Phiên bản Mi Fan Festival)', 'Xiaomi Redmi Note 10 Pro mang lại cho nhiều dùng quá nhiều trải nghiệm tuyệt vời. Vậy còn ở phiên bản Mi Fan Festival có điều gì đặc biệt, khác gì so với chiếc Redmi Note 10 Pro bình thường, hãy cùng điểm qua ở bên dưới nhé.', 'xiaomi,redmi,note 10 pro', '2021-12-16 01:48:34', '2021-12-28 19:26:59', NULL, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/xiaomi-redmi-note-10-pro-mi-fan-festival.html', 5, '%', '<ul>\r\n	<li>N&acirc;ng tầm nhiếp ảnh - Cụm camera 108MP chất lượng cao, chụp ảnh chi tiết v&agrave; sắc n&eacute;t</li>\r\n	<li>Tốc độ bức ph&aacute; - Snapdragon 732G 8 nh&acirc;n, chuẩn bộ nhớ tốc độ cao UFS 2 2</li>\r\n	<li>M&agrave;n h&igrave;nh vượt trội, phản hồi tức th&igrave; - AMOLED 6 67 inch, tần số qu&eacute;t 120Hz, độ s&aacute;ng tối đa 1200 nit, hỗ trợ DCI- P3, HDR10</li>\r\n	<li>Kh&ocirc;ng lo lắng về pin - Pin lớn 5020mAh, sạc nhanh Mi Turbo 33W ấn tượng</li>\r\n</ul>', '<h3><strong>Mặt lưng logo Mi Bunny, vỏ hộp cảm hứng từ vụ trụ</strong></h3>\r\n\r\n<p>Về cơ bản, điện thoại Xiaomi Redmi Note 10 Pro Mi Fan Festival kh&ocirc;ng c&oacute; nhiều sự kh&aacute;c biệt so với&nbsp;<a href=\"https://cellphones.com.vn/xiaomi-redmi-note-10.html\">Redmi Note 10</a>&nbsp;bản Pro, tuy ngoại h&igrave;nh c&oacute; phần c&aacute;ch t&acirc;n để ph&ugrave; hợp với với đối tượng Mi Fan.</p>\r\n\r\n<p><img alt=\"Mặt lưng logo Mi Bunny, vỏ hộp cảm hứng từ vụ trụ\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/xiaomi/xiaomi-redmi-note-10-pro-mi-fan-festival-2-3.jpg\" /></p>\r\n\r\n<p>Xiaomi Redmi Note 10 Pro l&agrave; phi&ecirc;n bản đặc biệt d&agrave;nh cho fan với vỏ hộp đặc trưng được thiết kế lấy cảm hứng từ vũ trụ. Mặt trước hộp được in h&igrave;nh ảnh c&aacute;c phi h&agrave;nh gia, b&ecirc;n trong l&agrave; sticker Mi Bunny. Điểm nổi bật của Xiaomi Redmi Note 10 Pro Mi Fan Festival l&agrave; mặt sau m&aacute;y c&oacute; in logo Mi Bunny.</p>\r\n\r\n<h3><strong>M&agrave;u sắc thương hiệu, m&agrave;n h&igrave;nh AMOLED, 120 Hz</strong></h3>\r\n\r\n<p>Về thiết kế chắc chắn sẽ kh&ocirc;ng c&oacute; g&igrave; kh&aacute;c biệt, ngo&agrave;i vẫn l&agrave; thiết kế k&iacute;nh ở mặt lưng, hai cạnh cong để tiện cho việc cầm nắm, cụm camera cực đẹp phối giữa đường tr&ograve;n đồng t&acirc;m cho hiệu ứng &aacute;nh s&aacute;ng.</p>\r\n\r\n<p>Điểm nổi bật nhất nằm ở m&agrave;u sắc. Khi ch&uacute;ng ta đ&atilde; qu&aacute; ch&aacute;n nản với m&agrave;u đen, trắng, bạc cũ kỹ th&igrave; m&agrave;u sắc mới mang t&ecirc;n: v&agrave;ng ho&agrave;ng h&ocirc;n sẽ thổi một l&agrave;n hơi mới. Nếu để &yacute; bạn sẽ thấy đ&acirc;y l&agrave; m&agrave;u sắc thương hiệu của Xiaomi, đồng thời được tinh chỉnh rất tinh tế ở phần đ&aacute;nh gradient chuyển dần từ m&agrave;u bạc đến v&agrave;ng đất, t&aacute;i hiện l&ecirc;n khung cảnh ho&agrave;ng h&ocirc;n cực đẹp.</p>\r\n\r\n<p><img alt=\"Màu sắc thương hiệu, màn hình AMOLED, 120 Hz\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/xiaomi/xiaomi-redmi-note-10-pro-mi-fan-festival-1.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, m&agrave;n h&igrave;nh AMOLED tr&ecirc;n Note 10 Pro vẫn thể hiện đầy đủ vai tr&ograve; của n&oacute; l&agrave; hiển thị sắc n&eacute;t v&agrave; rực rỡ đến từng chi tiết v&agrave; m&agrave;u sắc. gi&uacute;p cho người d&ugrave;ng trải nghiệm ch&acirc;n thực bộ phim hay tựa game h&agrave;nh động. Hơn nữa, tần số qu&eacute;t đạt đến 120 Hz cung cấp khả năng chuyển động mượt m&agrave; tr&ecirc;n mọi khung h&igrave;nh.</p>', 'qt_hidden', 1639623600, 1639738800, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR2\",\"6GB DDR2\"]}]', NULL, '0', 4, NULL),
(59, 'Giày Bóng Đá Nam Nike Legend 8', 'giay-bong-da-nam-nike-legend-8', 'Đôi', 'uploads/files/Products/Fashions/giay-trang-1.jpg', 'uploads/files/Products/Fashions/giay-trang-4.jpg,uploads/files/Products/Fashions/giay-trang-3.jpg,uploads/files/Products/Fashions/giay-trang-2.jpg', 34, 21, NULL, 1449000, 'Giày Bóng Đá Nam Nike Legend 8 Club FG/MG', 'Nike Tiempo Legend 8 Club MG lấy cảm hứng từ chất liệu da tổng hợp với thiết kế đa năng tạo độ bám tốt trên cả bề mặt cỏ tự nhiên và nhân tạo.', 'giay,nike,legend 8', '2021-12-16 02:38:07', '2021-12-25 09:02:47', 5, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://supersports.com.vn/collections/giay-bong-da/products/giay-bong-da-nam-nike-legend-8-club-fg-mg-at6107-030?variant=40636989243541', NULL, '%', '<ul>\r\n	<li>Ph&ugrave; hợp sử dụng tr&ecirc;n cỏ tự nhi&ecirc;n hoặc bề mặt nh&acirc;n tạo</li>\r\n	<li>M&atilde; sản phẩm: AT6107-030</li>\r\n</ul>', '<p><strong>GI&Agrave;Y B&Oacute;NG Đ&Aacute; NAM NIKE LEGEND 8 CLUB FG/MG</strong></p>\r\n\r\n<p>Nike Tiempo Legend 8 Club MG lấy cảm hứng từ chất liệu da tổng hợp với thiết kế đa năng tạo độ b&aacute;m tốt tr&ecirc;n cả bề mặt cỏ tự nhi&ecirc;n v&agrave; nh&acirc;n tạo.</p>\r\n\r\n<p>Da tổng hợp mềm được tạo v&acirc;n kim cương đ&uacute;c v&agrave; để si&ecirc;u mỏng để mang lại cảm gi&aacute;c khi tiếp x&uacute;c với b&oacute;ng v&agrave; kiểm so&aacute;t b&oacute;ng tự nhi&ecirc;n.</p>', 'qt_hidden', 1640055600, 1643626800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 2, NULL),
(60, 'Vớ Unisex Adidas Kermit', 'vo-unisex-adidas-kermit', 'Đôi', 'uploads/files/Products/Fashions/tatnam-1.jpg', 'uploads/files/Products/Fashions/tatnam-4.jpg,uploads/files/Products/Fashions/tatnam-3.jpg,uploads/files/Products/Fashions/tatnam-2.jpg', 34, 29, NULL, 184000, 'Vớ Unisex Adidas Kermit', 'Không ai tuyên bố rằng sống xanh là điều dễ dàng. Trên thực tế, Kermit đã nói ngược lại điều đó. Nhưng điều đó không có nghĩa là bạn không nên sử dụng nó, và những đôi vớ dài tới bắp chân của adidas này giúp bạn dễ dàng sống xanh hơn vì chúng được làm bằng vật liệu tái chế.', 'unisex,adidas,kermit', '2021-12-16 02:44:02', '2021-12-28 19:24:53', NULL, 'free_ship', 0, '%', 'on', '30', 'on', '', NULL, 'https://supersports.com.vn/collections/vo/products/vo-unisex-adidas-kermit-gp2560-white?variant=37947242938517', NULL, '%', '<ul>\r\n	<li>D&agrave;i tới bắp ch&acirc;n</li>\r\n	<li>Chất liệu: 52% polyester t&aacute;i chế, 41% b&ocirc;ng t&aacute;i chế, 4% visco, 3% elastan</li>\r\n	<li>Cảm gi&aacute;c mềm mại</li>\r\n	<li>Sọc g&acirc;n</li>\r\n	<li>Họa tiết Kermit</li>\r\n	<li>&copy; Disney</li>\r\n	<li>M&atilde; sản phẩm: GP2560</li>\r\n</ul>', '<p><strong>VỚ KERMIT</strong></p>\r\n\r\n<p><strong>VỚ THỂ THAO VỚI H&Igrave;NH ẢNH ẾCH KERMIT CỦA DISNEY</strong></p>\r\n\r\n<p>Kh&ocirc;ng ai tuy&ecirc;n bố rằng sống xanh l&agrave; điều dễ d&agrave;ng. Tr&ecirc;n thực tế, Kermit đ&atilde; n&oacute;i ngược lại điều đ&oacute;. Nhưng điều đ&oacute; kh&ocirc;ng c&oacute; nghĩa l&agrave; bạn kh&ocirc;ng n&ecirc;n sử dụng n&oacute;, v&agrave; những đ&ocirc;i vớ d&agrave;i tới bắp ch&acirc;n của adidas n&agrave;y gi&uacute;p bạn dễ d&agrave;ng&nbsp;sống xanh&nbsp;hơn v&igrave; ch&uacute;ng được l&agrave;m bằng vật liệu t&aacute;i chế. Cảm gi&aacute;c cực kỳ mềm mại, thoải m&aacute;i l&agrave; một điểm cộng.</p>', 'qt_hidden', 1639627200, 1639828800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 1, NULL),
(61, 'Tạ Lục Giác 15Kg', 'ta-luc-giac-15kg', 'Bộ', 'uploads/files/Products/Gym/ta-1.jpg', 'uploads/files/Products/Gym/ta-4.jpg,uploads/files/Products/Gym/ta-3.jpg,uploads/files/Products/Gym/ta-2.jpg', 34, 22, NULL, 1195000, 'Tạ Lục Giác 15Kg Unisex Body Sculpture', 'Tạ lục giác Body Sculpture BW-460 lý tưởng cho việc tập luyện tại nhà. Các bài tập tăng dần cấp độ và đa dạng bào tập cho các bộ phận: bắp tay, cơ tam đầu, vai, ngực, lưng và chân bằng tạ lục giác.', 'ta luc giac,unisex', '2021-12-16 02:50:19', '2021-12-28 05:11:47', 20, 'flat_rate', 20000, '%', 'on', '20', NULL, '', NULL, 'https://supersports.com.vn/collections/do-tap-luyen/products/t%E1%BA%A1-l%E1%BB%A5c-giac-15kg-unisex-body-sculpture-15kg-bw-460-15kg-black?variant=39248847831189', NULL, '%', '<ul>\r\n	<li>Trọng lượng: 15 Kg</li>\r\n	<li>Chất liệu: Gang đặc</li>\r\n	<li>C&aacute;c đầu tạ được bọc cao su</li>\r\n	<li>Được thiết kế lục gi&aacute;c chống lăn</li>\r\n	<li>M&atilde; sản phẩm: BW-460-15KG</li>\r\n</ul>', '<p><strong>TẠ LỤC GI&Aacute;C 15KG</strong></p>\r\n\r\n<p>Tạ lục gi&aacute;c Body Sculpture BW-460 l&yacute; tưởng cho việc tập luyện tại nh&agrave;. C&aacute;c b&agrave;i tập tăng dần cấp độ v&agrave; đa dạng b&agrave;o tập cho c&aacute;c bộ phận: bắp tay, cơ tam đầu, vai, ngực, lưng v&agrave; ch&acirc;n bằng tạ lục gi&aacute;c. Dễ d&agrave;ng tập luyện trong nh&agrave; hoặc ngo&agrave;i trời v&agrave; bảo vệ mọi bề mặt kh&ocirc;ng bị trầy xước với lớp cao su mềm bao phủ c&aacute;c đầu. Tay cầm c&oacute; kh&iacute;a tr&ecirc;n tay cầm mạ cr&ocirc;m tạo độ b&aacute;m tốt tr&ecirc;n tay v&agrave; kh&ocirc;ng bị trượt. Nhờ thiết kế h&igrave;nh lục gi&aacute;c, c&aacute;c quả tạ dễ xếp chồng l&ecirc;n nhau v&agrave; ch&uacute;ng kh&ocirc;ng lăn khắp ph&ograve;ng. Ngo&agrave;i ra, do thiết kế n&agrave;y, ch&uacute;ng cũng c&oacute; thể được sử dụng như thanh đẩy.</p>', 'qt_hidden', 1640059200, 1643630400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 4, NULL),
(62, 'Con Lăn Tập Gym Unisex Harbinger', 'con-lan-tap-gym-unisex-harbinger', 'Bộ', 'uploads/files/Products/Gym/banh-xe-2.jpg', 'uploads/files/Products/Gym/banh-xe-4.jpg,uploads/files/Products/Gym/banh-xe-3.jpg,uploads/files/Products/Gym/banh-xe-1.jpg', 34, 22, NULL, 1030000, 'Con Lăn Tập Gym Unisex Harbinger Ab Carver Pro', 'Harbinger® Ab Carver® Pro là một bánh xe ab có thiết kế được cấp bằng sáng chế giúp cải thiện hiệu quả của các bài tập ab, giúp tham gia và tăng cường các cơ ở lưng, ngực, cánh tay.', 'gym,unisex,con lan', '2021-12-16 02:55:04', '2021-12-16 02:55:04', NULL, 'flat_rate', 20000, '%', 'on', '20', NULL, '', NULL, 'https://supersports.com.vn/collections/do-tap-luyen/products/con-lan-tap-gym-unisex-harbinger-ab-carver-pro-black?variant=37642254745749', NULL, '%', '<ul>\r\n	<li>Con lăn ab si&ecirc;u rộng với khả năng chống t&iacute;ch hợp v&agrave; tay cầm tiện lợi gi&uacute;p tối đa h&oacute;a kết quả của c&aacute;c b&agrave;i tập lăn ab&nbsp;</li>\r\n	<li>Động cơ nội thất sử dụng l&ograve; xo th&eacute;p carbon để cung cấp lực cản v&agrave; tăng cường hoạt động tập luyện cơ bụng v&agrave; c&aacute;nh tay. Lốp b&aacute;nh xe si&ecirc;u rộng mang lại sự ổn định khi quay tr&aacute;i, phải hoặc trung t&acirc;m</li>\r\n	<li>Tay nắm c&ocirc;ng th&aacute;i học được thiết kế g&oacute;c cạnh để k&iacute;ch hoạt c&aacute;c cơ c&aacute;nh tay v&agrave; cốt l&otilde;i; tay cầm c&oacute; thể th&aacute;o rời để dễ d&agrave;ng cất giữ v&agrave; vận chuyển</li>\r\n	<li>Lu&ocirc;n tạo sự thoải m&aacute;i vượt trội;&nbsp;Bảo h&agrave;nh nh&agrave; sản xuất 1 năm</li>\r\n</ul>', '<p>Harbinger&reg; Ab Carver&reg; Pro l&agrave; một b&aacute;nh xe ab c&oacute; thiết kế được cấp bằng s&aacute;ng chế gi&uacute;p cải thiện hiệu quả của c&aacute;c b&agrave;i tập ab, gi&uacute;p tham gia v&agrave; tăng cường c&aacute;c cơ ở lưng, ngực, c&aacute;nh tay. Kh&ocirc;ng giống như c&aacute;c b&aacute;nh xe ab truyền thống, Ab Carver Pro sử dụng cơ chế l&ograve; xo th&eacute;p carbon độc đ&aacute;o cung cấp lực cản khi người d&ugrave;ng lăn ra v&agrave; hỗ trợ khi họ lăn trở lại, vận động cơ bắp triệt để hơn. Trong khi hầu hết c&aacute;c con lăn ab đều c&oacute; b&aacute;nh xe phẳng chỉ cho ph&eacute;p lăn thẳng ra v&agrave; quay lại, Ab Carver Pro c&oacute; b&aacute;nh xe rộng, h&igrave;nh cầu gi&uacute;p người d&ugrave;ng vận động tất cả c&aacute;c cơ ab, bằng c&aacute;ch xoay sang phải v&agrave; tr&aacute;i. Điều n&agrave;y gi&uacute;p tăng cường c&aacute;c cơ cốt l&otilde;i, gi&uacute;p ổn định xương chậu v&agrave; cột sống. Ab Carver Pro cũng c&oacute; tay nắm được bọc đệm, c&oacute; g&oacute;c cạnh, gi&uacute;p tối đa h&oacute;a sự tham gia của c&aacute;c cơ c&aacute;nh tay trong khi vẫn thoải m&aacute;i v&agrave; ổn định. Ab Carver Pro được bảo h&agrave;nh 1 năm bởi nh&agrave; sản xuất.</p>', 'qt_hidden', 1639627200, 1639828800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 0, NULL);
