(63, 'Giày Đá Banh Nam Predator', 'giay-da-banh-nam-predator', 'Đôi', 'uploads/files/Products/Fashions/giay-xah-1.jpg', 'uploads/files/Products/Fashions/giay-xah-4.jpg,uploads/files/Products/Fashions/giay-xah-3.jpg,uploads/files/Products/Fashions/giay-xah-2.jpg', 34, 29, NULL, 1320000, 'Giày Đá Banh Nam ADIDAS Predator 20.3 FG', 'Bạn không hề chơi ăn gian. Bạn chỉ đang lách luật. Tìm kiếm lợi thế và thay đổi cục diện trận đấu với đôi giày adidas Predator hoàn toàn mới. Thân giày bằng vải dệt mềm mại với thiết kế cổ lửng giúp nâng đỡ vùng cổ chân.', 'giay,adidas,predator 20.3', '2021-12-16 03:14:31', '2021-12-28 19:25:38', 10, 'free_ship', 0, '%', 'on', '15', 'on', '', 60, 'https://supersports.com.vn/collections/giay-bong-da/products/giay-da-banh-nam-adidas-predator-20-3-fg-eg0964?variant=37021920985237', NULL, '%', '<ul>\r\n	<li>&Ocirc;m vừa</li>\r\n	<li>C&oacute; d&acirc;y buộc</li>\r\n	<li>Th&acirc;n gi&agrave;y bằng vải dệt c&oacute; lớp phủ ngo&agrave;i</li>\r\n	<li>Gi&agrave;y b&oacute;ng đ&aacute; s&acirc;n cỏ tự nhi&ecirc;n cổ lửng</li>\r\n	<li>Th&acirc;n gi&agrave;y bề mặt vi nh&aacute;m gi&uacute;p tăng cường khả năng kiểm so&aacute;t b&oacute;ng</li>\r\n	<li>V&ugrave;ng tiếp x&uacute;c b&oacute;ng in 3D c&ocirc;ng nghệ Demonscale</li>\r\n	<li>M&agrave;u sản phẩm: Royal Blue / Cloud White / Active Red</li>\r\n	<li>M&atilde; sản phẩm: EG0964</li>\r\n</ul>', '<p><strong>GI&Agrave;Y B&Oacute;NG Đ&Aacute; PREDATOR 20.3 FIRM GROUND</strong></p>\r\n\r\n<p><strong>GI&Agrave;Y B&Oacute;NG Đ&Aacute; CỔ LỬNG GI&Uacute;P L&Agrave;M CHỦ CUỘC CHƠI TR&Ecirc;N S&Acirc;N CỎ TỰ NHI&Ecirc;N.</strong></p>\r\n\r\n<p>Bạn kh&ocirc;ng hề chơi ăn gian. Bạn chỉ đang l&aacute;ch luật. T&igrave;m kiếm lợi thế v&agrave; thay đổi cục diện trận đấu với đ&ocirc;i gi&agrave;y adidas Predator ho&agrave;n to&agrave;n mới. Th&acirc;n gi&agrave;y bằng vải dệt mềm mại với thiết kế cổ lửng gi&uacute;p n&acirc;ng đỡ v&ugrave;ng cổ ch&acirc;n. V&acirc;n nổi tr&ecirc;n mũi gi&agrave;y tăng độ xo&aacute;y cho từng c&uacute; s&uacute;t. L&agrave;m chủ thế trận với đ&ocirc;i gi&agrave;y b&oacute;ng đ&aacute; Predator 20.3 Firm Ground.</p>', 'qt_hidden', 1640059200, 1643630400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 1, NULL),
