\",\"S\",\"M\"]}]', '[\"#30336b\",\"#a4b0be\",\"#ffffff\",\"#222f3e\"]', '0', 1, NULL),
(72, 'Quần Ngắn Nam Under Armour', 'quan-ngan-nam-under-armour', 'chiếc', 'uploads/files/Products/Fashions/shortnam3.jpg', 'uploads/files/Products/Fashions/shortnam4.jpg,uploads/files/Products/Fashions/shortnam2.jpg,uploads/files/Products/Fashions/shortnam1.jpg', 33, 22, '[\"21\"]', 650000, 'Quần Ngắn Nam Under Armour Vanish Woven', 'Việc tập luyện không chỉ diễn ra trong phòng tập — vì vậy bạn không thể để một cơn mưa nhỏ làm mất đi thói quen luyện tập của mình.', 'quan ngan,under armour', '2021-12-16 20:31:50', '2021-12-28 19:24:51', NULL, 'flat_rate', 0, '%', 'on', NULL, 'on', '', NULL, 'https://supersports.com.vn/collections/quan-ngan-nam/products/quan-ngan-nam-under-armour-vanish-woven-1328654-001?variant=36580271292565', NULL, '%', '<ul>\r\n	<li>100% Polyester</li>\r\n	<li>Vải dệt si&ecirc;u nhẹ, si&ecirc;u bền được chế tạo cho những b&agrave;i tập cường độ cao nhất</li>\r\n	<li>Thiết kế lưới th&ocirc;ng tho&aacute;ng</li>\r\n	<li>Vật liệu co gi&atilde;n 4 chiều gi&uacute;p c&aacute;c bước di chuyển thoải m&aacute;i tối đa theo mọi hướng</li>\r\n	<li>Chất liệu thấm mồ h&ocirc;i v&agrave; kh&ocirc; rất nhanh</li>\r\n	<li>Cạp cao co gi&atilde;n, phẳng với thiết kế t&uacute;i b&ecirc;n t&iacute;ch hợp</li>\r\n	<li>M&atilde; sản phẩm: 1328654-001</li>\r\n</ul>', '<p><strong>QUẦN NGẮN NAM UNDER ARMOUR VANISH WOVEN</strong></p>\r\n\r\n<p>Việc tập luyện kh&ocirc;ng chỉ diễn ra trong ph&ograve;ng tập &mdash; v&igrave; vậy bạn kh&ocirc;ng thể để một cơn mưa nhỏ l&agrave;m mất đi th&oacute;i quen luyện tập của m&igrave;nh. Những chiếc quần đ&ugrave;i thể thao n&agrave;y với chất liệu si&ecirc;u nhẹ, co gi&atilde;n tốt v&agrave; chống thấm nước, sẽ đồng h&agrave;nh cũng bạn tập luyện ở bất cứ đ&acirc;u.</p>', 'qt_hidden', 1639735200, 1639807200, 0, 0, 'isAttribute', NULL, '[{\"attribute_id\":\"21\",\"values\":[\"X\",\"L\",\"S\",\"M\"]}]', NULL, '0', 3, NULL),
