(74, 'Balo đựng đồ cho mẹ và bé Maitedi', 'balo-dung-do-cho-me-va-be-maitedi', 'Bộ', 'uploads/files/Products/Fashions/tui01xanh_1.jpg', 'uploads/files/Products/Fashions/tui01xanh_4.jpg,uploads/files/Products/Fashions/tui01xanh_3.jpg,uploads/files/Products/Fashions/tui01xanh_2.jpg', 31, 23, NULL, 599000, 'Balo đựng đồ cho mẹ và bé Maitedi - gọn gàng, tiện dụng mỗi khi bé ra ngoài.', 'Balo đựng đồ cho mẹ và bé đi ra ngoài Maitedi - Tím Giải pháp tuyệt vời cho các mẹ Bỉm sữa mỗi khi phải cùng con ra ngoài, đi chơi, đi tiêm phòng hay du lịch.', 'balo,maitedi', '2021-12-16 20:47:23', '2021-12-28 08:54:48', NULL, 'free_ship', 0, '%', 'on', '15', NULL, '', NULL, 'https://www.tuticare.com/balo-dung-do-cho-me-va-be-maitedi-item22483.html', NULL, '%', '<ul>\r\n	<li>Với k&iacute;ch thước 42cm x 21cm x 27cm v&agrave; 13 ngăn được thiết kế khoa học, rất th&ocirc;ng minh v&agrave; rộng r&atilde;i c&oacute; thể đựng được đầy đủ c&aacute;c vật dụng cần thiết cho cả b&eacute; lẫn mẹ mỗi khi ra ngo&agrave;i.</li>\r\n	<li>Chất liệu được l&agrave;m từ sợi PE 2 lớp, chống thấm tuyệt đối.</li>\r\n	<li>Ngăn giữ nhiệt b&igrave;nh sữa l&ecirc;n đến 3h đồng hồ.</li>\r\n	<li>Kho&aacute; k&eacute;o th&eacute;p mạ v&agrave;ng sang trọng, chắc chắn v&agrave; rất &ecirc;m.</li>\r\n</ul>', '<p>&nbsp;</p>\r\n\r\n<h2><a href=\"https://www.tuticare.com/Balo%20%C4%91%E1%BB%B1ng%20%C4%91%E1%BB%93%20cho%20m%E1%BA%B9%20v%C3%A0%20b%C3%A9%20Maitedi%20-%20g%E1%BB%8Dn%20g%C3%A0ng,%20ti%E1%BB%87n%20d%E1%BB%A5ng%20m%E1%BB%97i%20khi%20b%C3%A9%20ra%20ngo%C3%A0i\" target=\"_blank\">Balo đựng đồ cho mẹ v&agrave; b&eacute; Maitedi - gọn g&agrave;ng, tiện dụng mỗi khi b&eacute; ra ngo&agrave;i</a></h2>\r\n\r\n<p><strong>Balo đựng đồ cho mẹ v&agrave; b&eacute; đi ra ngo&agrave;i&nbsp;Maitedi</strong>&nbsp;- T&iacute;m Giải ph&aacute;p tuyệt vời cho c&aacute;c mẹ Bỉm sữa mỗi khi phải c&ugrave;ng con ra ngo&agrave;i, đi chơi, đi ti&ecirc;m ph&ograve;ng hay du lịch</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.tuticare.com/media/lib/22483_balomaitedichitiettuticare1.jpg\" style=\"width:400px\" /></p>\r\n\r\n<ol>\r\n	<li>Kh&ocirc;ng Lo đồ đạc lỉnh kỉnh, qu&ecirc;n qu&ecirc;n nhớ nhớ.</li>\r\n	<li>Kh&ocirc;ng Lo thiếu đồ đạc cho b&eacute; mỗi khi ra ngo&agrave;i.</li>\r\n	<li>Kh&ocirc;ng Lo tay x&aacute;ch n&aacute;ch mang v&igrave; qu&aacute; nhiều thứ phải mang theo.</li>\r\n	<li>Kh&ocirc;ng Lo bị &quot;k&eacute;m xinh&quot; v&igrave; đ&ugrave;m đề vừa phải bế con vừa x&aacute;ch đồ đạc.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>V&agrave; c&ograve;n rất nhiều c&aacute;i kh&ocirc;ng phải lo nữa khi lựa chọn&nbsp;<a href=\"https://www.tuticare.com/tui-dung-do-so-sinh-do-dung-cho-be-va-me-160.html\" target=\"_blank\">t&uacute;i đựng bỉm sữa</a>&nbsp;sức chứa khủng của.</p>', 'qt_hidden', 1639735200, 1639807200, 0, 0, 'isAttribute', 1, '[]', '[\"#30336b\",\"#ff7979\"]', '0', 6, NULL),
(76, 'Khăn choàng tắm trẻ em', 'khan-choang-tam-tre-em', 'Cái', 'uploads/files/Products/Kids/khan-1.jpg', 'uploads/files/Products/Kids/khan-4.jpg,uploads/files/Products/Kids/khan-3.jpg,uploads/files/Products/Kids/khan-2.jpg', 31, 23, NULL, 179000, 'Khăn choàng tắm trẻ em Poêmy 73x73cm nhiều màu', 'Sợi siêu vi có kích thước vi mảnh bằng 1/250 lần sợi tóc nên tự nó đã tạo ra sự mềm mại, đó chính là điểm đặc biệt của khăn choàng tắm Poêmy mà các dòng khăn thông thường không có.', 'khan,tre em', '2021-12-16 21:08:58', '2021-12-28 09:31:05', NULL, 'free_ship', 0, '%', 'on', '20', NULL, '', NULL, 'https://www.kidsplaza.vn/khan-choang-tam-tre-em-poemy-73x73cm-nhieu-mau.html', NULL, '%', '<ul>\r\n	<li>\r\n	<p>K&iacute;ch thước (cm): 73x73cm</p>\r\n	</li>\r\n	<li><strong>Sản xuất:</strong>&nbsp;tại Việt Nam</li>\r\n	<li>\r\n	<p>Ph&acirc;n phối ch&iacute;nh h&atilde;ng:&nbsp;<strong>Kids Plaza</strong></p>\r\n	</li>\r\n</ul>', '<h2><strong>Khăn cho&agrave;ng tắm Po&ecirc;my 73x73cm mềm mượt hơn</strong></h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Sản phẩm&nbsp;<a href=\"https://www.kidsplaza.vn/khan-tam-khan-mat.html\" target=\"_blank\">khăn cho&agrave;ng tắm&nbsp;cho b&eacute;</a>&nbsp;chất lượng cao chinh phục mọi lứa tuổi.</p>\r\n	</li>\r\n	<li>\r\n	<p>Nhiều ưu điểm vượt trội như&nbsp;<strong>si&ecirc;u mềm mượt, si&ecirc;u thấm, si&ecirc;u bền</strong>, tạo cảm gi&aacute;c thoải m&aacute;i, dễ chịu nhất cho b&eacute; khi sử dụng.</p>\r\n	</li>\r\n	<li>\r\n	<p>Đ&atilde; đạt chứng chỉ ti&ecirc;u chuẩn TUV Ch&acirc;u &Acirc;u, Po&ecirc;my được l&agrave;m từ 1 loại sợi tổng hợp si&ecirc;u nhỏ, si&ecirc;u mềm<strong>,</strong>&nbsp;an to&agrave;n tuyệt đối cho l&agrave;n da nhạy cảm, non nớt của b&eacute;.</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Sợi si&ecirc;u vi</strong>&nbsp;c&oacute; k&iacute;ch thước vi mảnh bằng 1/250 lần sợi t&oacute;c n&ecirc;n tự n&oacute; đ&atilde; tạo ra sự mềm mại, đ&oacute; ch&iacute;nh l&agrave; điểm đặc biệt của khăn cho&agrave;ng tắm Po&ecirc;my m&agrave; c&aacute;c d&ograve;ng khăn th&ocirc;ng thường kh&ocirc;ng c&oacute;.</p>\r\n	</li>\r\n	<li>\r\n	<p>Kh&ocirc;ng g&acirc;y k&iacute;ch ứng cho l&agrave;n da đồng thời giữ ấm v&agrave; dễ d&agrave;ng lau kh&ocirc; da b&eacute;.</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Đường viền, vắt sổ chuy&ecirc;n nghiệp, xử l&yacute; đến từng chi tiết n&ecirc;n kh&ocirc;ng g&acirc;y cấn, hay xổ chỉ, x&ugrave; l&ocirc;ng khi d&ugrave;ng trong thời gian d&agrave;i.</p>\r\n	</li>\r\n	<li>\r\n	<p>Sản phẩm c&oacute;<strong>&nbsp;nhiều m&agrave;u</strong>, ph&ugrave; hợp cho cả b&eacute; trai v&agrave; b&eacute; g&aacute;i.</p>\r\n	</li>\r\n</ul>', 'qt_hidden', 1639738800, 1639810800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 6, NULL),
(77, 'Máy lọc không khí Vsmart', 'may-loc-khong-khi-vsmart', 'Cái', 'uploads/files/Products/personal%20belongings/may-loc-khong-khi-1.jpg', 'uploads/files/Products/personal%20belongings/may-loc-khong-khi-4.jpg,uploads/files/Products/personal%20belongings/may-loc-khong-khi-3.jpg,uploads/files/Products/personal%20belongings/may-loc-khong-khi-2.jpg', 28, 30, NULL, 1590000, 'Máy lọc không khí Vsmart 30la5300', 'Lúc này để bảo vệ sức khỏe của bản thân và gia đình, bạn sẽ cần đến những thiết bị tinh lọc nguồn không khí như máy lọc không khí Vsmart 30la5300.', 'vsmart,loc khong khi', '2021-12-16 21:15:52', '2021-12-28 19:24:52', 10, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/may-loc-khong-khi-vsmart-30la5300.html', NULL, '%', '<ul>\r\n	<li>Chức năng tạo ion &acirc;m đảm bảo chất lượng kh&ocirc;ng kh&iacute; v&agrave; sức khoẻ người d&ugrave;ng</li>\r\n	<li>Khử m&ugrave;i h&ocirc;i hiệu quả,loại bỏ c&aacute;c loại kh&iacute; độc hại formaldehyde, benzen, xylene</li>\r\n	<li>M&agrave;ng lọc c&ocirc;ng nghệ Hepa 13 loại bỏ bụi k&iacute;ch thước 0.03 micromet như phấn hoa,kh&oacute;i thuốc</li>\r\n	<li>Dễ d&agrave;ng bảo dưỡng,tự động th&ocirc;ng b&aacute;o khi hết nước v&agrave; cần thay m&agrave;n lọc</li>\r\n</ul>', '<h3><strong>M&agrave;ng lọc Hepa H13, l&agrave;m sạch kh&ocirc;ng kh&iacute; hiệu quả</strong></h3>\r\n\r\n<p>M&aacute;y lọc kh&ocirc;ng kh&iacute; Vsmart&nbsp;lần n&agrave;y với thiết kế một m&agrave;ng lọc Hepa H13 gi&uacute;p loại bỏ những bụi nhỏ với k&iacute;ch thước l&ecirc;n đến PM2.5. Thiết bị với khả năng l&agrave;m sạch hiệu quả với kh&ocirc;ng gian nh&agrave; 30m2.</p>\r\n\r\n<p><img alt=\"Màng lọc Hepa H13, làm sạch không khí hiệu quả\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/may-loc-khong-khi-vsmart-30la5300-1_1.jpg\" /></p>\r\n\r\n<h3><strong>Tự động l&agrave;m sạch kh&ocirc;ng kh&iacute;, điều khiển qua cảm ứng</strong></h3>\r\n\r\n<p>M&aacute;y lọc Vsmart 30la5300 được trang bị hệ thống điều khiển cảm ứng tiện lợi. M&aacute;y với t&iacute;nh năng tự động l&agrave;m sạch kh&ocirc;ng kh&iacute;. Ngo&agrave;i ra, m&aacute;y lọc kh&ocirc;ng kh&iacute; Vsmart 30la5300 c&ograve;n được trang bị một số c&ocirc;ng nghệ th&ocirc;ng minh như khả năng tạo ion &acirc;m&nbsp;khử m&ugrave;i v&agrave; m&agrave;ng lọc gi&uacute;p loại bỏ c&aacute;c m&ugrave;i kh&oacute; chịu như m&ugrave;i dầu mỡ nấu ăn, m&ugrave;i thuốc l&aacute;,... c&ugrave;ng với đ&oacute; l&agrave; kh&oacute;a trẻ em an to&agrave;n khi sử dụng.</p>\r\n\r\n<p><img alt=\"Tự động làm sạch không khí, điều khiển qua cảm ứng\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/may-loc-khong-khi-vsmart-30la5300-2_1.jpg\" /></p>\r\n\r\n<p>Vsmart 30la5300 c&ograve;n được trang bị t&iacute;nh năng cảnh b&aacute;o thay m&agrave;ng lọc, nhờ đ&oacute; gi&uacute;p chất lượng lọc lu&ocirc;n ổn định, mang lại nguồn kh&ocirc;ng kh&iacute; trong l&agrave;nh cho cả gia đ&igrave;nh.</p>', 'qt_hidden', 1640084400, 1643612400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 7, NULL),
(78, 'Đèn Led để bàn Taotronics', 'den-led-de-ban-taotronics', 'Cái', 'uploads/files/Products/personal%20belongings/den-led-1.jpg', 'uploads/files/Products/personal%20belongings/den-led-4.jpg,uploads/files/Products/personal%20belongings/den-led-3.jpg,uploads/files/Products/personal%20belongings/den-led-2.jpg', 28, 13, NULL, 460000, 'Đèn Led để bàn Taotronics TT DL01/TT DL02', 'Đèn LED để bàn Taotronics có thể tùy chỉnh ánh sáng theo 4 chế độ phù hợp với mục đích. Ngoài ra, bạn hoàn toàn có thể điều chỉnh thiết bị nhà thông minh.', 'den led,taotronics', '2021-12-16 21:19:34', '2021-12-28 19:24:55', NULL, 'free_ship', 0, '%', 'on', '15', NULL, '', NULL, 'https://cellphones.com.vn/den-led-de-ban-taotronics-tt-dl01-tt-dl02.html', NULL, '%', '<ul>\r\n	<li>Nhiệt độ m&agrave;u 2700 - 6500k &aacute;nh s&aacute;ng tự nhi&ecirc;n bảo vệ mắt</li>\r\n	<li>4 chế độ &aacute;nh s&aacute;ng ngủ,nghỉ ngơi,đọc s&aacute;ch,học tập</li>\r\n	<li>Hỗ trợ xoay 180 độ để đưa &aacute;nh s&aacute;ng đến nơi cần thiết</li>\r\n	<li>Ch&acirc;n đ&egrave;n l&agrave;m từ kim loại chắc chắn,hư hỏng trong qu&aacute; tr&igrave;nh sử dụng</li>\r\n	<li>Trang bị cổng sạc USB c&oacute; thể sạc cho điện thoại</li>\r\n</ul>', '<h3><strong>T&ugrave;y chỉnh &aacute;nh s&aacute;ng v&agrave; g&oacute;c s&aacute;ng theo nhu cầu của bạn</strong></h3>\r\n\r\n<p>Đ&egrave;n LED để b&agrave;n Taotronics c&oacute; thể điều chỉnh &aacute;nh s&aacute;ng với 4 chế độ &aacute;nh s&aacute;ng ph&ugrave; hợp với mục đ&iacute;ch của bạn.&nbsp;Bốn chế độ đ&egrave;n độc đ&aacute;o đều được trang bị 5 mức độ s&aacute;ng t&ugrave;y chỉnh phục vụ cho nhu cầu l&agrave;m việc, đọc s&aacute;ch, học tập, thư gi&atilde;n, may v&aacute;,... v&ocirc; c&ugrave;ng tiện dụng.</p>\r\n\r\n<p><img alt=\"Tùy chỉnh ánh sáng và góc sáng theo nhu cầu của bạn\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/den-led-de-ban-taotronics-tt-dl01-tt-dl02-1.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, với đ&egrave;n LED để b&agrave;n Taotronics (TT-DL01), người d&ugrave;ng c&ograve;n tự điều chỉnh g&oacute;c s&aacute;ng sao cho tối ưu với khả năng xoay c&aacute;nh tay đ&egrave;n l&ecirc;n đến 140 &deg;, gập tay đ&egrave;n b&agrave;n 40 &deg; hoặc xoay đế 90 &deg; sang tr&aacute;i v&agrave; mang lại được g&oacute;c ho&agrave;n hảo v&agrave; tr&aacute;nh chiếu s&aacute;ng trực tiếp v&agrave;o mắt g&acirc;y kh&oacute; chịu.</p>\r\n\r\n<h3><strong>Trang bị cổng sạc USB v&agrave; chế độ hẹn giờ tắt tiện lợi</strong></h3>\r\n\r\n<p>Đ&egrave;n LED để b&agrave;n Taotronics sử dụng cổng sạc USB tiện lợi, gi&uacute;p bạn kh&ocirc;ng phải lo t&igrave;m ổ cắm cho c&aacute;c thiết bị như điện thoại di động, m&aacute;y t&iacute;nh bảng v&agrave; ho&agrave;n to&agrave;n c&oacute; thể sạc lại thiết bị của bạn th&ocirc;ng qua đầu ra USB 5V / 1A được t&iacute;ch hợp.</p>', 'qt_hidden', 1639738800, 1639810800, 0, 0, 'isAttribute', 1, '[]', '[\"#ffffff\",\"#222f3e\"]', '0', 8, NULL),
(79, 'Máy lọc nước Coway Nadi', 'may-loc-nuoc-coway-nadi', 'Cái', 'uploads/files/Products/personal%20belongings/may-loc-nuoc-1.jpg', 'uploads/files/Products/personal%20belongings/may-loc-nuoc-4.jpg,uploads/files/Products/personal%20belongings/may-loc-nuoc-3.jpg,uploads/files/Products/personal%20belongings/may-loc-nuoc-2.jpg', 28, 14, NULL, 5600000, 'áy lọc nước Coway Nadi - Cho nguồn nước sạch tinh khiết.', 'Một nguồn nước uống sạch tinh khiết sẽ góp phần duy trì sức khỏe, nâng cao chất lượng sống của hộ gia đình bạn. Và máy lọc nước Coway Nadi - một thiết bị nhà thông minh sẽ mang đến cho bạn nguồn nước sạch tinh khiết ấy.', 'loc nuoc,coway nadi', '2021-12-16 21:23:53', '2021-12-28 19:22:39', 15, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/may-loc-nuoc-coway-nadi.html', NULL, '%', '<ul>\r\n	<li>Lọc 5 bước đa năng cho nguồn nước uống trực tiếp kh&ocirc;ng cần đun s&ocirc;i</li>\r\n	<li>L&otilde;i lọc C&aacute;c-bon C9 với kết cấu 3 lớp C&aacute;c-bon hoạt t&iacute;nh được l&agrave;m từ xơ dừa tự nhi&ecirc;n</li>\r\n	<li>Hệ thống lọc Coway RO1.0 loại bỏ c&aacute;c hạt c&oacute; k&iacute;ch thước 1/10000 k&iacute;ch thước sợi t&oacute;c</li>\r\n	<li>B&igrave;nh chứa dung t&iacute;ch lớn 8 L&iacute;t tiện lợi</li>\r\n	<li>M&aacute;y lọc kh&ocirc;ng cần nguồn điện: an to&agrave;n v&agrave; tiết kiệm chi ph&iacute;</li>\r\n	<li>Dễ d&agrave;ng vệ sinh sạch sẽ với đầu v&ograve;i th&aacute;o rời</li>\r\n</ul>', '<h3><strong>C&ocirc;ng ngh&ecirc;̣ lọc 5 bước hi&ecirc;̣n đại tạo ngu&ocirc;̀n nước sạch</strong></h3>\r\n\r\n<p>M&aacute;y lọc nước Coway Nadi&nbsp;được trang bị h&ecirc;̣ th&ocirc;́ng lọc nước Coway RO 1.0 5 bước ri&ecirc;ng bi&ecirc;̣t với kỹ thu&acirc;̣t ti&ecirc;n ti&ecirc;́n, giúp loại bỏ vi khu&acirc;̉n b&ecirc;n trong và giữ cho nước u&ocirc;́ng lu&ocirc;n sạch. Trong đó,&nbsp;Coway Nadi&nbsp;sử dụng b&ocirc;̣ lọc Carbon C9 ba lớp hoạt tính làm từ xơ dừa, giúp loại bỏ Clo và hợp ch&acirc;́t hữu cơ và duy trì ch&acirc;́t lượng ngu&ocirc;̀n nước u&ocirc;́ng cho bạn.</p>\r\n\r\n<p><img alt=\"Máy lọc nước Coway P-300L\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/may-loc-nuoc-coway-p-300l-1.jpg\" /></p>\r\n\r\n<p>Ngoài ra, máy lọc nước được trang bị h&ecirc;̣ th&ocirc;́ng lõi lọc RO membrane hi&ecirc;̣u năng cao. Với khả năng loại t&acirc;́t cả thành ph&acirc;̀n đ&ocirc;̣c hại và vi khu&acirc;̉n,&nbsp;Coway Nadi&nbsp;sẽ cho ra ngu&ocirc;̀n nước tinh khi&ecirc;́t mà bạn có th&ecirc;̉ t&acirc;̣n hưởng b&acirc;́t cứ lúc nào.</p>\r\n\r\n<h3><strong>Thi&ecirc;́t k&ecirc;́ t&ocirc;ng trắng - xanh sang trọng với k&ecirc;́t c&acirc;́u d&ecirc;̃ sử dụng</strong></h3>\r\n\r\n<p>Máy lọc nước phù hợp ở b&acirc;́t kỳ vị trí nào trong kh&ocirc;ng gian s&ocirc;́ng của bạn nhờ thi&ecirc;́t k&ecirc;́ t&ocirc;́i giản cùng t&ocirc;ng màu trắng - xanh sang trọng. Đặc bi&ecirc;̣t,&nbsp;Coway Nadi&nbsp;h&ocirc;̃ trợ cả ch&ecirc;́ đ&ocirc;̣ lọc nước kh&ocirc;ng c&acirc;̀n đi&ecirc;̣n, vừa đảm bảo an toàn vừa ti&ecirc;́t ki&ecirc;̣m chi phí cho gia đình bạn.</p>\r\n\r\n<p><img alt=\"Máy lọc nước Coway P-300L\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/may-loc-nuoc-coway-p-300l-2.jpg\" /></p>\r\n\r\n<p>Máy lọc nước mang k&ecirc;́t c&acirc;́u đơn giản, d&ecirc;̃ sử dụng đ&ocirc;́i với cả trẻ em và người cao tu&ocirc;̉i.&nbsp;Coway Nadi&nbsp;trang bị bình chứa đ&ecirc;́n 8 lít, với b&ocirc;̣ đi&ecirc;̀u khi&ecirc;̉n mực nước giúp ngăn tình trạng tràn nước khi rót. Và nhờ vào k&ecirc;́t c&acirc;́u đơn giản mà quá trình tháo lắp, v&ecirc;̣ sinh cho máy lọc nước&nbsp;Coway Nadi&nbsp;cũng trở n&ecirc;n nhanh chóng và ti&ecirc;̣n lợi.</p>', 'qt_hidden', 1640084400, 1643612400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 10, NULL),
(80, 'Camera hành trình Insta360 Go 2', 'camera-hanh-trinh-insta360-go-2', 'Chiếc', 'uploads/files/Products/Electronics/insta360-go-1.jpg', 'uploads/files/Products/Electronics/insta360-go-4.jpg,uploads/files/Products/Electronics/insta360-go-3.jpg,uploads/files/Products/Electronics/insta360-go-2.jpg', 27, 7, NULL, 7290000, 'Camera hành trình Insta360 Go 2PKCA.118', 'Camera hành trình Insta360 Go 2 là một action camera có thiết kế thu nhỏ, hình dạng như viên thuốc. Tuy nhỏ nhưng nó vẫn chứa đầy đủ các tính năng chụp ảnh và quay phim cơ bản.', 'insta360,go 2pkca', '2021-12-16 22:53:55', '2021-12-28 19:57:53', NULL, 'flat_rate', 0, '%', 'on', '15', 'on', '', NULL, 'https://cellphones.com.vn/camera-hanh-trinh-insta360-go-2.html', NULL, '%', '<ul>\r\n	<li><strong>Camera h&agrave;nh tr&igrave;nh Insta360 Go 2</strong>&nbsp;l&agrave; một action camera c&oacute; thiết kế thu nhỏ, h&igrave;nh dạng như vi&ecirc;n thuốc.</li>\r\n	<li>Tuy nhỏ nhưng n&oacute; vẫn chứa đầy đủ c&aacute;c t&iacute;nh năng chụp ảnh v&agrave; quay phim cơ bản.</li>\r\n	<li>Insta360 Go 2 l&agrave; lựa chọn l&yacute; tưởng gi&uacute;p bạn lưu lại mọi thứ trong cuộc sống.</li>\r\n</ul>', '<h3><strong>Thiết kế si&ecirc;u nhỏ ấn tượng</strong></h3>\r\n\r\n<p><a href=\"https://cellphones.com.vn/phu-kien/camera/hanh-trinh/insta360.html\" target=\"_blank\">Camera Insta360</a>&nbsp;với k&iacute;ch thước nhỏ gọn c&ugrave;ng c&acirc;n nặng si&ecirc;u nhẹ. Phi&ecirc;n bản Go 2 đ&atilde; được n&acirc;ng cấp so với người tiền nhiệm, cho ph&eacute;p quay video với độ ph&acirc;n giải tối đa 3K v&agrave; chụp ảnh 9MP. Với k&iacute;ch thước v&agrave; trọng lượng nhỏ bạn sẽ dễ d&agrave;ng gắn m&aacute;y quay Insta360 Go 2 ở bất cứ đ&acirc;u.</p>\r\n\r\n<p><img alt=\"Camera hành trình Insta360 Go 2\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-hanh-trinh-insta360-go-2-1.jpg\" /></p>\r\n\r\n<p>Dựa v&agrave;o thiết kế nhỏ gọn&nbsp;<strong>Insta360 Go 2</strong>&nbsp;c&oacute; thể được gắn v&agrave;o c&aacute;c phụ kiện kh&aacute;c nhau. Bạn c&oacute; thể quay bản th&acirc;n trong c&aacute;c chuyến h&agrave;nh tr&igrave;nh, đeo quanh cổ hoặc kẹp v&agrave;o cổ &aacute;o, gắn v&agrave;o v&aacute;n trượt hay gắn v&agrave;o cổ th&uacute; cưng,&hellip;</p>\r\n\r\n<h3><strong>T&iacute;nh năng quay video hiệu quả &ndash; Chống rung 6 trục hiệu quả</strong></h3>\r\n\r\n<p>Camera h&agrave;nh tr&igrave;nh Insta360 Go 2 sử dụng cảm biến h&igrave;nh ảnh chất lượng với khẩu độ f/2.2 mang lại chất lượng video v&agrave; h&igrave;nh ảnh vượt trội. Thiết bị cho ph&eacute;p quay video với khung h&igrave;nh 120 fps.</p>\r\n\r\n<p><img alt=\"Camera hành trình Insta360 Go 2\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-hanh-trinh-insta360-go-2-2.jpg\" /></p>\r\n\r\n<p>Insta360 Go 2 c&oacute; chế độ chống rung ấn tượng l&ecirc;n đến 6 trục với thuật to&aacute;n kết hợp &ldquo;horizon leveling algorithms&rdquo; đem lại video chống rung cực đỉnh.</p>\r\n\r\n<h3><strong>Hỗ trợ chống nước c&ugrave;ng pin dung lượng lớn</strong></h3>\r\n\r\n<p>Camera Insta360 Go 2 được t&iacute;ch hợp một vỏ chống thấm nước IPX8, nghĩa l&agrave; c&oacute; thể sử dụng ở độ s&acirc;u tối đa 4m dưới nước. Với c&ocirc;ng nghệ AquaVision gi&uacute;p loại bỏ sương m&ugrave; v&agrave; th&ecirc;m độ tương phản, m&agrave;u sắc khi bạn quay dưới nước.</p>', 'qt_hidden', 1639742400, 1639814400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 7, NULL),
(81, 'Camera hành trình dẫn đường w810', 'camera-hanh-trinh-dan-duong-w810', 'Cái', 'uploads/files/Products/Electronics/vietmap-r4a-1.jpg', 'uploads/files/Products/Electronics/vietmap-r4a-4.jpg,uploads/files/Products/Electronics/vietmap-r4a-3.jpg,uploads/files/Products/Electronics/vietmap-r4a-2.jpg', 27, 8, NULL, 3320000, 'Camera hành trình dẫn đường Vietmap w810', 'Làm sao để có khung hình thật là chi tiết trên quãng đường đi của bạn? Đó là nhờ vào camera hành trình dẫn đường Vietmap w810, những điều bất thường dù nhỏ nhất khó nhìn nhất đều được bạn quay lại một cách dễ dàng.', 'camera,w810', '2021-12-16 23:00:18', '2021-12-28 19:25:28', NULL, 'flat_rate', 0, '%', NULL, '15', NULL, '', 20, 'https://cellphones.com.vn/camera-hanh-trinh-vietmap-w810-dan-duong.html', NULL, '%', '<ul>\r\n	<li><a href=\"https://cellphones.com.vn/phu-kien/camera/hanh-trinh/vietmap.html\" target=\"_blank\">Camera h&agrave;nh tr&igrave;nh dẫn đường Vietmap</a>&nbsp;mang t&ecirc;n w810 cho ph&eacute;p người sử dụng c&oacute; thể vừa ghi h&igrave;nh v&agrave; vừa chụp ảnh c&ugrave;ng một l&uacute;c.</li>\r\n	<li>Qua đ&oacute;, bạn dễ d&agrave;ng bắt cận cảnh những khung ảnh kỳ qu&aacute;i xuất hiện tr&ecirc;n đường đi.</li>\r\n	<li>Ngo&agrave;i ra, h&igrave;nh ảnh v&agrave; video m&agrave; n&oacute; thu được sẽ chuẩn Full HD sắc n&eacute;t, v&agrave; ph&oacute;ng to t&ugrave;y &yacute; c&oacute; thể nh&igrave;n r&otilde; được vật thể.</li>\r\n</ul>', '<h3><strong>Dễ d&agrave;ng kết nối bằng wifi, kết nối với xe</strong></h3>\r\n\r\n<p>Để cập nhật được t&iacute;nh năng mới nhất, bạn c&oacute; thể sử dụng wifi v&agrave; hệ thống sẽ th&ocirc;ng b&aacute;o bạn cần l&agrave;m g&igrave; để tải xuống bản cập nhật v&iacute; dụ như một chiếc bản đồ online mới nhất chẳng hạn. Với phần mềm VietMap S1 hỗ trợ t&iacute;nh năng điểm đến trực tuyến gi&uacute;p dẫn đường đi cho bạn nhanh hơn.</p>\r\n\r\n<p><img alt=\"Dễ dàng kết nối bằng wifi, kết nối với xe\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-hanh-trinh-vietmap-w810-dan-duong-2-min.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, camera VietMap c&ograve;n c&oacute; cổng Av-in sử dụng để kết nối với camera l&ugrave;i tr&ecirc;n xe hơi v&agrave; từ đ&oacute; m&agrave;n h&igrave;nh sẽ tự động chuyển sang m&agrave;n h&igrave;nh camera l&ugrave;i khi bạn trả số về số de &ldquo;R&rdquo;.</p>\r\n\r\n<h2><strong>Mua ngay camera h&agrave;nh tr&igrave;nh dẫn đường Vietmap w810 ch&iacute;nh h&atilde;ng, gi&aacute; rẻ tại CellphoneS</strong></h2>\r\n\r\n<p>Nếu bạn mong muốn một trải nghiệm h&agrave;nh tr&igrave;nh quay phim đường đi tốt hơn th&igrave; đừng qu&ecirc;n trang bị camera h&agrave;nh tr&igrave;nh dẫn đường Vietmap w810. Sản phẩm đang được b&aacute;n ra tại CellphoneS với mức gi&aacute; tốt v&agrave; bảo h&agrave;nh 12 th&aacute;ng.</p>', 'qt_hidden', 1639742400, 1639814400, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 5, NULL),
(82, 'Camera IP Wifi Eufy indoor T8400', 'camera-ip-wifi-eufy-indoor-t8400', 'Cái', 'uploads/files/Products/Electronics/tapo-c100-1.jpg', 'uploads/files/Products/Electronics/tapo-c100-4.jpg,uploads/files/Products/Electronics/tapo-c100-3.jpg,uploads/files/Products/Electronics/tapo-c100-2.jpg', 27, 13, NULL, 900000, 'Camera IP Wifi Eufy indoor T8400 2K', 'Camera IP Wifi Eufy indoor T8400 2K là dòng sản phẩm được thiết kế tích hợp nhiều tính năng hiện đại của nhà Eufy, có khả năng quay video xa đến 10m, phóng to lên đến 8x, hỗ trợ thêm WiFi 2.4GHz.', 'camera,eufy indoor', '2021-12-16 23:05:50', '2021-12-28 19:21:57', NULL, 'free_ship', 0, '%', NULL, '15', NULL, '', NULL, 'https://cellphones.com.vn/camera-ip-wifi-eufy-indoor-t8400-2k.html', NULL, '%', '<ul>\r\n	<li>Camera IP Wifi Eufy indoor T8400 2K l&agrave; d&ograve;ng sản phẩm được thiết kế t&iacute;ch hợp nhiều t&iacute;nh năng hiện đại của nh&agrave; Eufy.</li>\r\n	<li>C&oacute; khả năng quay video xa đến 10m.</li>\r\n	<li>Ph&oacute;ng to l&ecirc;n đến 8x, hỗ trợ th&ecirc;m WiFi 2.4GHz.</li>\r\n	<li>Hứa hẹn sẽ mang đến cho gia đ&igrave;nh bạn một chiếc&nbsp;<a href=\"https://cellphones.com.vn/phu-kien/camera/an-ninh.html\" target=\"_self\">camera an ninh</a>&nbsp;tuy nhỏ gọn nhưng lại th&ocirc;ng minh.</li>\r\n</ul>', '<h3><strong>Thiết kế nhỏ gọn, th&ocirc;ng minh</strong></h3>\r\n\r\n<p>Camera IP Wifi Eufy indoor T8400 2K trọng lượng chỉ 98g v&agrave; k&iacute;ch thước l&agrave; 55 x 55 x 104mm, nhỏ gọn nhưng t&iacute;ch hợp nhiều t&iacute;nh năng th&ocirc;ng minh sẽ bảo vệ v&agrave; theo d&otilde;i gia đ&igrave;nh của bạn 24/7.</p>\r\n\r\n<p><img alt=\"Thiết kế nhỏ gọn, thông minh\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-ip-wifi-eufy-indoor-t8400-1.jpg\" /></p>\r\n\r\n<p>Đặc biệt ở chiếc camera IP Wifi Eufy indoor T8400 2K n&agrave;y l&agrave; t&iacute;ch hợp c&ocirc;ng nghệ Al c&oacute; khả năng nhận diện, ph&acirc;n biệt con người v&agrave; th&uacute; cưng.</p>\r\n\r\n<p>&gt;&gt;&gt; tham khảo th&ecirc;m:&nbsp;<a href=\"https://cellphones.com.vn/camera-ip-wifi-eufy-indoor-t8410-360-2k.html\" target=\"_blank\">Camera IP Wifi Eufy indoor T8410 360 2K</a></p>\r\n\r\n<h3><strong>Camera th&ocirc;ng minh t&iacute;ch hợp nhiều t&iacute;nh năng bảo vệ an ninh cho mọi nh&agrave;</strong></h3>\r\n\r\n<p>Camera IP Wifi Eufy indoor T8400 2K l&agrave; d&ograve;ng camera được đ&aacute;nh gi&aacute; cao bởi c&oacute; chất lượng 2K, cho mọi h&igrave;nh ảnh v&agrave; video ghi lại được hiển thị sắc n&eacute;t, r&otilde; r&agrave;ng v&agrave; m&agrave;u sắc ch&acirc;n thực, cao hơn hẳn c&aacute;c d&ograve;ng camera thường kh&aacute;c.</p>\r\n\r\n<p>Phạm vi quay video rộng đến 10m v&agrave; khả năng ph&oacute;ng to tới 8x, đảm bảo sẽ quan s&aacute;t căn nh&agrave; của bạn một c&aacute;ch chi tiết v&agrave; đầy đủ hơn.</p>\r\n\r\n<p><img alt=\"Camera thông minh tích hợp nhiều tính năng bảo vệ an ninh cho mọi nhà\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/camera/camera-ip-wifi-eufy-indoor-t8400-2.jpg\" /></p>\r\n\r\n<p>Camera IP Wifi Eufy indoor T8400 2K&nbsp;đảm bảo được nhu cầu lưu trữ của người d&ugrave;ng với 2 h&igrave;nh thức: lưu trữ tr&ecirc;n thẻ Micro SD &ndash; hỗ trợ l&ecirc;n đến 128GB hoặc lưu trữ đ&aacute;m m&acirc;y.</p>', 'qt_hidden', 1639702800, 1639818000, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 3, NULL),
(83, 'Laptop ASUS ROG Zephyrus', 'laptop-asus-rog-zephyrus', 'Chiếc', 'uploads/files/Products/Electronics/rog-zephyrus-1.jpg', 'uploads/files/Products/Electronics/rog-zephyrus-4.jpg,uploads/files/Products/Electronics/rog-zephyrus-3.jpg,uploads/files/Products/Electronics/rog-zephyrus-2.jpg', 26, 9, '[\"33\"]', 46990000, 'Laptop ASUS Gaming ROG Zephyrus G14 GA401QM-K2041T', 'Laptop Asus Gaming Rog Zephyrus G14 GA401QM-K2041T là một sự lựa chọn hoàn hảo không thể bỏ qua dành cho bạn với mức giá khác tốt tại CellphoneS.', 'asus,gaming rog,zephyrus g14', '2021-12-16 23:15:15', '2021-12-24 20:13:46', NULL, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/laptop-asus-gaming-rog-zephyrus-g14-ga401qm.html', NULL, '%', '<ul>\r\n	<li>&nbsp;<strong><a href=\"https://cellphones.com.vn/laptop/asus/gaming.html\" target=\"_blank\">Laptop Asus Gaming</a>&nbsp;Rog Zephyrus G14 GA401QM-K2041T</strong>&nbsp;l&agrave; một sự lựa chọn ho&agrave;n hảo kh&ocirc;ng thể bỏ qua d&agrave;nh cho bạn với mức gi&aacute; kh&aacute;c tốt tại CellphoneS.</li>\r\n	<li>Asus đ&atilde; kh&aacute; quan t&acirc;m đến nhu cầu trải nghiệm game của người d&ugrave;ng v&agrave; trang bị cho chiếc laptop của m&igrave;nh c&ograve;n chip AMD Ryzen 9 5900HS thế hệ mới cho hiệu năng cực kỳ mạnh mẽ đ&aacute;p ứng cho nhu cầu chơi game hiệu năng cao.</li>\r\n	<li>Ngo&agrave;i ra bộ nhớ RAM của chiếc laptop n&agrave;y cũng l&ecirc;n đến 32GB cho ph&eacute;p người d&ugrave;ng c&oacute; thể đa nhiệm c&ugrave;ng l&uacute;c rất nhiều ứng dụng một c&aacute;ch vượt trội v&agrave; dễ d&agrave;ng. Ph&ugrave; hợp chơi được tất cả c&aacute;c loại game hiện tại đang thịnh h&agrave;nh.</li>\r\n</ul>', '<h3><strong>Ổ cứng 1Tb chuẩn M.2 PCIE, card đồ họa VGA 6GB RTX 3060</strong></h3>\r\n\r\n<p>Một bộ phận cũng kh&aacute; quan trong tr&ecirc;n chiếc laptop n&agrave;y đ&oacute; l&agrave; được trang bị ổ cứng l&ecirc;n đến 1TB chuẩn M.2 PCIE thế hệ mới cho tốc độ truy xuất dữ liệu rất nhanh v&agrave; lưu trữ được kh&aacute; nhiều tựa game nặng một c&aacute;ch dễ d&agrave;ng.</p>\r\n\r\n<p><img alt=\"Ổ cứng 1Tb chuẩn M.2 PCIE, card đồ họa VGA 6GB RTX 3060\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/laptop/laptop-asus-gaming-rog-zephyrus-g14-ga401qm.jpg\" /></p>\r\n\r\n<p>Card đồ họa VGA 6GB RTX 3060 cũng được trang bị tr&ecirc;n chiếc laptop Asus cho khả năng xử l&yacute; h&igrave;nh ảnh kh&aacute; tốt ở độ ph&acirc;n giải cao v&agrave; xuất ra m&agrave;n h&igrave;nh 14 inch độ ph&acirc;n giải WQHD 120Hz một c&aacute;ch dễ d&agrave;ng v&agrave; rất mượt m&agrave;.</p>\r\n\r\n<h2><strong>Mua laptop Asus Gaming Rog Zephyrus G14 GA401QM-K2041T ch&iacute;nh h&atilde;ng gi&aacute; tại CellphoneS</strong></h2>\r\n\r\n<p>Hiện tại, hầu hết c&aacute;c cửa h&agrave;ng của CellphoneS tr&ecirc;n to&agrave;n quốc đều c&oacute; h&agrave;ng sẵn chiếc&nbsp;<strong>laptop Asus Gaming Rog Zephyrus g14 GA401QM-K2041T</strong>&nbsp;với mức gi&aacute; cực tốt k&egrave;m nhiều ưu đ&atilde;i hấp dẫn d&agrave;nh cho bạn. CellphoneS c&ograve;n cho ph&eacute;p người d&ugrave;ng trả g&oacute;p với l&atilde;i suất chỉ 0% khi mua chiếc laptop gaming cao cấp n&agrave;y tại hệ thống nữa nh&eacute;!</p>', 'qt_hidden', 1639702800, 1639818000, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"33\",\"values\":[\"SSD: 512GB\",\"SSD: 256GB\"]}]', NULL, '0', 11, NULL);
