(84, 'Laptop Lenovo Legion 7', 'laptop-lenovo-legion-7', 'Chiếc', 'uploads/files/Products/Electronics/lenovo-legion-1.jpg', 'uploads/files/Products/Electronics/lenovo-legion-4.jpg,uploads/files/Products/Electronics/lenovo-legion-3.jpg,uploads/files/Products/Electronics/lenovo-legion-2.jpg', 26, 31, '[\"33\"]', 49990000, 'Laptop Lenovo Legion 7 16ACHG6 82N60038VN', 'Laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H sở hữu màn hình có kích thước 16 inch, sử dụng tấm nền IPS với độ phân giải 2560×1600.', 'lenovo,legion 7', '2021-12-17 00:28:40', '2021-12-28 22:01:09', NULL, 'free_ship', 0, '%', NULL, '5', 'on', '', NULL, 'https://cellphones.com.vn/laptop-lenovo-legion-7-16achg6-82n60038vn.html', NULL, '%', '<ul>\r\n	<li><strong><a href=\"https://cellphones.com.vn/laptop/lenovo/gaming.html\" target=\"_blank\">Lenovo Legion</a>&nbsp;7 16ACHG6 82N60038VN R7-5800H</strong></li>\r\n	<li>Laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H sở hữu m&agrave;n h&igrave;nh c&oacute; k&iacute;ch thước 16 inch.</li>\r\n	<li>Sử dụng tấm nền IPS với độ ph&acirc;n giải 2560&times;1600.</li>\r\n	<li>Đảm bảo người d&ugrave;ng sẽ trải nghiệm chất lượng h&igrave;nh ảnh v&ocirc; c&ugrave;ng sinh động ch&acirc;n thực cực l&yacute; tưởng cho chơi game đồ hoạ.&nbsp;</li>\r\n</ul>', '<h3><strong>Bộ vi xử l&yacute; AMD Ryzen&trade; 7 5800H, chipset AMD SoC Platform, card đồ hoạ Nvidia Geforce RTX 3060 6GB GDDR6</strong></h3>\r\n\r\n<p>Người d&ugrave;ng đặc biệt l&agrave; c&aacute;c game thủ sẽ v&ocirc; c&ugrave;ng th&iacute;ch th&uacute; khi trải nghiệm bộ vi xử l&yacute; AMD Ryzen&trade; 7 5800H, chipset AMD SoC Platform, card đồ hoạ Nvidia Geforce RTX 3060 6GB GDDR6. Đ&acirc;y l&agrave; bộ ba tạo n&ecirc;n thế giới game ch&acirc;n thực sống động v&ocirc; c&ugrave;ng.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/cable/Laptop-lenovo-legion-7-16achg6-82n60038vn-2.jpg\" /></p>\r\n\r\n<h3><strong>C&ocirc;ng nghệ l&agrave;m m&aacute;t Coldfront 3.0</strong></h3>\r\n\r\n<p>Laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H được trang bị c&ocirc;ng nghệ l&agrave;m m&aacute;t Coldfront 3.0 si&ecirc;u th&ocirc;ng minh. Với hơn 10.500 lỗ h&uacute;t kh&iacute; bổ sung dưới mỗi n&uacute;t ph&iacute;m, c&oacute; quạt k&eacute;p tăng &aacute;p, c&ocirc;ng nghệ buồng hơi,... Nhờ c&ocirc;ng nghệ n&agrave;y m&agrave; c&oacute; thể kiểm so&aacute;t được luồng kh&iacute; n&oacute;ng của m&aacute;y.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/cable/Laptop-lenovo-legion-7-16achg6-82n60038vn-3.jpg\" /></p>\r\n\r\n<h2><strong>Mua ngay laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H hiệu suất đỉnh cao tại Cellphones</strong></h2>\r\n\r\n<p>Chiếc laptop Lenovo Legion 7 16ACHG6 82N60038VN R7-5800H n&agrave;y kh&ocirc;ng những l&yacute; tưởng cho game thủ m&agrave; c&ograve;n l&agrave; phương tiện tuyệt vời để học tập v&agrave; l&agrave;m việc. Sở hữu ngay laptop Lenovo Legion 7 nhanh ch&oacute;ng bằng c&aacute;ch li&ecirc;n hệ với Cellphones ngay b&acirc;y giờ.</p>', 'qt_hidden', 1639706400, 1639821600, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"33\",\"values\":[\"SSD: 512GB\",\"SSD: 1TB\"]}]', NULL, '0', 37, NULL),
(85, 'Đồng hồ Samsung Galaxy Watch 3', 'dong-ho-samsung-galaxy-watch-3', 'Chiếc', 'uploads/files/Products/Electronics/galaxy-watch-2.jpg', 'uploads/files/Products/Electronics/galaxy-watch-4.jpg,uploads/files/Products/Electronics/galaxy-watch-3.jpg,uploads/files/Products/Electronics/galaxy-watch-1.jpg', 25, 7, NULL, 5900000, 'Đồng hồ thông minh Samsung Galaxy Watch 3 viền thép dây da.', 'Với Galaxy Watch 3 bạn sẽ có được một số liệu cụ thể quãng đường bạn đã đi, hay thậm chí là nhịp tim và số điện tâm đồ của bạn hiện hữu là bao nhiêu.', 'samsung,galaxy watch 3', '2021-12-17 01:17:59', '2021-12-25 00:44:31', 5, 'free_ship', 0, '%', NULL, '10', 'on', '', NULL, 'https://cellphones.com.vn/dong-ho-thong-minh-samsung-galaxy-watch-3.html', NULL, '%', '<ul>\r\n	<li>Mặt k&iacute;nh Gorilla Glass DX+ ,tấm nền Super Amoled chất lượng hiển thị r&otilde; r&agrave;ng,chi tiết</li>\r\n	<li>T&iacute;nh năng m&agrave;n h&igrave;nh lu&ocirc;n bật g&uacute;p dễ d&agrave;ng theo d&otilde;i giờ,th&ocirc;ng b&aacute;o</li>\r\n	<li>Ph&aacute;t th&ocirc;ng b&aacute;o khi ph&aacute;t hiện người d&ugrave;ng t&eacute; ng&atilde;</li>\r\n	<li>120 b&agrave;i tập c&oacute; sẵn,định vị GPS t&iacute;ch hợp ghi lại ch&iacute;nh x&aacute;c qu&atilde;ng đường luyện tập</li>\r\n	<li>C&aacute;c t&iacute;nh năng theo d&otilde;i sức khoẻ như theo d&otilde;i nhịp tim, giấc ngủ,đo Oxy trong m&aacute;u,huyết &aacute;p.....</li>\r\n</ul>', '<h3><strong>Thiết kế kim loại sang trọng, tinh tế c&ugrave;ng khả năng chống nước 5ATM/ IPX68 cực tốt</strong></h3>\r\n\r\n<p>Mang trong m&igrave;nh một thiết kế sang trọng với một viền bezel được l&agrave;m mờ cho khả năng chống trầy xước cao. C&ugrave;ng với đ&oacute; l&agrave; phần viền số được l&agrave;m ẩn v&agrave;o b&ecirc;n ph&iacute;a g&oacute;c trong của bạn m&agrave;n h&igrave;nh, gi&uacute;p tăng l&ecirc;n về ngo&agrave;i h&agrave;o nho&aacute;ng nhưng tiềm ẩn. Với một thiết kế bằng kim loại sang trọng, ch&uacute;ng gi&uacute;p cho bạn c&oacute; được &aacute;nh nh&igrave;n tốt hơn từ mọi người.</p>\r\n\r\n<p><img alt=\"Thiết kế kim loại sang trọng, tinh tế cùng khả năng chống nước 5ATM cực tốt\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/accessories/watch_band/samsung-galaxy-watch-3-7.jpg\" /></p>\r\n\r\n<p>C&oacute; thể n&oacute;i, chống nước l&agrave; một điều kh&ocirc;ng thể thiếu tr&ecirc;n c&aacute;c mẫu đồng hồ điện tử lẫn đồng hồ thời trang hiện nay. Với&nbsp;<strong>Galaxy Watch 3</strong>&nbsp;bạn sẽ được Samsung trang bị một c&ocirc;ng nghệ chống nước cho ph&eacute;p Samsung Galaxy Watch 3 c&oacute; thể chống nước được 5ATM với sức &eacute;p ở 50 m nước trong v&ograve;ng 10 ph&uacute;t đồng hồ.</p>\r\n\r\n<h3><strong>Hỗ trợ kết nối GPS cho tập luyện đa năng c&ugrave;ng khả năng đo nhịp tim ch&iacute;nh x&aacute;c</strong></h3>\r\n\r\n<p>Việc trang bị một cảm biến GPS cho chiếc đồng hồ th&ocirc;ng minh kh&ocirc;ng c&ograve;n l&agrave; một điều mới lạ nữa, ch&uacute;ng được xem như l&agrave; một chuẩn cho c&aacute;c đồng hồ th&ocirc;ng minh chuy&ecirc;n chạy bộ. Samsung Watch 3 l&agrave;m một điều tương tự, với một hệ thống chip GPS t&iacute;ch hợp b&ecirc;n trong cho ph&eacute;p bạn đo được qu&atilde;ng đường m&agrave; bạn đ&atilde; đi qua v&agrave; nơi n&agrave;o bạn đ&atilde; đến.</p>', 'qt_hidden', 1640055600, 1643626800, 0, 0, 'isAttribute', 1, '[]', NULL, '0', 15, NULL),
(86, 'LG Red Magic 7', 'lg-red-magic-7', 'Chiếc', 'uploads/files/Products/Electronics/red-magic-1.jpg', 'uploads/files/Products/Electronics/red-magic-4.jpg,uploads/files/Products/Electronics/red-magic-3.jpg,uploads/files/Products/Electronics/red-magic-2.jpg', 23, 8, '[\"15\"]', 17990000, 'LG Red Magic 6', 'LG Red Magic 6 được thiết kế với vẻ ngoài vô cùng mạnh mẽ và cá tính phù hợp với game thủ. Tuy khá tối giản về thiết kế nhưng lại thể hiện được sự thanh lịch và hầm hố.', 'lg,red magic 6', '2021-12-17 01:26:17', '2021-12-27 02:57:56', NULL, 'free_ship', 0, '%', NULL, '10', NULL, '', NULL, 'https://cellphones.com.vn/nubia-red-magic-6.html', NULL, '%', '<ul>\r\n	<li>Hiển thị ch&acirc;n thực, sống động - M&agrave;n h&igrave;nh tr&agrave;n viền 6,8 inch, 165Hz, t&iacute;ch hợp c&ocirc;ng nghệ bảo vệ mắt</li>\r\n	<li>Hiệu suất chơi game chuy&ecirc;n nghiệp - chip Snapdragon 888 mạnh mẽ, card đồ họa Adreno &trade; 660, đi k&egrave;m RAM 12GB</li>\r\n	<li>Chiến game kh&ocirc;ng lo cạn pin - vi&ecirc;n pin 5050 mAh, sạc nhanh 30W, hỗ trợ sạc tối đa 65W</li>\r\n	<li>Kết nối kh&ocirc;ng d&acirc;y vượt trội - Hỗ trợ wifi 6 v&agrave; mạng 5G</li>\r\n	<li>Chụp ảnh chuy&ecirc;n nghiệp, quay video 4K - cụm ba camera sau 64MP + 8MP + 2MP</li>\r\n</ul>', '<h3><strong>Thiết kế mạnh mẽ như một game thủ đ&iacute;ch thực</strong></h3>\r\n\r\n<p>Nubia Red Magic 6 được thiết kế với vẻ ngo&agrave;i v&ocirc; c&ugrave;ng mạnh mẽ v&agrave; c&aacute; t&iacute;nh ph&ugrave; hợp với game thủ. Tuy kh&aacute; tối giản về thiết kế nhưng lại thể hiện được sự thanh lịch v&agrave; hầm hố. Mặt sau c&oacute; dải đ&egrave;n RGB bắt mắt c&ugrave;ng d&ograve;ng chữ &ldquo;Redmagic&rdquo; v&agrave; logo ở ph&iacute;a dưới.</p>\r\n\r\n<p><img alt=\"Thiết kế mạnh mẽ như một game thủ đích thực\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/Dien-thoai-nubia-red-magic-6-1.jpg\" /></p>\r\n\r\n<p>Phần mặt trước của m&aacute;y được l&agrave;m bằng k&iacute;nh cường lực v&agrave; được uốn cong ở hai b&ecirc;n mang đến cảm gi&aacute;c cầm nắm v&ocirc; c&ugrave;ng chắc chắn. Phần khung m&aacute;y được bo tr&ograve;n kh&aacute; ho&agrave;n hảo l&agrave;m cho người d&ugrave;ng kh&ocirc;ng cảm nhận được khoảng trống giữa 2 mặt.</p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh 6.8 inch, v&ocirc; c&ugrave;ng sắc n&eacute;t</strong></h3>\r\n\r\n<p>Nubia Red Magic 6 sở hữu m&agrave;n h&igrave;nh AMOLED cực lớn với k&iacute;ch thước 6.8 inch. Độ ph&acirc;n giải của m&aacute;y Full HD+ mang đến chất lượng h&igrave;nh ảnh v&ocirc; c&ugrave;ng rực rỡ v&agrave; sắc n&eacute;t tới từng chi tiết. Đặc biệt c&ocirc;ng nghệ CPHY-DSI lần đầu ti&ecirc;n xuất hiện tr&ecirc;n điện thoại chơi game chuy&ecirc;n dụng tăng tốc độ truyền tải chất lượng cao gấp đ&ocirc;i tiết kiệm điện năng gấp nhiều lần.</p>\r\n\r\n<p><img alt=\"Màn hình 6.8 inch, vô cùng sắc nét\" src=\"https://cdn.cellphones.com.vn/media/wysiwyg/mobile/Dien-thoai-nubia-red-magic-6-2.jpg\" /></p>\r\n\r\n<p>Đặc biệt, tốc độ l&agrave;m mới m&agrave;n h&igrave;nh l&ecirc;n tới 165Hz - đ&acirc;y l&agrave; tốc độ chưa từng thấy tr&ecirc;n c&aacute;c phi&ecirc;n bản cao cấp của c&aacute;c thương hiệu kh&aacute;c khiến cho người chơi game với tốc độ khung h&igrave;nh cao sẽ trải nghiệm được sự mượt m&agrave; v&ocirc; c&ugrave;ng ấn tượng.</p>\r\n\r\n<p>Tần số cảm ứng của m&aacute;y cũng rất cao tới 500 Hz cho 1 ng&oacute;n tay v&agrave; 300Hz cho nhiều ng&oacute;n. Với tần số n&agrave;y, n&oacute; khiến cho m&agrave;n h&igrave;nh trở n&ecirc;n v&ocirc; c&ugrave;ng nhạy với mọi thao t&aacute;c của game thủ. Từ đ&oacute; c&aacute;c game thủ c&oacute; thể cảm nhận được sự ho&agrave;n hảo nhất.</p>\r\n\r\n<h3><strong>Hiệu năng&nbsp;</strong><strong>mạnh mẽ với chipset Snapdragon 888</strong></h3>\r\n\r\n<p>Điện thoại Nubia Red Magic 6 mang đến hiệu năng cực đỉnh với chipset Snapdragon 888. Đ&acirc;y l&agrave; chipset mạnh mẽ nhất của Qualcomm với những cải tiến h&agrave;ng đầu trong ng&agrave;nh về kết nối 5G, AI, chơi game cho ra 1 hiệu năng v&ocirc; c&ugrave;ng tuyệt đỉnh so với những điện thoại sử dụng chipset tiền nhiệm.</p>', 'qt_hidden', 1640196000, 1640311200, 0, 0, 'isAttribute', 1, '[{\"attribute_id\":\"15\",\"values\":[\"8GB DDR2\",\"16GB DDR2\"]}]', NULL, '0', 96, NULL),
(87, 'Điện thoại di động Samsung Galaxy', 'dien-thoai-di-dong-samsung-galaxy', 'chiec', 'uploads/files/Products/Electronics/xiaomi-redmi-3.jpg', 'uploads/files/Products/Electronics/xiaomi-redmi-4.jpg,uploads/files/Products/Electronics/xiaomi-redmi-3.jpg,uploads/files/Products/Electronics/xiaomi-redmi-2.jpg', 23, 7, '[\"15\"]', 15000000, 'dien thoai di dong sam sung', 'dang cap nhat', 'samsung,galaxy', '2021-12-23 03:25:47', '2021-12-23 05:21:37', 10, 'flat_rate', 20, '%', 'on', '4', 'on', '', NULL, NULL, 2, '%', '<p>dang cap nhat</p>', '<p>dang cap nhat</p>', 'qt_hidden', 1640228400, 1640300400, 0, 0, 'isAttribute', 2, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR2\",\"4GB DDR4\"]}]', '[\"#30336b\"]', '0', 3, '2021-12-23 05:21:37'),
(88, 'Điện thoại di động Samsung Galaxy A40', 'dien-thoai-di-dong-samsung-galaxy-a40', 'chiec', 'uploads/files/Products/Electronics/xiaomi-redmi-3.jpg', 'uploads/files/Products/Electronics/xiaomi-redmi-4.jpg,uploads/files/Products/Electronics/xiaomi-redmi-3.jpg,uploads/files/Products/Electronics/xiaomi-redmi-2.jpg', 23, 7, '[\"15\"]', 15000000, 'dien thoai di dong sam sung', 'dang cap nhat', 'demo,dien thoai', '2021-12-23 03:34:12', '2021-12-23 05:21:37', 10, 'free_ship', 0, '%', 'on', '10', 'on', '', NULL, NULL, 2, '%', '<p>dang cap nhat</p>', '<p>dang cap nhat</p>', 'qt_hidden', 1640228400, 1640300400, 0, 0, 'isAttribute', 2, '[{\"attribute_id\":\"15\",\"values\":[\"4GB DDR2\"]}]', NULL, '0', 5, '2021-12-23 05:21:37');
