(136, 28, 42, 4, 'laptop_hp_161b80edcda96c.jpg,laptop_hp_261b80edcdafba.jpg,laptop_hp_361b80edcdb0b0.jpg', 'Một trong những yếu tố khiến iPhone 13 Pro Max đáng mong chờ đó là thiết kế notch \"tai thỏ\" được thu gọn lại. Ngoài kích cỡ màn hình 6.7 inch với tấm nền Super Retina XDR OLED, máy sẽ có thiết kế notch được thu hẹp lại, giúp tăng tỷ lệ hiển thị trên màn hình điện thoại. Tất nhiên, những cảm biến quan trọng như TrueDepth, Face ID hoặc camera selfie đều sẽ giữ nguyên vị trí.', 1, NULL, NULL, 1, 1, NULL, 0, '2021-12-21 05:39:46', '2021-12-13 20:26:20', '2021-12-17 22:18:47', NULL),
